[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Queen Hyojeong (6 March 1831 – 2 January 1904) also known as Empress Dowager Myeongheon (명헌왕태후) was the Queen Consort of King Heonjong of Joseon, the 24th monarch of the Joseon Dynasty. She was of the Hong clan (명헌왕후 홍씨) <br>', 'title': 'Queen Hyojeong'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': "Heonjong of Joseon (8 September 1827 – 25 July 1849) was the 24th king of the Joseon Dynasty of Korea. He was the grandson of Sunjo. His father was Crown Prince Hyomyeong (posthumously named Ikjong), who died at the age of 20 before becoming king and his mother was Queen Sinjeong of the Pungyang Jo clan. Heonjong was born three-years before Hyomyeong's death.", 'title': 'Heonjong of Joseon'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'James Armour (15 January 1730 – 20 September 1798) was a master mason and father of Jean Armour, and therefore the father-in-law of the poet Robert Burns.', 'title': 'James Armour (Master mason)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Viscount was a general in the early Imperial Japanese Army. He was also the father- in- law of Field Marshal Gen Sugiyama.', 'title': 'Ogawa Mataji'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Peter Burroughs( born 27 January 1947) is a British television and film actor, the director of Willow Management. He is the father- in- law of actor and TV presenter Warwick Davis.', 'title': 'Peter Burroughs'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'John Vernou" Black Jack" Bouvier III( May 19, 1891 – August 3, 1957) was an American Wall Street stockbroker and socialite. He was the father of First Lady Jacqueline Kennedy Onassis and of socialite Lee Radziwill, and was the father- in- law of John F. Kennedy.', 'title': 'John Vernou Bouvier III'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Johann Ludwig von Westphalen( 11 July 1770 – 3 March 1842) was a liberal Prussian civil servant and the father- in- law of Karl Marx.', 'title': 'Ludwig von Westphalen'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'John Adams( 1672 or 1673 – 1745) was an American- born Canadian merchant and member of the Nova Scotia Council. He was the father- in- law of Henry Newton( politician).', 'title': 'John Adams (merchant)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Harry James Smith( July 30, 1888 – November 20, 1962) was an American long- distance runner. He was most notable for competing in the 1912 Olympics in Stockholm. He was also the father of Hart wrestling family matriarch Helen Hart and the father- in- law of Stu Hart.', 'title': 'Harry Smith (athlete)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Hans Barthold Andresen Butenschøn( 27 December 1877 – 28 November 1971) was a Norwegian businessperson. He was born in Kristiania as a son of Nils August Andresen Butenschøn and Hanna Butenschøn, and grandson of Nicolay Andresen. Together with Mabel Anette Plahte( 1877 – 1973, a daughter of Frithjof M. Plahte) he had the son Hans Barthold Andresen Butenschøn Jr. and was through him the father- in- law of Ragnhild Butenschøn and grandfather of Peter Butenschøn. Through his daughter Marie Claudine he was the father- in- law of Joakim Lehmkuhl, through his daughter Mabel Anette he was the father- in- law of Harald Astrup( a son of Sigurd Astrup) and through his daughter Nini Augusta he was the father- in- law of Ernst Torp. He took commerce school and agricultural school. He was hired in the family company N. A. Andresen& Co, and became a co-owner in 1910. He eventually became chief executive officer. The bank changed its name to Andresens Bank in 1913 and merged with Bergens Kreditbank in 1920. The merger was dissolved later in the 1920s. He was also a landowner, owning Nedre Skøyen farm and a lot of land in Enebakk. He chaired the board of Nydalens Compagnie from 1926, having not been a board member before that. He also chaired the supervisory council of Forsikringsselskapet Viking and Nedre Glommen salgsforening, and was a supervisory council member of Filharmonisk Selskap. He was a member of the gentlemen's club SK Fram since 1890, and was proclaimed a lifetime member in 1964. He was buried in Enebakk.", 'title': 'Barthold A. Butenschøn Sr.'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'GroupLogic, Inc., founded in 1988 and headquartered in Arlington, Virginia, USA, is an enterprise software company that develops, sells and supports software for moving and storing data including activEcho, mobilEcho, ArchiveConnect, MassTransit and ExtremeZ- IP. GroupLogic ’s products are used by information technology organizations to allow employees to access and manage corporate files regardless of the type of computing platform the employee is using to access the network. On September 13, 2012, GroupLogic announced that it became a subsidiary of Acronis, a software company specializing in backup and disaster recovery products and services.', 'title': 'GroupLogic'}
