 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'InBios International, Inc. is a medical diagnostic company based in Seattle that specializes in the detection of infectious diseases. The company was founded in 1996, and since its inception has developed several technologies useful in designing rapid and ELISA based immunodiagnostic assays. In April 2011, InBios International announced the clearance of its IgM test for dengue fever, DENV Detect IgM Capture ELISA. It is the first test for the diagnosis of dengue infection approved in the United States. The technology is based on detecting dengue specific IgM antibodies in the serum of afflicted patients. The test is available internationally, especially in Southeast Asia, where dengue fever is particularly prevalent. The company also manufactures tests for other infectious diseases, including Leishmaniasis, Chagas disease, Scrub Typhus, Leptospirosis, Malaria, and West Nile.', 'title': 'InBios'}
