 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'The Decision of Christopher Blake is a 1948 American drama film based upon the Moss Hart play. It was adapted by Ranald MacDougall and directed by Peter Godfrey. The film stars Alexis Smith, Robert Douglas, Cecil Kellaway, Ted Donaldson, John Hoyt and Harry Davenport and was released by Warner Bros. on December 23, 1948.', 'title': 'The Decision of Christopher Blake'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': "Peter Godfrey( 16 October 1899 – 4 March 1970) was an English actor and film director. Founder of the experimental Gate Theatre Studio in 1925, he staged London's first expressionistic production in the following year. Eventually moving to Hollywood, he established a career as a film actor and director.", 'title': 'Peter Godfrey (director)'}
