[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Xaveer De Geyter( born 1957) is a Belgian architect. De Geyter was born in Doornik, Belgium. He spent ten years at office for metropolitan architecture with Rem Koolhaas, where he worked on projects such as the Villa dall\'ava in Paris," urban design, melun sénart paris", the sea terminal in Zeebrugge, the zkm centre for art& media technology in Karlsruhe and two libraries for Jussieu University, Paris. De Geyter started his own firm in the early 1990s and built two private villas in Belgium. Early designs such as the" Ilot Saint Maurice" in Lille and the" Chassé Apartment" towers, Breda, exemplify his capacity for innovative architectural design. In 2001, a second office opened in Ghent, in collaboration with Stéphane Beel.', 'title': 'Xaveer De Geyter'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Pierre de la Vergne, aka" Pierre de Veruche, Pierre Verneyo, Pierre Veruco, Pierre Verrujo" or" Pierre Veroche", Latin" Petrus de Vernio"( died 6 October 1403 in Avignon was a French cardinal.', 'title': 'Pierre de la Vergne'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Halcón Suriano Jr./ Stukita( born May 8, 1994) is a Mexican" luchador enmascarado", or masked professional wrestler, under contract with the Mexican professional wrestling promotion Consejo Mundial de Lucha Libre( CMLL). Until the fall of 2018 he worked under the name" Stukita" in CMLL\'s" Mini- Estrella" division. Working in the Mini- Estrellas division did not mean that Stukita is a dwarf as several wrestlers who are just shorter in stature work in the" Mini" division. The name" Stukita" was the diminutive form of" Stuka", as he portrayed a smaller version of wrestlers Stuka and Stuka, Jr.. He is a third generation wrestler with both his father and grandfather being professional wrestlers before him, which he honors by working under the name\' Halcón Suriano Jr." His real name is not a matter of public record, as is often the case with masked wrestlers in Mexico where their private lives are kept a secret from the wrestling fans.', 'title': 'Halcón Suriano Jr.'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Franklin Pitcher Johnson jr., or Pitch Johnson, is a founder of multiple companies.', 'title': 'Franklin Pitcher Johnson Jr.'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Jean- Pierre de Keyser( born 13 April 1965) is a retired German football player.', 'title': 'Jean-Pierre de Keyser'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Miloš Zličić( born 29 December 1999) is a Serbian football forward. He is a younger brother of Lazar Zličić.', 'title': 'Miloš Zličić'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Pierre Chrétien De Geyter( 8 October 1848 – 26 September 1932) was a Belgian socialist( who later became a communist) and a composer, known for writing the music of" The Internationale".', 'title': 'Pierre De Geyter'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Julius De Geyter( Lede, 25 April 1830 – Antwerp, 18 February 1905) was a Flemish writer born in Lede, Belgium. He started his career as a teacher and journalist. In 1874, he became director of the Bank van Lening in Antwerp. Together with J.F.J. Heremans and E. Zetternam he founded the literary illustrated magazine" De Vlaamsche School", which existed from 1855 until 1862. Together with his friend Julius Vuylsteke he was one of the most important political poets of his time and he was one of the leaders of the Flemish movement. Julius De Geyter is the author of many romantic and political poems, which were mostly rhetorical and sometimes anticlerical. He wrote also to the texts of several cantatas of Peter Benoit, such as the" Rubenscantate" in 1877. In 1874, he also rewrote the text of Reinaert de Vos in rhyme. He died in Antwerp at age 74.', 'title': 'Julius de Geyter'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Pierre de Bénouville (8 August 1914 – 4 December 2001) was a French general.', 'title': 'Pierre de Bénouville'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Pierre Dulin, or Pierre d’ Ulin( 17 September 1669- 28 January 1748), was a French painter.', 'title': 'Pierre Dulin'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Abraham "Abe" Laboriel Jr. (born March 23, 1971) is an American session drummer. He is the son of Mexican bass guitarist Abraham Laboriel, nephew of Mexican rocker Johnny Laboriel, and brother of record producer, songwriter, and film composer Mateo Laboriel. He has been the drummer for Paul McCartney as well as for the French singer Mylène Farmer, among others.', 'title': 'Abe Laboriel Jr.'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Andrew Allen( born 6 May 1981) is a Canadian- born singer- songwriter from Vernon, British Columbia. He is signed to Sony/ ATV and has released 5 top 10 singles, and written and recorded many others, including" Where Did We Go?" with Carly Rae Jepsen. He also records covers and posts them on YouTube.', 'title': 'Andrew Allen (singer)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Donnie Elbert( May 25, 1936 – January 26, 1989) was an American soul singer and songwriter, who had a prolific career from the mid-1950s to the late 1970s. His US hits included" Where Did Our Love Go?"( 1972), and his reputation as a Northern soul artist in the UK was secured by" A Little Piece of Leather", a performance highlighting his powerful falsetto voice.', 'title': 'Donnie Elbert'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Benny Rubinstein is a former Israeli footballer who played in Maccabi Netanya and Hapoel Netanya, who now works in Real estate development. http://www.haaretz.com/print-edition/real-estate/where-did-the-millions-go-1.302730 Benny's son, Aviram also played football for Maccabi Netanya.", 'title': 'Benny Rubinstein'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Nancy Baron is an American rock singer who was active in New York City in the early 1960s, known for the singles" Where Did My Jimmy Go?" and" I\'ve Got A Feeling".', 'title': 'Nancy Baron'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Abraham Laboriel Sr. (born July 17, 1947) is a Mexican-American bassist who has played on over 4,000 recordings and soundtracks. " Guitar Player" magazine called him "the most widely used session bassist of our time". Laboriel is the father of drummer Abe Laboriel Jr. and of producer, songwriter, and film composer Mateo Laboriel. He is ranked No. 42 on "Bass Player" magazine\'s list of "The 100 Greatest Bass Players of All Time". Laboriel was born in Mexico City. A classically trained guitarist, he switched to bass guitar while studying at the Berklee College of Music. Henry Mancini encouraged Laboriel to move to Los Angeles, California, to pursue a recording career. His brother was Mexican rock singer Johnny Laboriel. Their parents were Garifuna immigrants from Honduras. Laboriel has worked with Al Jarreau, George Benson, Alan Silvestri, Alvaro Lopez and Res-Q Band, Alvin Slaughter, Don Felder, Andraé Crouch, Andy Pratt, Andy Summers, Barbra Streisand, Billy Cobham, Chris Isaak, Christopher Cross, Crystal Lewis, Dave Grusin, Djavan, Dolly Parton, Don Moen, Donald Fagen, Elton John, Engelbert Humperdinck, Freddie Hubbard, Phil Driscoll, Hanson, Herb Alpert, Herbie Hancock, Johnny Hallyday, Keith Green, Kelly Willard, Lalo Schifrin, Larry Carlton, Lee Ritenour, Leo Sayer, Lisa Loeb, Madonna, Michael Jackson, Nathan Davis, Paul Jackson Jr., Paul Simon, Quincy Jones, Ray Charles, Luis Miguel, Ron Kenoly, Russ Taff, Stevie Wonder, Umberto Tozzi, Randy Crawford and sometimes DeBarge. When Laboriel recorded his three solo albums ‒ "Dear FriendsGuidum", and "Justo & Abraham", he recruited a cast of musicians that included Alex Acuña, Al Jarreau, Jim Keltner, Phillip Bailey, Ron Kenoly, and others. His son Abe Laboriel Jr. played drums. Laboriel was a founding member of the bands Friendship and Koinonia. He plays live regularly with Greg Mathieson, drummer Bill Maxwell, and Justo Almario. Laboriel is now in the band Open Hands with Justo Almario, Greg Mathieson, and Bill Maxwell. In 2005, Abraham was awarded an Honorary Doctorate of Music by the Berklee College of Music.', 'title': 'Abraham Laboriel'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Robert Paul Smith( April 16, 1915 – January 30, 1977) was an American author, most famous for his classic evocation of childhood," Where Did You Go? Out. What Did You Do? Nothing".', 'title': 'Robert Paul Smith'}
