[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'John Wentworth( 1564–1613) was an English politician. He was the only son of Sir John Wentworth of Horkesley and Gosfield Hall, Essex, whom he succeeded in 1588. He was appointed High Sheriff of Essex in 1592 – 93. He was a Member of the Parliament of England for Essex in 1597 and for Wootton Bassett in 1601. He died in 1613 and was buried at Gosfield. He had married Cicely, also spelt Scissil, the daughter of Sir Edward Unton, with whom he had two sons and at least four daughters. He was succeeded by his son. His widow married Sir Edward Hoby.', 'title': 'John Wentworth (died 1613)'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Sir Thomas Hoby (1530 – 13 July 1566) was an English diplomat and translator. He was born in 1530, the second son of William Hoby of Leominster, Herefordshire, by his second wife, Katherine, daughter of John Forden. He matriculated at St. John\'s College, Cambridge in 1546. Encouraged by his sophisticated half-brother, Sir Philip Hoby, he subsequently visited France, Italy, and other foreign countries, and, as Roger Ascham states, "was many wayes well furnished with learning, and very expert in knowledge of divers tongues. " His tour of Italy, which included visits to Calabria and Sicily and which he documented in his autobiography, is the most extensive known to have been undertaken by an Englishman in the 16th century. In this and other respects, it may be regarded as a pioneering Grand Tour. On 27 June 1558, Hoby married Elizabeth, third daughter of Sir Anthony Cooke, of Gidea Hall, Essex. Elizabeth was a sister-in-law of Lord Burghley and a great friend of Queen Elizabeth I. The two were resident at Bisham Abbey in Berkshire. Hoby translated Martin Bucer\'s "Gratulation to the Church of England" (1549), and Baldassare Castiglione\'s "Il Cortegiano" (1561). The latter translation of "The Courtier", entitled "The Courtyer of Count Baldessar Castilio", had great popularity and was one of the key books of the English Renaissance. It provided a philosophy of life for the Elizabethan era gentleman. A reading of its pages fitted him for the full assimilation of the elaborate refinements of the new Renaissance society. It furnished his imagination with the symbol of a completely developed individual, an individual who united ethical theory with spontaneity and richness of character. On 9 March 1566 he was knighted at Greenwich, and was sent as ambassador to France at the end of the month. At the time of his landing in Calais, on 9 April, a soldier at the town gate shot through the English flag in two places. Hoby demanded redress for the insult, and obtained it after some delay, but he was not permitted to view the new fortifications. He died at Paris on 13 July 1566, and was buried at Bisham, Berkshire, where his widow erected a monument to his memory and to that of his half-brother Sir Philip Hoby. By his wife Elizabeth, Thomas Hoby had two sons, Edward and Thomas Posthumus (both subsequently knighted), and two daughters, who died young. The adults Elizabeth and Anne commemorated on the family tomb were not these daughters (who are depicted as children); they were rather the daughters which Hoby\'s wife, Elizabeth, had with her second husband Lord Russell.', 'title': 'Thomas Hoby'}
