[{'idx': 0, 'is_supporting': False, 'paragraph_text': '"Invading My Mind" is a song recorded by American entertainer Jennifer Lopez for her seventh studio album "Love?" (2011). It was written by RedOne, AJ Junior, BeatGeek, Teddy Sky, Bilal "The Chef", Jimmy Joker and produced by RedOne, Lopez, Lady Gaga, BeatGeek, Jimmy Joker and Kuk Harrell. "Invading My Mind" is an uptempo song that speaks of being overcome with a feeling that\'s "attacking, invading my mind". "Invading My Mind" received generally positive acclaim from music critics, who thought of the song to be single-worthy. The song drew comparisons to Ace of Base\'s 1995 single "Beautiful Life" and to the music of Kylie Minogue. It additionally was compared to Lopez\'s own single " On the Floor", but with "more of a groove feel". Upon the release of "Love?Invading My Mind" debuted at number ten on the South Korea Gaon International Chart.', 'title': 'Invading My Mind'}
