 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Etan Boritzer( born 1950) is an American writer of children ’s literature who is best known for his book" What is God?" first published in 1989. His best selling" What is?" illustrated children\'s book series on character education and difficult subjects for children is a popular teaching guide for parents, teachers and child- life professionals. Boritzer gained national critical acclaim after" What is God?" was published in 1989 although the book has caused controversy from religious fundamentalists for its universalist views. The other current books in the" What is?" series include What is Love?, What is Death?, What is Beautiful?, What is Funny?, What is Right?, What is Peace?, What is Money?, What is Dreaming?, What is a Friend?, What is True?, What is a Family?, What is a Feeling?" The series is now also translated into 15 languages. Boritzer was first published in 1963 at the age of 13 when he wrote an essay in his English class at Wade Junior High School in the Bronx, New York on the assassination of John F. Kennedy. His essay was included in a special anthology by New York City public school children compiled and published by the New York City Department of Education. Boritzer now lives in Venice, California and maintains his publishing office there also. He has helped numerous other authors to get published through" How to Get Your Book Published!" programs. Boritzer is also a yoga teacher who teaches regular classes locally and guest- teaches nationally. He is also recognized nationally as an erudite speaker on" The Teachings of the Buddha."', 'title': 'Etan Boritzer'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': '"In My Mind" is a song by American recording artist Shannon Sanders from his debut studio album, "Outta Nowhere" (1999). The song was covered by Trinidadian recording artist Heather Headley for her second studio album of the same name (2006). It was released on September 27, 2005 as the album\'s lead single, peaking at number seventy-five on the "Billboard" Hot 100 in early April 2006, while the song\'s remixes by the Freemasons and Dave Hernandez topped the Hot Dance Club Play. Headley\'s version of the track appeared on the April 20, 2008 episode of the comedy-drama television series "The Game", titled "Bury My Heart at Wounded Knee".', 'title': 'In My Mind (Heather Headley song)'}]

