 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Al Clark is an Australian film producer. He is best known for his producer role on" TheAdventures of Priscilla, Queen of the Desert" and his executive producer role on the film," Chopper". Clark is also the author of two books. " Raymond Chandler in Hollywood" provides an insight into the work of the writer of detective fiction and includes interviews with many of the Hollywood figures who were associated with Raymond Chandler and his films. Among them Clark interviewed Lauren Bacall, Alfred Hitchcock, Fred MacMurray and Robert Montgomery. His second book was" Making Priscilla", also titled" The Lavender Bus: How a Hit Movie Was Made and Sold", a behind the scenes tale chronicling the follies of the film making business and how" The Adventures of Priscilla, Queen of the Desert" became an international success.', 'title': 'Al Clark (producer)'}
