 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Robert Tronson (18 May 1924 – 27 November 2008) was an English film and television director, born in Chilmark, Wiltshire. Educated at Churcher\'s College in Hampshire, followed by the Royal Naval College, Dartmouth, he served with the Royal Navy from 1941. After leaving the service at the end of the Second World War he determined to become a writer, but soon joined the BBC, where he produced children\'s television programmes. In 1955 he joined Associated-Rediffusion, and by the end of the decade he was working on television drama serials. From the 1960s onwards he worked as a freelance director in a career spanning almost 50 years. His final television credits were for directing five episodes of "Hetty Wainthropp Investigates" for the BBC, between 1996 and 1998. In 1965 Tronson married Nona Richards (died 1987). He died on 27 November 2008 and was survived by their son.', 'title': 'Robert Tronson'}
