 {'idx': 5, 'is_supporting': True, 'paragraph_text': "Ulric-Joseph Tessier (May 3, 1817 – April 7, 1892) was a Quebec lawyer, judge, seigneur and political figure. He was a member of the Senate of Canada representing the Gulf division from 1867 to 1873 and served as mayor of Quebec City from 1853 to 1854. He was born Joseph-Ulric Tessier in Quebec City in 1817 and studied at the Petit Séminaire de Québec. He articled in law with Hector-Simon Huot and was admitted to the bar in 1839. Tessier was elected to city council in 1846. The following year, he married Marguerite-Adèle Kelly, heiress to the seigneury of Rimouski. In 1851, he was elected to the Legislative Assembly of the Province of Canada for Portneuf. He helped found the North Shore Railway in 1853 and, in 1858, the Banque Nationale, serving as its first president. He was part of a group that lobbied for Quebec City as the capital of Canada in London in 1857. Tessier was a professor in the faculty of law at the Université Laval. In 1858, he was elected to the Legislative Council for the Gulf division; he served as Minister of Public Works in the Executive Council from 1862 to 1863. Tessier was speaker for the Legislative Council from 1863 until Confederation, when he was appointed to the Senate. He was named Queen's Counsel in 1863. In 1869, his wife inherited the seigneury of Rimouski after the death of her mother; Tessier also purchased the seigneuries of Le Bic, Saint-Fabien, Saint-Simon, Saint-Mathieu, Trois-Pistoles and part of Île-d’Orléans. In 1873, Tessier resigned from the Senate to become a judge in the Quebec Superior Court in Quebec district; in 1875, he was named to the Court of Queen's Bench. His published works included: He died in Quebec City in 1892 and was buried in the Cimetière Notre-Dame-de-Belmont. One son, Auguste, later served in the Quebec assembly and as a judge; another, Jules, served in the Quebec assembly and the Canadian Senate.", 'title': 'Ulric-Joseph Tessier'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Ancient Egyptian artisan Sennedjem lived in Set Maat( translated as" The Place of Truth"), contemporary Deir el- Medina, on the west bank of the Nile, opposite Thebes, during the reigns of Seti I and Ramesses II. Sennedjem had the title" Servant in the Place of Truth". He was buried along with his wife, Iyneferti, and family in a tomb in the village necropolis. His tomb was discovered January 31, 1886. When Sennedjem\'s tomb was found, in it there was regular furniture from his home, including a stool and a bed, which he actually used when he was alive. His titles included Servant in the Place of Truth, meaning that he worked on the excavation and decoration of the nearby royal tombs.', 'title': 'Sennedjem'}
