 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Roger William Corman( born April 5, 1926) is an American director, producer, and actor. He has been called" The Pope of Pop Cinema" and is known as a trailblazer in the world of independent film. Much of Corman\'s work has an established critical reputation, such as his cycle of low- budget cult films adapted from the tales of Edgar Allan Poe. Admired by members of the French New Wave and" Cahiers du cinéma", in 1964 Corman was the youngest filmmaker to have a retrospective at the Cinémathèque Française, as well as in the British Film Institute and the Museum of Modern Art. He was the co-founder of New World Pictures, a prolific multimedia company that helped to cement Fox as a major American television network, and is a longtime member of the Academy of Motion Picture Arts and Sciences. In 2009, he was awarded an Honorary Academy Award" for his rich engendering of films and filmmakers." Corman mentored and gave a start to many young film directors such as Francis Ford Coppola, Ron Howard, Martin Scorsese, Jonathan Demme, John Sayles, and James Cameron, and was highly influential in the New Hollywood filmmaking movement of the 1960s and 1970s. He also helped to launch the careers of actors like Peter Fonda, Jack Nicholson, Dennis Hopper, Bruce Dern, Sylvester Stallone, Diane Ladd, and William Shatner. Corman has occasionally taken minor acting roles in the films of directors who started with him, including" The Silence of the Lambs The Godfather Part IIApollo 13 The Manchurian Candidate" and" Philadelphia". A documentary about Corman\'s life and career entitled, directed by Alex Stapleton, premiered at the Sundance and Cannes Film Festivals in 2011. The film\'s TV rights were picked up by A&E IndieFilms after a well- received screening at Sundance.', 'title': 'Roger Corman'}
