 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Sophia of Pomerania- Stolp( 1435 – 24 August 1497), was a Duchess of Pomerania by birth, and married to Eric II, Duke of Pomerania. Sophia was the daughter of Bogislaw IX, Duke of Pomerania and Maria of Masovia. In 1446, her father died and was succeeded by his cousin, Eric of Pomerania, former King of Denmark, Norway and Sweden. Sophia became the heir of Eric of Pomerania's private fortune. In 1451, Sophia was married to Eric of Pomerania- Wolgast, making her spouse the heir of Eric of Pomerania's territories, while Sophia remained the heir of Eric of Pomerania's private fortune. At the death of Eric of Pomerania in 1459, Sophia's husband united Pomerania through the inheritance of Pomerania- Stolp and Pomerania- Rügenwalde by his marriage, while Sophia became the sole possessor of the vast fortune brought by Eric of Pomerania from his former kingdoms in Scandinavia, as well as the wealth he had acquired by his piracy activity on Gotland. As Eric refused to allow Sophia any of the political power over the territories he acquired through her, which she felt she was entitled to, the couple separated. Sophia moved to Rügenwalde Castle with her children and her lover, Hans of Maszerski. In 1470, she refused to finance her husband's war with Brandenburg. She was widowed in 1474. According to an old legend, she was to have poisoned her sons Wratislaw and Casimir, but when she tried to the same with her son Bogislaw with a poisoned sandwich, he was warned by his jester. The sandwich was given to a dog, who died, after which Sophia was to have fled to Danzig.", 'title': 'Sophie of Pomerania, Duchess of Pomerania'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Bogislaw XIII (Bogusław XIII) of Pomerania (9 August 1544 – 7 March 1606, Stettin; "Polish": Szczecin), son of Philip I and Maria of Saxony, was a prince of Stettin and Wolgast, and a member of the Griffins. Bogislaw studied at the University of Greifswald at the age of 14. At first, he was co-regent with his brother Johann Friedrich of Pomerania-Wolgast, but in 1569 he settled with control over Barth and Neuenkamp. There, he founded a printing house in 1582, publishing in 1588 the "Barther Bible", a bible in the Low German language, as translated by Johannes Bugenhagen. In 1587 he founded Franzburg to compete with Stralsund. From 1603 until his death, he ruled in Pomerania-Stettin, which he inherited under the Inheritance Treat of Jasenitz of 1509 in case his two brothers John Frederick (d. 1600) and Barnim X (d. 1603) would both die childless. He kept his residence in Barth, and his eldest son, Philip II, acted as governor in Stettin. He is remembered as a wise ruler, knowledgeable in the areas of economics and governance. He married twice: first to Clara of Brunswick-Lüneburg, daughter of Francis, Duke of Brunswick-Lüneburg, then to Anna of Schleswig-Holstein-Sonderburg, daughter of John II, Duke of Schleswig-Holstein-Sonderburg. He had eleven children, among which, from his first marriage:', 'title': 'Bogislaw XIII, Duke of Pomerania'}]

