 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Charles II (29 May 1630 – 6 February 1685) was king of England, Scotland, and Ireland. He was king of Scotland from 1649 until his deposition in 1651, and king of England, Scotland and Ireland from the 1660 Restoration of the monarchy until his death. Charles II was the eldest surviving child of Charles I of England, Scotland and Ireland and Henrietta Maria of France. After Charles I\'s execution at Whitehall on 30 January 1649, at the climax of the English Civil War, the Parliament of Scotland proclaimed Charles II king on 5 February 1649. However, England entered the period known as the English Interregnum or the English Commonwealth, and the country was a "de facto" republic led by Oliver Cromwell. Cromwell defeated Charles II at the Battle of Worcester on 3 September 1651, and Charles fled to mainland Europe. Cromwell became virtual dictator of England, Scotland and Ireland. Charles spent the next nine years in exile in France, the Dutch Republic and the Spanish Netherlands. A political crisis that followed the death of Cromwell in 1658 resulted in the restoration of the monarchy, and Charles was invited to return to Britain. On 29 May 1660, his 30th birthday, he was received in London to public acclaim. After 1660, all legal documents stating a regnal year did so as if he had succeeded his father as king in 1649. Charles\'s English parliament enacted laws known as the Clarendon Code, designed to shore up the position of the re-established Church of England. Charles acquiesced to the Clarendon Code even though he favoured a policy of religious tolerance. The major foreign policy issue of his early reign was the Second Anglo-Dutch War. In 1670, he entered into the Treaty of Dover, an alliance with his cousin King Louis XIV of France. Louis agreed to aid him in the Third Anglo-Dutch War and pay him a pension, and Charles secretly promised to convert to Catholicism at an unspecified future date. Charles attempted to introduce religious freedom for Catholics and Protestant dissenters with his 1672 Royal Declaration of Indulgence, but the English Parliament forced him to withdraw it. In 1679, Titus Oates\'s revelations of a supposed Popish Plot sparked the Exclusion Crisis when it was revealed that Charles\'s brother and heir presumptive, James, Duke of York, was a Catholic. The crisis saw the birth of the pro-exclusion Whig and anti-exclusion Tory parties. Charles sided with the Tories, and, following the discovery of the Rye House Plot to murder Charles and James in 1683, some Whig leaders were executed or forced into exile. Charles dissolved the English Parliament in 1681, and ruled alone until his death in 1685. He was received into the Catholic Church on his deathbed. Charles was one of the most popular and beloved kings of England, known as the "Merry Monarch", in reference to both the liveliness and hedonism of his court and the general relief at the return to normality after over a decade of rule by Cromwell and the Puritans. Charles\'s wife, Catherine of Braganza, bore no live children, but Charles acknowledged at least twelve illegitimate children by various mistresses. He was succeeded by his brother James.', 'title': 'Charles II of England'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Sebastião José de Carvalho e Melo, 1st Marquis of Pombal, 1st Count of Oeiras( 13 May 1699 – 8 May 1782), popularly known as the Marquis of Pombal(" Marquês de Pombal"), was an 18th- century Portuguese statesman. He was Secretary of the State of Internal Affairs of the Kingdom( the equivalent of a Prime Minister today) in the government of Joseph I of Portugal from 1750 to 1777. Apart from being the most prominent minister in the government, he has also been considered to have been its" de facto" head. Pombal was notable for his swift and competent leadership in the aftermath of the 1755 Lisbon earthquake. He implemented sweeping economic policies in Portugal to regulate commercial activity and standardise quality throughout the country, and was instrumental in weakening the grip of the Inquisition. The term" Pombaline" is used to describe not only his tenure, but also the architectural style adopted in Lisbon after the great earthquake. Pombal, who was considered an" estrangeirado"( that is, someone who admired, was influenced by or promoted foreign ideas in Portugal), introduced many fundamental administrative, educational, economic, and ecclesiastical reforms justified in the name of" reason" and instrumental in advancing secularisation in Portugal. However, historians argue that Pombal\'s implementation of the ideas of the" Enlightenment", while far- reaching, was primarily a mechanism for enhancing autocracy at the expense of individual liberty. This included the crushing of opposition, the suppression of criticism, print censorship, the furthering of colonial economic exploitation for Portugal\'s own benefit, and, at a personal level, the consolidation of his own direct and widespread control for his own profit. He was the leading opponent of the Jesuits across Europe.', 'title': 'Sebastião José de Carvalho e Melo, 1st Marquis of Pombal'}
