 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Nandamuri Taraka Rama Rao( 28 May 1923 – 18 January 1996), popularly known as NTR, was an Indian actor, producer, director, editor and politician who served as Chief Minister of Andhra Pradesh for seven years over three terms. He is widely regarded as one of the greatest actors of Indian cinema and one of the two legends of Telugu cinema, along wih Akkineni Nageswara Rao. NTR received three National Film Awards for co-producing" Thodu Dongalu"( 1954) and" Seetharama Kalyanam"( 1960) under National Art Theater, Madras, and for directing" Varakatnam"( 1970). NTR has received the erstwhile Rashtrapati Awards for his performance( s) in the" Raju Peda"( 1954) and the" Lava Kusa"( 1963). He garnered the Nandi Award for Best Actor for" Kodalu Diddina Kapuram" in 1970, and the Inaugural Filmfare Award for Best Actor – Telugu in 1972 for" Badi Panthulu". NTR made his debut as an actor in a Telugu social film" Mana Desam", directed by L. V. Prasad in 1949. He gained popularity in the 1950s when he became well known for his portrayals of Hindu deities, especially Krishna and Rama, roles which have made him a" messiah of the masses". He later became known for portraying antagonistic characters and Robin Hood- esque hero characters in films. In total, he starred in 300 films, and has become one of the most prominent figures in the history of Telugu cinema. He was voted" Greatest Indian Actor of All Time" in a CNN- IBN national poll conducted in 2013 on the occasion of the Centenary of Indian Cinema. He starred in such films as" Patala Bhairavi"( 1951), which premiered at the first India International Film Festival, held in Mumbai on 24 January 1952," Malliswari"( 1951), premiered at Asia Pacific Film Festival, the enduring classics" Mayabazar"( 1957) and" Nartanasala"( 1963), featured at Afro Asian film festival in Jakarta. All the four films were included in CNN- IBN\'s list of" Hundred greatest Indian films of all time". He