 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Decimus Junius Brutus Callaicus( or Gallaecus or Callaecus)( 180 BC113 BC) was a consul of the Roman Republic for the year 138 BC together with Publius Cornelius Scipio Nasica Serapio. He was an optimate politician and a military commander in Hispania and in Illyria. He was the son of Marcus Junius Brutus( consul in 178 BC) and brother of Marcus Junius Brutus( praetor in 88 BC). He had a son also named Decimus Junius Brutus( consul in 77 BC) and his grandson was Decimus Junius Brutus Albinus. Decimus Junius Brutus belonged to the optimates, a political faction which supported the interests of the aristocracy and was opposed to both the plebeian tribunes( the representatives of the plebs) and populares, a political faction which championed the cause of the poor and wanted reforms to help them. During his consulship he and his colleague P. Cornelius Scipio Nasica opposed the plebeian tribunes. The plebeian tribune Gaius Curiatus sent both consuls to prison because they did not allow the plebeian tribunes to select ten men who would be exempt from military service. The two consuls also opposed a proposal by the tribunes to purchase grain from abroad because the price of grain was going up. Scipio Nasica made a speech which quieted the restless plebs.', 'title': 'Decimus Junius Brutus Callaicus'}
