 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Robert Gregory (1727 – 1 September 1810) was an Irish-born East India merchant and politician who sat in the British House of Commons from 1768 to 1784. Gregory was the only son of Henry Gregory of Galway and his wife Mary Shawe. He went to India where he served with Honourable East India Company and made a considerable fortune. In 1766 he returned from India and settled in Kent. In 1768, he acquired the Coole Park estate of 8,000 acres near Gort in County Galway in Ireland and built a house there. Gregory was a Member of Parliament (MP) for Maidstone from 18 March 1768 – 8 October 1774. He was then MP for Rochester, Kent from 7 October 1774 to 1 April 1784. He was also a director of the East India Company between 1769 and 1782 and then chairman briefly before he retired through ill-health. Gregory married Maria Auchmuty, daughter of an official of the East India Company, and they had three sons. Of these, William Gregory was civil-under secretary for Ireland from 1812 to 1830 and was the father of another Robert Gregory, who died in 1847 from a disease he contracted ministering to his sick tenants. He in turn was the father of William Henry Gregory.', 'title': 'Robert Gregory (MP)'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Isabella Augusta, Lady Gregory ("née" Persse; 15 March 1852 – 22 May 1932) was an Irish dramatist, folklorist and theatre manager. With William Butler Yeats and Edward Martyn, she co-founded the Irish Literary Theatre and the Abbey Theatre, and wrote numerous short works for both companies. Lady Gregory produced a number of books of retellings of stories taken from Irish mythology. Born into a class that identified closely with British rule, she turned against it. Her conversion to cultural nationalism, as evidenced by her writings, was emblematic of many of the political struggles to occur in Ireland during her lifetime. Lady Gregory is mainly remembered for her work behind the Irish Literary Revival. Her home at Coole Park in County Galway served as an important meeting place for leading Revival figures, and her early work as a member of the board of the Abbey was at least as important as her creative writings for that theatre\'s development. Lady Gregory\'s motto was taken from Aristotle: "To think like a wise man, but to express oneself like the common people."', 'title': 'Augusta, Lady Gregory'}
