[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Omkar Prasad Nayyar (16 January 1926 – 28 January 2007) was an Indian film music composer, singer-songwriter, music producer, and musician. He is considered to be one of the most rhythmic and melodious music directors of the Hindi film industry. He won the 1958 Filmfare Award for Best Music Director (for "Naya Daur"). Nayyar worked extensively with singers Geeta Dutt, Asha Bhosle and Mohammed Rafi, Shamshad Begum, Mahendra Kapoor, and Kishore Kumar. Based on a Bengali language work by Rabindranath Tagore, Nayyar composed Chal Akelaa, Chal Akelaa (sung by Mukesh in 1969 film Sambandh). The song became an enormous hit and the movie celebrated a jubilee at Bombay\'s Maratha Mandir. Major Accomplishments Nayyar produced songs with Shamshad Begum in "Aar Paar ", such as Kabhi Aar kabhi paar, which are still popular after over 60 years. Some of the most beautiful and talented actresses that Nayyar worked with include Madhubala, Vyjayanthimala, Mala Sinha, [[Padmini], [[Asha Parekh]], [[Sharmila Tagore]] , Mumtaz, Nutan, Tanuja, Meena Kumari, Rajshree, and Rekha. Nayyar and Bhosle parted ways in 1974, and he then worked with Dilraj Kaur, Alka Yagnik, Krishna Kale, [[Vani Jayaram]] and Kavita Krishanmurthy. O.P.Nayyar composed phenomenal songs for all the major and well known Indian actors, such as Dilip Kumar, Dev Anand, Raj Kapoor, Ashok Kumar, Shammi Kapoor, Dharmendra, Manoj Kumar, Bharat Bhushan, and many many others, including Salman Khan and the amazing producer, director, actor Guru Dutt. [[Sahir Ludhianvi]] wrote the lyrics for three of Nayyar\'s earlier films such as Naya Daur" Bade Sarkar and Sone ki Chidya". Nayyar also worked with developing lyricists such as [[Jan Nisar Akhtar]], [[Qamar Jalalabadi]], [[S. H. Bihari]] , Ahmed Wasi, Anjaan, Aziz Kashmiri. By far Majrooh Sultanpuri was the most successful and long lasting lyricist for O.P.Nayyar. They had a magical connection which ended in Phir Whi Dil Laya Hoon. Nayyar wrote Yeh Desh Hai Veer Jawaanonkaa (featuring [[Dilip Kumar]] and Ajit) for "Naya Daur" (1957). The song earned him the 1958 Filmfare Best Music Director Award. The last Nayyar song performed by Bhosle was Chain Se Humko Kabhi in "[[Pran Jaye Par Vachan Na Jaye]] " (1973), disappeared in the film\'s final cut but won Bhosle the 1975 [[Filmfare Award for Best Female Playback Singer]]. In addition to Hindi films, Nayyar composed for "Neerajanam" in [[Telugu language|Telugu]], which became a major hit in Telugu films.. He made a brief comeback during the 1990s with "Mangni" and "Nishchay" in 1992 and "Zid" in 1994. O.P. Nayyar played a major part in shaping Asha\'s career but Asha rarely mentioned it after her split with him.', 'title': 'O. P. Nayyar'}
