 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'José A(gustín) Ferreyra (28 August 1889 – 29 January 1943), popularly known as "Negro Ferreyra" (Black Ferreyra, due to his mulato ethnicity), was an early Argentine film director, screenwriter and film producer. He was also sometimes credited as production designer. Ferreyra was born in Vicente López, Gran Buenos Aires. He began simultaneously directing and screenwriting for film in 1915, and moved on to success directing films such as "Palomas rubias" in 1920. His films tended to focus on lower-class family drama, most notably "Perdón, viejita" (1927), and were filmed on a low budget and with little to no script as a guide. Ferreyra prevailes through the 1920s and 1930s as a distinguished filmmaker of the masses, but was displaced in the late 1930s and early 1940s by big budget cinema. He directed over 40 films and wrote the scripts for the majority of them between 1915 and 1941, working with noted actors such as Libertad Lamarque and Mario Soffici on his screen debut, before moving on to directing. He died on 29 January 1943 from throat cancer.', 'title': 'José A. Ferreyra'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Smokey and the Bandit Part 3 is a 1983 American action comedy film and a sequel to" Smokey and the Bandit"( 1977) and" Smokey and the Bandit II"( 1980), starring Jackie Gleason, Jerry Reed, Paul Williams, Pat McCormick, Mike Henry and Colleen Camp. The film also includes a cameo near the film\'s end by the original Bandit, Burt Reynolds. With the budget of a television movie, which was around twice the budget used for the first part, many action and comedic scenes are rehashes of scenes from the previous two" Smokey and the Bandit" films. The film received overwhelming negative reviews from critics and audiences alike.', 'title': 'Smokey and the Bandit Part 3'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Smokey and the Bandit is a 1977 American action comedy film starring Burt Reynolds, Sally Field, Jackie Gleason, Jerry Reed, Pat McCormick, Paul Williams and Mike Henry. The film was the directorial debut of stuntman Hal Needham. The film follows Bo "Bandit" Darville (Reynolds) and Cledus "Snowman" Snow (Reed), two bootleggers, as they attempt to drive from Atlanta to Texarkana, pick up 400 cases of Coors beer, and illegally transport it back to Atlanta in 28 hours or less. While Snow drives the truck carrying the beer, the Bandit drives a Pontiac Trans Am to distract law enforcement and keep the attention off Snow. During their run, they are relentlessly pursued by Buford T. Justice (Gleason), a blusterous Texas county sheriff. "Smokey and the Bandit" was followed by two sequels: "Smokey and the Bandit II" (1980) and "Smokey and the Bandit Part 3" (1983). "Smokey and the Bandit" was the second highest-grossing domestic film of 1977, second only to "Star Wars", the first film in the original "Star Wars" trilogy.', 'title': 'Smokey and the Bandit'}
