 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Smokey and the Bandit II is a 1980 American action comedy film directed by Hal Needham, and stars Burt Reynolds, Sally Field, Jerry Reed, Jackie Gleason and Dom DeLuise. The film is the sequel to the 1977 film" Smokey and the Bandit". The film was originally released in the United Kingdom, New Zealand, Australia and several other, mainly Commonwealth countries as Smokey and the Bandit Ride Again. Early video releases and TV broadcasts also used this title, but in more recent years most have reverted to the original U.S. title. It was followed by another sequel three years later," Smokey and the Bandit Part 3"( 1983), in which Reynolds only made a brief cameo appearance, and Sally Field did not appear. The plot centers on Bo" Bandit" Darville( Burt Reynolds) and Cledus" Snowman" Snow( Jerry Reed), transporting an elephant to the GOP National Convention, with Sheriff Buford T. Justice( Jackie Gleason) in hot pursuit once again.', 'title': 'Smokey and the Bandit II'}
