[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Margaret of Blois (French: "Marguerite"; died 1230) was "suo jure" Countess of Blois from 1218 to 1230, in what is now France.', 'title': 'Margaret, Countess of Blois'}
