 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Maria of Bulgaria was the second Empress consort of Henry of Flanders, Latin Emperor of Constantinople.', 'title': 'Maria of Bulgaria, Latin Empress'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Theobald II, Count of Blois( Thibaut II; c. 985 – 11 July 1004) was the eldest son and heir of Odo I, Count of Blois, and Bertha of Burgundy. The stepson of Robert II of France, he became Count of Blois, Châteaudun, Chartres and Reims after the death of his father in 996. Theobald II left no heirs; on his death, he was succeeded by his younger brother, Odo II, Count of Blois.', 'title': 'Theobald II of Blois'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Theobald VI of Blois( French:" Thibaut")( died 1218) was count of Blois and Clermont- en- Beauvaisis from 1205 to 1218. He was son of Louis I of Blois and Catherine of Clermont. Theobald married twice: with Maud of Alençon and with Clemence of Roches, but remained childless. Clemence married Geoffrey VI, Viscount of Châteaudun, as her second husband. Theobald fought the Moors in Castile. During the campaign he contracted leprosy and returned home. After living withdrawn in his castle in La Ferté- Villeneuil for a few years he died in 1218, leaving his possessions to his aunts Margaret and Isabelle. The northern part of Blois was erected into the County of Chartres for Isabelle; Margaret received the remainder of the County of Blois, and he sold Clermont to the crown before he died.', 'title': 'Theobald VI, Count of Blois'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Henry of Blois( c. 1096 8 August 1171), often known as Henry of Winchester, was Abbot of Glastonbury Abbey from 1126, and Bishop of Winchester from 1129 to his death. He was a younger son of Stephen Henry, Count of Blois by Adela of Normandy, daughter of William the Conqueror and Matilda of Flanders. Thus, he was a younger brother of Stephen, King of England.', 'title': 'Henry of Blois'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Adela of Normandy, of Blois, or of England (c. 1067 – 8 March 1137), also known as in Roman Catholicism, was a daughter of William the Conqueror and Matilda of Flanders who later became the Countess of Blois, Chartres, and Meaux by marriage to Stephen II, Count of Blois. Her husband greatly benefited from the increased social status and prestige that came with such a marriage. She brought with her not only her bloodline, but a wedding gift of money and other movable goods from the prodigious store of Anglo-Norman wealth. She was regent of Blois during the absence of her spouse in 1096–1100 and 1101–02, and during the minority of her son from 1102 until 1120. Adela was the mother of Stephen, King of England and Henry of Blois, Bishop of Winchester. The couple had ten children, though it is not certain if all were Adela's biological children. It is only certain that she had five sons and might have had three or more daughters.", 'title': 'Adela of Normandy'}
