 {'idx': 3, 'is_supporting': True, 'paragraph_text': '"Afterglow" is a song recorded by Tina Turner, written and produced by Terry Britten and Graham Lyle, and produced by Britten. It appeared on her studio album "Break Every Rule" (1986), and featured Steve Winwood on keyboards. The song was the eighth and final song from the album to be released as a single, if only in the United States. It failed to crack the US Hot 100, but it reached number 5 on the US dance charts and number 20 on the Maxi Single Sales chart. A promo video for the track was filmed as part of the "Break Every Rule" TV special in 1986, in which it was the opening number. It shows Turner performing the song in her dressing room at the club Le Zero in Paris as she is preparing to go on stage.', 'title': 'Afterglow (Tina Turner song)'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Tina Turner (born Anna Mae Bullock, November 26, 1939) is an American-Swiss singer and actress. Originally from the United States, she became a Swiss citizen in 2013. Turner rose to prominence as part of the Ike & Tina Turner Revue before launching a successful career as a solo performer. One of the best-selling recording artists of all time, she has been referred to as The Queen of Rock \'n\' Roll and has sold more than 200 million records worldwide. Turner is noted for her energetic stage presence, powerful vocals, and career longevity. Turner began her career in 1958 as a featured singer with Ike Turner\'s Kings of Rhythm, recording under the name "Little Ann" on "Boxtop". Her introduction to the public as Tina Turner began with the hit single "A Fool in Love" (1960), released by the Ike & Tina Turner Revue. She married Ike Turner in 1962. Success followed with a string of notable hits, including "River Deep – Mountain High" (1966), the Grammy-winning "Proud Mary" (1971), and "Nutbush City Limits" (1973). Raised a Baptist, she became an adherent of Nichiren Buddhism in 1973, crediting the spiritual chant of "Nam Myoho Renge Kyo" with helping her to endure during difficult times. Turner separated from Ike Turner in 1976, ending both their personal relationship and their musical partnership; the couple divorced in 1978. In her autobiography, "I, Tina: My Life Story" (1986), Turner revealed that Ike Turner had subjected her to domestic violence. In the 1980s, Turner launched a major comeback as a solo artist. The 1983 single "Let\'s Stay Together" was followed by the release of her fifth solo album, "Private Dancer" (1984), which became a worldwide success. The album contained the hit song "What\'s Love Got to Do with It" (1984). Turner won the Grammy Award for Record Of The Year for the single, and it became her first (and only) #1 hit in the United States. Turner\'s solo success continued throughout the 1980s and 1990s with multi-platinum albums and hit singles. Her U.S. Top 10 hits from this period include "Better Be Good to Me" (1984), "Private Dancer" (1984), "We Don\'t Need Another Hero (Thunderdome)" (1985), "Typical Male" (1986), and "I Don\'t Wanna Fight" (1993). In 1993, "What\'s Love Got to Do with It", a biographical film adapted from Turner\'s autobiography, was released along with an accompanying soundtrack album. Turner also achieved success as an actress in films such as the 1975 rock musical "Tommy", the 1985 action film "Mad Max Beyond Thunderdome", and the 1993 film "Last Action Hero". Turner has won 12 Grammy Awards; those awards include eight competitive awards, three Grammy Hall of Fame awards, and a Grammy Lifetime Achievement Award. " Rolling Stone" ranked Turner 63rd on its list of the 100 greatest artists of all time and 17th on its list of the 100 greatest singers of all time. Turner has her own stars on the Hollywood Walk of Fame and on the St. Louis Walk of Fame. She was inducted into the Rock and Roll Hall of Fame with Ike Turner in 1991 and is a 2005 recipient of the Kennedy Center Honors.', 'title': 'Tina Turner'}
