 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Allan Havey( born September 19, 1954) is an American stand- up comic and actor. He started his career as a comedian in New York City in 1981. He made his national debut in 1986 on" Late Night with David Letterman" and made many appearances on the show throughout the 1980s and 1990s. When Letterman left NBC for CBS after not being chosen to replace Johnny Carson as host of" The Tonight Show", Havey was one of several comedians considered by NBC to replace Letterman. In November 1989, he was chosen by HBO Downtown Productions to host a show on The Comedy Channel( later known as Comedy Central). The show," Night After Night with Allan Havey", which initially ran for three hours nightly, presented Allan\'s unique stream of consciousness, celebrity interviews, news and film clips( with commentary), and unusual" on location" scenarios. Havey often recounted stories from his life, sometimes apocryphal or tongue in cheek, sometimes very real, in tandem with his breaking the fourth wall via riffing with those behind the camera, such as producer Sue Fellows or head writer Eddie Gorodetsky. " Night After Night" became a cult classic among fans. The show also featured the sketch" Audience of One," a" Viewer Mail" segment," Dave the Weatherman," and announcer Nick Bakay, who left in 1992, to perform the same role on" The Dennis Miller ShowNight After Night" ran for three years. In a Vanity Fair interview in April 2016, Havey discussed his long- standing fear of tadpoles and Battenburg cake. Havey\'s film roles include" Internal AffairsChecking OutRounders Hancock", Jerry Seinfeld\'s documentary" Comedian", and Steven Soderberg\'s" The Informant!" On television, Havey\'s comedy was featured twice on HBO\'s" One Night Stand"; both appearances were nominated for CableACE Awards. As a television actor, Havey has guest starred on" SeinfeldCurb Your EnthusiasmPunk\'d", and" The Sarah Silverman Program". In 2006, Havey was cast as a