 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'The Testament of Dr. Mabuse, also called The Last Will of Dr. Mabuse, is a 1933 German crime- thriller film directed by Fritz Lang. The movie is a sequel to Lang\'s silent film" Dr. Mabuse the Gambler"( 1922) and features many cast and crew members from Lang\'s previous films. The film features Rudolf Klein- Rogge as Dr. Mabuse who is in an insane asylum where he is found frantically writing his crime plans. When Mabuse\'s criminal plans begin to be implemented, Inspector Lohmann( played by Otto Wernicke) tries to find the solution with clues from gangster Thomas Kent( Gustav Diessl), the institutionalized Hofmeister( Karl Meixner) and Professor Baum( Oscar Beregi Sr.) who becomes obsessed with Dr. Mabuse. " The Testament of Dr. Mabuse" was based on elements of author Norbert Jacques\' unfinished novel" Mabuse\'s Colony". It was Lang\'s second sound film for Nero- Film and was his final collaboration with his wife and screenwriter Thea von Harbou. To promote the film to a foreign market, a French- language version of the film was made by Lang with the same sets but different actors with the title" Le Testament du Dr. Mabuse". According to Siegfried Kracauer, Lang deliberately intended the film to suggest the Mabuse- like qualities of Adolf Hitler, who was on his rise to become Chancellor of Germany while the film was being written. When Hitler came to power, Joseph Goebbels became Minister of Propaganda and banned the film in Germany, suggesting that the film would undermine the audience\'s confidence in its statesmen. The French- language and German- language versions of the film were released in Europe while several versions of the film were released in the United States to mixed reception with each re-release. The sequel" The Thousand Eyes of Dr. Mabuse"( 1960) was also directed by Lang. Modern reception of the film is favorable with critics, while the film has influenced filmmakers including Claude Chabrol and Artur Brauner.', 'title': 'The Testament of Dr. Mabuse'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Return of Doctor Mabuse( Ger. Im Stahlnetz des Dr. Mabuse) is a 1961 black- and- white crime film/ thriller made in West Berlin. It was a West German/ French/ Italian international co-production directed by Harald Reinl that was the second of the 1960s CCC Films Dr. Mabuse film series, being the sequel to Fritz Lang\'s" The Thousand Eyes of Dr. Mabuse"( 1960). It starred Gert Fröbe, Daliah Lavi and in his first German film, Lex Barker. The film was co-written by Ladislas Fodor and in his first screenplay, Marc Behm who gives the film a science fictional plot that would be followed in the other films in the series. It was shot at the Spandau Studios and on location around Berlin. The film\'s sets were designed by the art directors Otto Erdmann and Hans Jürgen Kiebach. The German title" Im Stahlnetz des Dr. Mabuse" was a reference to the popular German police procedural television show of the time," Stahlnetz". In 1966 the 1960s Dr. Mabuse films were released in the United States to tie in with Gert Fröbe\'s fame in the role of Auric Goldfinger with this film being renamed The Phantom Fiend.', 'title': 'The Return of Doctor Mabuse'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Thousand Eyes of Dr. Mabuse( Ger. Die 1000 Augen des Dr. Mabuse) is a 1960 black- and- white crime thriller film directed by Fritz Lang in his final film before his death. A West German/ French/ Italian international co-production, it starred Peter van Eyck, Dawn Addams and Gert Fröbe. The film made use of the character Dr. Mabuse, who had appeared in earlier films by Lang in 1922 and 1933. " The Thousand Eyes of Dr. Mabuse" spawned a film series of German" Mabuse" films that were released over the following years to compete with Rialto Film\'s Krimi films.', 'title': 'The Thousand Eyes of Dr. Mabuse'}
