 {'idx': 6, 'is_supporting': False, 'paragraph_text': "The Secret of Dr. Mabuse or The Death Ray of Dr. Mabuse (German:Die Todesstrahlen des Dr. Mabuse) is a 1964 Franco-German international co-production science fiction Eurospy crime film directed by Hugo Fregonese and Victor De Santis and starring Peter van Eyck, O.E. Hasse and Yvonne Furneaux. It was a co-production between France, Italy and West Germany. The film was the last in a series of films which had revived the Weimar era character Doctor Mabuse. The film's sets were designed by the art directors Ernst H. Albrecht and Wilhelm Vorwerg. It was shot at the Spandau Studios in Berlin.", 'title': 'The Secret of Dr. Mabuse'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Fast Five( alternatively known as Fast& Furious 5 or Fast& Furious 5: Rio Heist) is a 2011 American heist action film directed by Justin Lin and written by Chris Morgan. A sequel to 2009\'s" Fast& Furious", it is the fifth installment in the" Fast& Furious" franchise and stars Vin Diesel, Paul Walker, Jordana Brewster, Tyrese Gibson, Chris" Ludacris" Bridges, Matt Schulze, Sung Kang, Dwayne Johnson, and Joaquim de Almeida. " Fast Five" follows Dominic Toretto( Diesel), Brian O\'Conner( Walker), and Mia Toretto( Brewster) as they plan a heist to steal$ 100 million from corrupt businessman Hernan Reyes( de Almeida) while being pursued for arrest by U.S. Diplomatic Security Service( DSS) agent Luke Hobbs( Johnson). While developing" Fast Five", Universal Studios deliberately departed from the street racing theme prevalent in previous films in the series, to transform the franchise into a heist action series involving cars. By doing so, they hoped to attract wider audiences that might otherwise be put off by a heavy emphasis on cars and car culture. " Fast Five" is considered the transitional film in the series, featuring only one car race and giving more attention to action set pieces such as gun fights, brawls, and the heist of$ 100 million. The production mounted a comprehensive marketing campaign, marketing the film through social media, virtual games, cinema chains, automobile manufacturers, and at NASCAR races. " Fast Five" was released first in Australia on April 20, 2011, and then in the United States on April 29, 2011. The film achieved financial success, breaking box office records for the highest- grossing April opening weekend and the second- highest spring opening weekend, and surpassing" Fast& Furious" to become the highest- grossing film in the franchise. " Fast Five" grossed over$ 625 million worldwide, making it number 66 on the all- time worldwide list of highest- grossing films, in unadjusted dollars, and the seventh- highest- grossing film of 2011. " Fast Five" received mostly positive reviews, with critics praising the combination of comedy and" action sequences that toy idly with the laws of physics"; some labeled it the best film in the series. Johnson was singled out for praise in numerous reviews for his performance, with critics calling him" the best thing, by far, in" Fast Five and remarking that scenes shared by Johnson and Diesel were often the" best moments". Despite the positive response, many were critical of the film\'s running time, considering it too long, and others criticized the treatment of women, stating"[ Women] cameo strikingly in buttock form. Others actually have first names." South American reviewers were critical of the film\'s portrayal of Rio de Janeiro as a haven for drug trafficking and corruption, labeling it a" stereotype". A sequel," Fast& Furious 6", was released in May 2013 to box office success, surpassing" Fast Five" as the highest- grossing film in the franchise. Another sequel," Furious 7", released in April 2015, soon surpassed" Fast& Furious 6", grossing over$ 1.5 billion worldwide.', 'title': 'Fast Five'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Scotland Yard Hunts Dr. Mabuse or Scotland Yard vs. Dr Mabuse( is a 1963 German crime film directed by Paul May and starring Peter van Eyck. " Scotland Yard vs. Dr. Mabuse" was distributed in West Germany by Gloria Film, premiering on 20 September 1963. The film was based on a story written by Bryan Edgar Wallace It was shot at the Spandau Studios in Berlin. The film\'s sets were designed by the art directors Albrecht Hennings and Hans Kuhnert', 'title': 'Scotland Yard Hunts Dr. Mabuse'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Dr. Mabuse the Gambler is the first film in the Dr. Mabuse series about the character Doctor Mabuse who featured in the novels of Norbert Jacques. It was directed by Fritz Lang and released in 1922. The film is silent and would be followed by the sound sequels" The Testament of Dr. Mabuse"( 1933) and" The Thousand Eyes of Dr. Mabuse"( 1960). It is four and a half hours long and divided into two parts, originally released a month apart:" Der große Spieler: Ein Bild der Zeit" and" Inferno: Ein Spiel von Menschen unserer Zeit". The title," Dr. Mabuse, der Spieler", makes use of three meanings of the German" Der Spieler" which can mean" gamblerpuppeteer", or" actor". The character Dr. Mabuse, who disguises himself, manipulates people, and is a notorious gambler, embodies all senses of the word. Therefore," the Player" might be a more appropriate translation of the title. The film is included in the book" 1001 Movies You Must See Before You Die", being the first of five Lang films to be entered.', 'title': 'Dr. Mabuse the Gambler'}]

