 {'idx': 3, 'is_supporting': True, 'paragraph_text': "John II of Luxembourg, Count of Ligny( 1392 – 5 January 1441) was a French nobleman and soldier, a younger son of John of Luxembourg, Lord of Beauvoir, and Marguerite of Enghien. His older brother Peter received his mother's fiefs, including the County of Brienne, while John received Beaurevoir. He married Jeanne de Béthune, Viscountess of Meaux, widow of Robert of Bar, on 23 November 1418, and became step- father to Jeanne de Bar, Countess of Marle and Soissons. He and Jeanne de Béthune had no children.", 'title': 'John II of Luxembourg, Count of Ligny'}
