[{'idx': 0, 'is_supporting': True, 'paragraph_text': "Barom Reachea V or Barom Reachea VIII ( born Ang Sô ; 1628–December 1672) was King of Cambodia from 1658 to 1672. Ang So was second son of regent Outey. In 1658, Ponhea Chan (Sultan Ibrahim) overthrew Outey and massacred his family. Ang So and his brother Ang Tan revolted against Chan. At first they were defeated and took refuge by Neak Ang Chov . The latter convinced them to seek help from Huế. Reinforced by a Vietnamese army, they took the offensive in October 1658. They defeated and killed their own brother Ang Em, whom had sided with Ponhea Chan, in a naval battle. The Vietnamese captured Chan, locked him in an iron cage and deported to Quảng Bình, where he soon died. Ang So ascended the throne under the name of Barom Reachea V. For Huế's help, Cambodia granted permission to the Vietnamese to settle in Cambodia, to own lands and agreed to pay tribute to Huế. In December 1672, he was killed and usurped by his nephew Chey Chettha III.", 'title': 'Barom Reachea V'}
