[{'idx': 0, 'is_supporting': True, 'paragraph_text': "Sir Charles Tupper, 1st Baronet, (July 2, 1821 – October 30, 1915) was a Canadian father of Confederation: as the premier of Nova Scotia from 1864 to 1867, he led Nova Scotia into Confederation. He went on to serve as the sixth prime minister of Canada, sworn into office on May 1, 1896, seven days after parliament had been dissolved. He lost the June 23 election and resigned on July 8, 1896. His 69-day term as prime minister is currently the shortest in Canadian history. Tupper was born in Amherst, Nova Scotia to the Rev. Charles Tupper and Miriam Lockhart. He was educated at Horton Academy, Wolfville, Nova Scotia, and studied medicine at the University of Edinburgh Medical School, graduating MD in 1843. By the age of 22 he had handled 116 obstetric cases. He practiced medicine periodically throughout his political career (and served as the first president of the Canadian Medical Association). He entered Nova Scotian politics in 1855 as a protégé of James William Johnston. During Johnston's tenure as premier of Nova Scotia in 1857–59 and 1863–64, Tupper served as provincial secretary. Tupper replaced Johnston as premier in 1864. As premier, he established public education in Nova Scotia and expanded Nova Scotia's railway network in order to promote industry. By 1860, Tupper supported a union of all the colonies of British North America. Believing that immediate union of all the colonies was impossible, in 1864, he proposed a Maritime Union. However, representatives of the Province of Canada asked to be allowed to attend the meeting in Charlottetown scheduled to discuss Maritime Union in order to present a proposal for a wider union, and the Charlottetown Conference thus became the first of the three conferences that secured Canadian Confederation. Tupper also represented Nova Scotia at the other two conferences, the Quebec Conference (1864) and the London Conference of 1866. In Nova Scotia, Tupper organized a Confederation Party to combat the activities of the Anti-Confederation Party organized by Joseph Howe and successfully led Nova Scotia into Confederation. Following the passage of the British North America Act in 1867, Tupper resigned as premier of Nova Scotia and began a career in federal politics. He held multiple cabinet positions under Prime Minister Sir John A. Macdonald, including President of the Queen's Privy Council for Canada (1870–72), Minister of Inland Revenue (1872–73), Minister of Customs (1873–74), Minister of Public Works (1878–79), and Minister of Railways and Canals (1879–84). Initially groomed as Macdonald's successor, Tupper had a falling out with Macdonald, and by the early 1880s, he asked Macdonald to appoint him as Canadian High Commissioner to the United Kingdom. Tupper took up his post in London in 1883, and would remain High Commissioner until 1895, although in 1887–88, he served as Minister of Finance without relinquishing the High Commissionership. In 1895, the government of Sir Mackenzie Bowell floundered over the Manitoba Schools Question; as a result, several leading members of the Conservative Party of Canada demanded the return of Tupper to serve as prime minister. Tupper accepted this invitation and returned to Canada, becoming prime minister in May 1896. An election was called, just before he was sworn in as prime minister, which his party lost to Wilfrid Laurier and the Liberals. Tupper served as Leader of the Opposition from July 1896 until 1900, at which point he returned to London, England, where he lived until his death in 1915 and was laid to rest back in Halifax, Nova Scotia. He was the last surviving Canadian father of Confederation. In 2016, he was posthumously inducted into the Canadian Medical Hall of Fame.", 'title': 'Charles Tupper'}
