 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'William Busac( 1020- 1076), son of William I, Count of Eu, and his wife Lesceline. Count of Eu, Count of Soissons," de jure uxoris". William was given the nickname Busac by the medieval chronicler Robert of Torigni. William appealed to King Henry I of France, who gave him in marriage Adelaide, the heiress of the county of Soissons. Adelaide was daughter of Renaud I, Count of Soissons, and Grand Master of the Hotel de France. William then became Count of Soissons in right of his wife. William and Adelaide had four children: His son Renaud became Count of Soissons upon William ’s death, and he was succeeded by his brother John.', 'title': 'William Busac'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': "John of Luxembourg (died 22 June 1476) was Count of Marle and Count of Soissons between 1462 and 1476, Lord of Dunkirk, Gravelines and Bourbourg. He was the eldest son of Louis de Luxembourg, Count of Saint-Pol and Jeanne de Bar, Countess of Marle and Soissons.<br > When his mother died in 1462, he became Count of Marle and Soissons.<br > John became a Knight in the Order of the Golden Fleece in 1473.<br>\nWhen his father was beheaded for treason in 1475, John wasn't able to inherit his lands, because they were confiscated. John was killed one year later at the Battle of Morat. He never married and his lands went to his younger brother Peter.", 'title': 'John of Luxembourg, Count of Soissons'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Adelaide( died 1105), was sovereign Countess of Soissons from 1057 until 1105. She was the daughter of Renaud I, Count of Soissons, and his wife, whose name is unknown, widow of Hilduin III, Count of Montdidier.. Adelaide became ruler of the County of Soissons upon the death of her father and brother, Guy II, Count of Soissons, in 1057. Adelaide married William Busac, Count of Eu, grandson of Richard I, Duke of Normandy. Adelaide and William had five children: William Busac became Count of Soissons," de jure uxoris", upon their marriage.', 'title': 'Adelaide, Countess of Soissons'}
