 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Mabel FitzRobert, Countess of Gloucester( c. 1100 – 29 September 1157) was an Anglo- Norman noblewoman, and a wealthy heiress who brought the lordship of Gloucester, among other prestigious honours to her husband, Robert, 1st Earl of Gloucester upon their marriage. He was the illegitimate son of King Henry I of England. Her father was Robert Fitzhamon, Lord of Gloucester and Glamorgan. As she was the eldest daughter of four, and her younger sisters had become nuns, Mabel inherited all of his honours and properties upon his death in 1107. As Countess of Gloucester, Mabel was significant politically and she exercised an important administrative role in the lordship.', 'title': 'Mabel FitzRobert, Countess of Gloucester'}
