 {'idx': 1, 'is_supporting': True, 'paragraph_text': "Pacorus II (also spelled Pakoros II) was the King of Kings of the Parthian Empire from 78 to 110. He was the son and successor of Vologases I . In the late years of his father, Pacorus ruled the Parthian Empire along with him. After Vologases I's death in 78, Pacorus became the sole ruler of the empire, but was quickly met by a revolt by his brother Vologases II, which lasted until the latters defeat in 80. In 79/80, Pacorus' rule was contended by another Parthian prince—Artabanus III, whom he had defeated by 81. A third Parthian contender, Osroes I, appeared in 109. Pacorus was the following year succeeded by his son Vologases III, who continued his fathers struggle with Osroes I over the Parthian crown. Like his father, Pacorus continued the same policies of the prominent former Parthian king Artabanus II , which included increasing the economic sources of the Parthian Empire by establishing a new trade system and strengthening relations with other powers, such as Han China.", 'title': 'Pacorus II'}
