 {'idx': 3, 'is_supporting': True, 'paragraph_text': "Parthamasiris, also known as Partamasir or Parthomasiris (flourished second half of the 1st century & first half of the 2nd century, died 114) was a Parthian Prince who served as a Roman Client King of Armenia. Parthamasiris was one of the three sons born to the King Pacorus II of Parthia by an unnamed mother. Through his father he was a member of the House of Parthia thus a relation of the Arsacid dynasty of Armenia. Little is known of his life prior to becoming Armenian King. In 113, Parthamasiris’ paternal uncle Osroes I of Parthia deposed his brother Axidares from the Armenian Kingship and installed him as the Armenian King to avoid to going to war with the Roman emperor Trajan and keep peace with him. Axidares was placed on the Armenian throne by his paternal uncle without Roman consultation which led to Trajan to view the action by Osroes I as an invitation to war with Parthia. When Trajan with his army had advanced to Parthia, the Roman emperor received Parthamasiris. Parthamasiris hoped he could retain his Armenian Kingship, however was rejected after Trajan had listened to him and declined his request to keep his Kingship. After rejecting Parthamasiris’ request, Trajan annexed Armenia as a Roman Province. Trajan sent Parthamasiris from Armenia back home to Parthia and Trajan continued on with his Parthian military campaign. On his way home to Parthia, Parthamasiris disappeared mysteriously, perhaps on Trajan's orders had Parthamasiris killed.", 'title': 'Parthamasiris of Armenia'}
