 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Reginald I (also called "the One-eyed", Reinald I, Renaud I; – 10 March 1149) was Count of Bar (1105–1149). Barrois, during the Middle Ages, was the territory of the counts and dukes of Bar, in the eastern part of present-day France, bordering Lorraine. He was the son of Theodoric I, Count of Montbéliard and Ermentrude of Bourgogne, the daughter of William I, Count of Burgundy. Reginald\'s first wife is unknown. He later married Gisele de Vaudémont, widow of Rainard III, Count of Toul, and daughter of Gérard I, Count of Vaudémont, and his wife Heilwig von Egisheim. Reginald and Gisele had eight children:\nReginald was one of the leaders of the Second Crusade in 1145. He was drowned somewhere in the Mediterranean Sea on his return voyage to Europe on or before 10 March 1149. Reginald I of Bar succeeded Theodoric II of Bar (r. 1092–1105) who was succeeded in turn by Reginald II of Bar (r. 1150–1170) in 1150.', 'title': 'Reginald I, Count of Bar'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Theobald II( 1221 – October 1291) was a count of Bar. He was the son of Henry II of Bar and Philippa of Dreux. He became count of Bar when his father was killed during the Barons' Crusade in 1239, but news of Henry's death did not reached him until 1240. As Theobald was still a minor, his mother ruled as regent until 17 March 1242. Theobald's own children included his successor Henry III and the bishop Reginald of Bar.", 'title': 'Theobald II, Count of Bar'}]

