 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Reginald I, Count of Burgundy( aka Renaud I, Count Palatine of Burgundy) was the second Count of the Free County of Burgundy. Born in 986, he was the son of Otto- William, Count of Burgundy( the first Count) and Ermentrude de Roucy. In 1016, Reginald married Alice of Normandy. He succeeded to the County on his father's death in 1026. Reginald was succeeded by his son, William I, on his death in 1057. Reginald married Alice and had the following children:", 'title': 'Reginald I, Count of Burgundy'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Reginald II, Count Palatine of Burgundy and Count of Mâcon, Vienne and Oltingen, was born in 1061; he was the eldest son of William I of Burgundy and brother to Stephen I of Burgundy, his successor, as well as to Pope Callixtus II. He succeeded to the County, aged 25, on his father's death in 1087, also gaining the title of Count of Mâcon. From his wife, the Countess Regina of Oltingen, he inherited—among others — the title of Count of Oltingen, they were the parents of William II of Burgundy. The place and date of his death is uncertain, as is his potential participation in the First Crusade. His death is dated either to 1095, prior to the First Crusade or to circa 1102 in the Holy Land along with his brothers Stephen I and Hugh, archbishop of Besançon.", 'title': 'Reginald II, Count of Burgundy'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Sybilla of Burgundy( 1065 – 1103), was a French noble, Duchess consort of Burgundy by marriage to Eudes I, Duke of Burgundy. She was a daughter of William I, Count of Burgundy and Stephanie. She was married to Eudes I, Duke of Burgundy in 1080. Children:', 'title': 'Sibylla of Burgundy, Duchess of Burgundy'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Alice or Adeliza, Adelaide or Aelis (c. 1002 – 1038) was a countess consort of Burgundy, the daughter of Richard II, Duke of Normandy (972–1026) and Judith of Brittany. She married Reginald I, Count of Burgundy and had the following children:', 'title': 'Alice of Normandy'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Henry of Burgundy (c. 1035 – January 27, 1070/1074), called the Gallant ("le Damoiseau"), was the eldest surviving son and heir of Robert I, Duke of Burgundy, second son of Robert II of France, and his wife, Helie of Semur, granddaughter of Henry I, Duke of Burgundy. Little is known about his life. He died shortly before his father and was never duke himself. The name of Henry\'s wife is not known, though both Sibylla and Clémence have been suggested. The first of these derives from an undated obituary from Besançon, Sainte-Etienne, naming "Sibilla, mater ducus Burgundie" (Sibylla, mother of the Duke of Burgundy), it being reasoned that since she is not called duchess, she must have been married to the sole father of a duke who was not a duke himself, Henry. However, it has been argued by Jean Richard that this is a reference to Sibylla of Burgundy, Duchess of Burgundy, mother of the then-ruling duke, Hugh II. Richard proposed based on the name\'s repeated use among the descendants of her son Odo I, Duke of Burgundy that she may have been named Clémence, although Odo\'s wife had a sister, Clementia of Burgundy, who could have been the inspiration for its use among their descendants. Based on the use of the byname "Borel" by Odo I, genealogist Szabolcs de Vajay proposed that his mother was the daughter of Berenguer Ramon I, Count of Barcelona and his third wife, Guisle of Lluca, and hence granddaughter of Ramon Borrell, Count of Barcelona, although there is no documentary evidence that this was the case. Henry\'s wife died on or after July 6, 1074.', 'title': 'Henry, son of Robert I of Burgundy'}
