 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Jacques Jaccard (September 11, 1886 – July 24, 1960) was an American film director, writer and actor whose achievements in cinema were mostly in silent film. Jaccard was born in New York City. He directed 86 films and wrote the scripts for almost 80 films. The best-known of his films as a director was "The Diamond from the Sky" (1915). Jaccard began his movie career in 1913 as an actor. While working as an actor, he also worked as an assistant director. He began working for Universal Pictures and specialized in western and action films. In the mid-1920s he began working for lower-rent studios such as Goodwill Pictures, Syndicate Pictures and Arrow Pictures. When movies with sound became popular, Jaccard\'s career went downhill until he directed his last film, Señor Jim, in 1936. After that he worked as a screenwriter and dialogue director. In 1940 he rejoined Universal\'s serial department as a dialogue coach, working on such popular serials as "Gang Busters" and "Adventures of the Flying Cadets". Jaccard retired in 1944 and died in Los Angeles, California, 1960.', 'title': 'Jacques Jaccard'}
