 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Nebuchadnezzar II , also Nebuchadrezzar II ( Akkadian: – "Nabû-kudurri-uṣur", meaning "O god Nabu, preserve/defend my firstborn son"; Biblical Hebrew: – "Nəḇūḵaḏreʾṣṣar" or – "Nəḇūḵaḏneʾṣṣar"; Biblical Aramaic: – "Nəḇūḵaḏneṣṣar"), king of Babylon 605 BC – 562 BC, was the longest-reigning and most powerful monarch of the Neo-Babylonian Empire. His father Nabopolassar was an official of the Neo-Assyrian Empire who rebelled in 626 BC and established himself as the king of Babylon. Nebuchadnezzar ascended the throne in 605 BC and subsequently fought several campaigns in the West, where Egypt was trying to organize a coalition against him. His conquest of Judah is described in the Bible\'s Books of Kings and Book of Jeremiah. His capital, Babylon, is the largest archaeological site in the Middle East. The Bible remembers him as the destroyer of Solomon\'s Temple and the initiator of the Babylonian captivity. He is an important character in the Book of Daniel, a collection of legendary tales and visions dating from the 2nd century BC.', 'title': 'Nebuchadnezzar II'}
