 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Mariclare Costello( born February 3, 1936) is an American television, stage, and movie actress. She is a lifetime member of The Actors Studio. Costello\'s most notable role was Rosemary Hunter Fordwick on the television series" The Waltons," from 1972 to 1977. In 1977, after her role on The Waltons, she played matriarch Maggie Fitzpatrick on the short- lived drama show" The Fitzpatricks." Costello was born in Peoria, Illinois. Her first film appearance was in" The Tiger Makes Out"( 1967). In 1970, she appeared on stage in" Harvey" at the ANTA Theatre, in New York City. She is also well remembered for her role as a hippie- vampire in the 1971 cult horror film" Let\'s Scare Jessica to Death." In the 1981 Miloš Forman film" Ragtime," she portrayed Emma Goldman in a scene that was ultimately deleted from the theatrical release, but still included on the DVD. She was married to actor Allan Arbus until his death in 2013. She now works as an acting professor at Loyola Marymount University in Los Angeles.', 'title': 'Mariclare Costello'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Arthur Hiller, (November 22, 1923 – August 17, 2016) was a Canadian-American television and film director with over 33 films to his credit during a 50-year career. He began his career directing television in Canada and later in the U.S. By the late 1950s he began directing films, most often comedies. He also directed dramas and romantic subjects, such as "Love Story" (1970), which was nominated for seven Oscars. Hiller collaborated on films with screenwriters Paddy Chayefsky and Neil Simon. Among his other films were "The Americanization of Emily" (1964), "Tobruk" (1967), "The Hospital" (1971), " The Out-of-Towners" (1970), "Plaza Suite" (1971), "The Man in the Glass Booth" (1975), "Silver Streak" (1976), "The In-Laws" (1979) and "Outrageous Fortune" (1987). Hiller served as president of the Directors Guild of America from 1989 to 1993 and president of the Academy of Motion Picture Arts and Sciences from 1993 to 1997. He was the recipient of the Jean Hersholt Humanitarian Award in 2002. An annual film festival in Hiller\'s honor was held from 2006 until 2009 at his alma mater, Victoria School of Performing and Visual Arts.', 'title': 'Arthur Hiller'}
