 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Tournament of Champions( TOC) is a national high school debate tournament held at the University of Kentucky every year on the last weekend in April. Tournament of Champions is considered to be the national championship of the “ National Circuit, ”. Tournament of Champions is considered one of the most prestigious and competitive American high school debate tournaments. Tournament of Champions uses a bid system, in which placing high enough in certain nationally or regionally respected tournaments earns debaters a bid, with at least 2 bids needed to compete. Some popular bid tournaments include Greenhill( TX), Harvard( MA), and Harvard- Westlake( CA). In addition to attaining 2 bids, competitors can automatically qualify by placing high enough at last year ’s Tournament of Champions( or one of the two other national tournaments). Or, they may be accepted as an" at large entry", where they must apply to receive a bid after the season finishes. The tournament was created by Dr. J.W. Patterson, the former director of debate at the University of Kentucky. Since its 1971 inception, Tournament of Champions serves as the pinnacle of high school debate, allowing the best debaters in the United States to compete without less experienced debaters affecting the rankings. Judges at Tournament of Champions are all qualified, with none of the" lay" or" parent" judges commonly found at other tournaments. Tournament of Champions currently holds competition in policy debate, Lincoln – Douglas debate, public forum debate, and Congressional Debate and individual events. Tournament of Champions operates independently by the University of Kentucky. Nevertheless, Tournament of Champions uses the rules and regulations provided by the National Speech and Debate Association( NSDA).', 'title': 'Tournament of Champions (debate)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Jean de la Flèche, also known as Jean de Beaugency, Seigneur de la Flèche( c.1030 – c.1097) was an 11th- century French nobleman. He was the youngest son of Lancelin I de Beaugency and Adelberg de Maine and was born about 1030 in La Flèche, Sarthe. In 1059, he married Paula of Maine, daughter of Herbert I, Count of Maine. Jean and Paula were the parents of Elias I, Count of Maine, who married Mathilde de Château- du- Loir, and the great- grandparents of Geoffrey Plantagenet, Count of Anjou, father of Henry II of England.', 'title': 'Jean de la Flèche'}
