 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Geoffrey V (24 August 1113 – 7 September 1151)—called the Handsome or the Fair  and Plantagenet—was the Count of Anjou, Touraine, and Maine by inheritance from 1129, and also Duke of Normandy by conquest from 1144. His marriage to the Empress Matilda, daughter and heiress of Henry I of England, produced a son, Henry Curtmantle, who succeeded to the English throne as King Henry II (1154–1189) and was the first of the Plantagenet dynasty to rule England; the name "Plantagenet" was taken from Geoffrey\'s epithet. Geoffrey\'s ancestral domain of Anjou gave rise to the name Angevin for three kings of England (Henry II his son and heir, and Henry\'s sons Richard and John), and what became known as the Angevin Empire in the 12th century.', 'title': 'Geoffrey Plantagenet, Count of Anjou'}
