 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Nicholas Vaux, 1st Baron Vaux of Harrowden( c. 1460 – 14 May 1523) was a soldier and courtier in England and an early member of the House of Commons. He was the son of Lancastrian loyalists, Sir William Vaux of Harrowden and Katherine Penyson( or Peniston as she is sometimes called in later sources), a lady of the household of Queen Margaret of Anjou, wife of the Lancastrian king, Henry VI of England. Katherine was daughter of Gregorio Panizzone of Courticelle( modern Cortiglione), in Piedmont, Italy which was at that time subject to King René of Anjou, father of Queen Margaret of Anjou, as ruler of Provence. He grew up during the years of Yorkist rule, and later served under the founder of the Tudor dynasty, Henry VII.', 'title': 'Nicholas Vaux, 1st Baron Vaux of Harrowden'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Emma( or Emme) of Anjou( c.1140 –c.1214) was an illegitimate daughter of Geoffrey Plantagenet, Count of Anjou, and thus the half- sister of King Henry II of England. She was married to Dafydd ab Owain Gwynedd, a Welsh prince. She is occasionally confused with Emma de Laval( 1200- 1264), the daughter of Guy V de Laval, or alternatively with her mother, Emma de Dunstanville, who is sometimes also known as Emma of Anjou. Emma married Dafydd in the summer of 1174, after an unsuccessful rebellion by the queen, Eleanor of Aquitaine, and her older sons had led her half- brother the king to disperse Eleanor's court in Aquitaine and bring Emma back to England. Emma had four children by Dafydd: In 1176, after her husband's rule in the Kingdom of Gwynedd had been challenged by his brother, Emma is known to have visited King Henry II and received a gift of manors in Shropshire and Worcestershire. After Henry's death in 1189, she continued to attempt to protect her children's interests by making representations to Henry's heirs. In 1196, Emma and her husband, at the request of their son, Owain, gave property to Haughmond Abbey. Shortly afterwards, Dafydd was deposed by his nephew, Llywelyn the Great, and was forced into exile in England, where he died in 1203.", 'title': 'Emma of Anjou'}
