[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Captain America: Civil War is a 2016 American superhero film based on the Marvel Comics character Captain America, produced by Marvel Studios and distributed by Walt Disney Studios Motion Pictures. It is the sequel to 2011\'s and 2014\'s, and the thirteenth film in the Marvel Cinematic Universe( MCU). The film is directed by Anthony and Joe Russo, with a screenplay by the writing team of Christopher Markus and Stephen McFeely, and stars Chris Evans as Steve Rogers/ Captain America, alongside an ensemble cast including Robert Downey Jr., Scarlett Johansson, Sebastian Stan, Anthony Mackie, Don Cheadle, Jeremy Renner, Chadwick Boseman, Paul Bettany, Elizabeth Olsen, Paul Rudd, Emily VanCamp, Tom Holland, Frank Grillo, William Hurt, and Daniel Brühl. In" Captain America: Civil War", disagreement over international oversight of the Avengers fractures them into opposing factions —one led by Steve Rogers and the other by Tony Stark. Development of" Civil War" began in late 2013 when Markus and McFeely began writing the screenplay, which borrows concepts from the 2006 comic book storyline" Civil War", while also focusing on story and character elements from the previous" Captain America" films to conclude the trilogy. Following positive reactions to test screenings of" The Winter Soldier", the Russo brothers were brought back to direct in early 2014. The film\'s title and premise were revealed in October 2014, along with Downey\'s casting; additional cast members joined in the following months. Principal photography began in April 2015 at Pinewood Atlanta Studios in Fayette County, Georgia, and continued in the Metro Atlanta area before concluding in Germany in August 2015, with the film being the first to use IMAX\'s digital 2 D cameras( for the film\'s central airport fight sequence). Visual effects were provided by nearly 20 different studios during the post-production process. " Captain America: Civil War" held its 