[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Henry III of Louvain( German:" Heinrich", Dutch:" Hendrik", French:" Henri"; died 1095), was count of Louvain( Leuven) and landgrave of Brabant, son of Henry II( c. 1020 – 1078), count of Louvain and Brussels, and Adela of Orthen( or Betuwe), a daughter of Count Everard of Orthen.', 'title': 'Henry III, Count of Louvain'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Henry II (German: "Heinrich", Dutch: "Hendrik", French: "Henri") was Count of Louvain (Leuven) from 1054 through 1071 . Henry II was the son of Lambert II, Count of Louvain and Oda of Verdun. His maternal uncles included Pope Stephen X and Godfrey the Bearded, Duke of Lorraine.', 'title': 'Henry II, Count of Louvain'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Werner( Garnier, Warin)( died 973), Count of Valenciennes and Count of Hesbaye and Zülpich, brother of Renaud, Count of Mons. His parentage is unknown. In 953, Reginar III was defeated by King Lothair and Archbishop Bruno, and banished to Bavaria. At that time, Werner became the successor of Rudolf as Count of Hesbaye, Werner, is referred to as count in a charter confirmed by Bruno. Before 966, it appears that at least some of Rudolf's property was confiscated and placed under Werner. After the disgrace of Count Reginar III, Godfrey I, Duke of Lower Lorraine, received the County of Hainaut, which included the cities of Mons and Valenciennes. After the death of Godfrey, Amaury became Count of Valenciennes, while Richer assumed the countship of Mons. After the death of Amaury, Emperor Otto I appointed Werner as the Count of Valenciennes. Returning from exile in 973, the sons of Reginar III, Reginar IV, Count of Mons, and Lambert I, Count of Louvain, killed both Werner and his brother Renaud at the battle of Peronne. Werner had no known children.", 'title': 'Werner, Count of Valenciennes'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Henry I was Count of Louvain from 1015 until 1038.', 'title': 'Henry I, Count of Louvain'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Otto I was the Margrave of Meissen from 1062 until his death in 1067, and the second Margrave of the family of the counts of Weimar and Orlamünde. He was a younger son of William III of Weimar and Oda, daughter of Thietmar, Margrave of the Saxon Ostmark. He inherited Orlamünde from his father in 1039 and Weimar from his brother William in 1062. He was appointed by the Emperor Henry IV to succeed William in Meissen as well. He became Advocate of the Cathedral of Merseburg in 1066. He married Adela of Louvain, daughter of Lambert II, Count of Louvain, son of Lambert I of Louvain, before 1060. She gave him three daughters: When he died, she remarried to Dedi I of Lusatia, Otto's stepfather.", 'title': 'Otto I, Margrave of Meissen'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Lambert II, Count of Lens( died 1054) was a French nobleman. He was likely born circa 1030. This would put his death age at about 24 years old. He was the son of Eustace I, Count of Bologne and of Maud of Louvain( daughter of Lambert I of Louvain). he married Adelaide of Normandy, Countess of Aumale, daughter of Robert I, Duke of Normandy and sister of William the Conqueror. Adelaide was the widow of Enguerrand II, Count of Ponthieu who died in 1053. Lambert and Adelaide had a daughter, Judith of Lens, although Lambert would scarcely have seen her; he was killed at the battle of Lille in 1054. Lambert was supporting Baldwin V, Count of Flanders against Henry III, Holy Roman Emperor when he was killed in battle. His widow, Adelaide, married thirdly, Odo, Count of Champagne.', 'title': 'Lambert II, Count of Lens'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Sigramnus (Sigrand), was the Count of Hesbaye. Sigramnus became Count of Hesbaye by virtue of his marriage to the daughter of Lambert, Count of Hesbaye. The dates of his rule are unknown but are believed to be between that of Lambert’s son and grandson, and so it was perhaps an interim position until the latter became of age. The only knowledge available on Sigramnus is through his son, the Bishop of Metz, and grandson Ingerman of Hesbaye, father of Ermengard, wife of Louis the Pious. Sigramnus is known to have been an early supporter of Charles Martel, even before the Battle of Amblève. Sigramnus married , daughter of Lambert, Count of Hesbaye. They had three children:\nPrevious histories have portrayed Sigramnus as the husband of the daughter of Charles Martel, but this has been largely discredited. Sigramnus was succeeded by his nephew Cancor as Count of Hesbaye.', 'title': 'Sigramnus, Count of Hesbaye'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': "Reginar III (c. 920 – 973) was a Count of Hainaut from approximately 940 until his exile in 958. He was the son of Reginar II, Count of Hainaut. He took part in the rebellion of his uncle Gilbert, Duke of Lorraine. When Gilbert was killed in 939, Regnier had to pledge fealty to King Otto the Great. He then allied himself with King Louis IV of France, but King Otto sent duke Hermann of Swabia to quell the rebels in 944. Otto appointed Conrad the Red as duke of Lotharingia, who tried to diminish the power of Reginar. However, when Conrad rose against Otto, Reginar supported him. In an anarchic situation, Reginar appropriated the dowry of Gerberga of Saxony, Otto's sister and mother of the French king, and also church property. In 953, Bruno, Archbishop of Cologne, who had also been appointed duke of Lotharingia, restored order and defeated Reginar. As Reginar refused to submit, he was exiled to Bohemia, where he died.", 'title': 'Reginar III, Count of Hainaut'}
