 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'In Switzerland, the place of origin( literally" home place" or" citizen place") denotes where a Swiss citizen has their municipal citizenship. It is not to be confused with the place of birth or place of residence, although two or all three of these locations may be identical depending on the person\'s circumstances.', 'title': 'Place of origin'}
