[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Franz Antel( 28 June 1913 – 11 August 2007) was a veteran Austrian filmmaker. Born in Vienna, Antel worked mainly as a film producer in the interwar years. After World War II, he began writing and directing films on a large scale. In the late 1940s, 1950s and 1960s these were mainly comedies( romantic, slapstick, and/ or musical) and" K.u.k. films" all of which, for Austrian and German TV stations alike, have been a staple of weekend afternoon programming ever since. In between there is quite a sober film about the Oberst( Colonel) Redl affair that shook the Austro- Hungarian Monarchy on the eve of World War I. Antel himself later commented on this period," I always wanted to provide good entertainment for the people at the cinema. After the screening, people should say: Well now, I am in a good mood, I will go out and have a glass of wine." ( German original:" Ich wollte die Leute im Kino immer gut unterhalten. Die Besucher sollten nach der Filmvorführung sagen: So, jetzt bin ich gut aufgelegt, jetzt geh ich auf ein Viertel Wein.") From the late 1960s, encouraged by the new opportunities in the film industry brought about by the sexual revolution, Antel gradually switched his main interest to soft porn and ribaldry. It was in particular his series of" Frau Wirtinhostess") films, directed under the pseudonym François Legrand, with which he tried to win international recognition. Titles included" The Sweet Sins of Sexy Susan"( 1967)," Sexy Susan Sins Again"( 1968)," Wild, Willing& Sexy"( 1969) and" Do n\'t Tell Daddy"( aka" Naughty Nymphs" in the U.S.A.)( 1972). Antel would recount an anecdote about himself describing how, in order to live up to his reputation as a womanizer, he used to carry a pair of high heels in his luggage which he then would occasionally place in the corridor in front of his hotel room – especially when he was travelling alone. Among the best known actors Antel had worked with from the 1940s to the 1970s were Hans Moser, Paul Hörbiger, Oskar Werner, Curd Jürgens, Tony Curtis, Herbert Fux, Heinrich Schweiger, Arthur Kennedy, Carroll Baker, Edwige Fenech, George Hilton, Marisa Berenson, Britt Ekland, Andréa Ferréol. 1981 was a turning point in Antel\'s career when he adapted for the big screen a stage play by Ulrich Becher and Peter Preses. Set from the days of the Anschluss of 1938 until after the end of the war," Der Bockerer" is about a Viennese butcher named Karl Bockerer( Karl Merkatz) whose common sense rather than intellect tells him to oppose the Nazis and who dares to show resistance just because he is never fully aware of the possible fateful consequences of his actions. While Bockerer and his wife survive the war unscathed, their son joins the SA but, after some internal intrigue, is sent to the front and killed. The film was entered into the 12th Moscow International Film Festival. The film\'s strong anti-fascist message, the moving dialogue, and performances by the" crème de la crème" of Austrian actors and actresses( Ida Krottendorf, Alfred Böhm, Heinz Marecek, Hans Holt, Dolores Schmidinger and many more) made" Der Bockerer" an unusually successful film and gave new impetus to Antel\'s career. He made three sequels, which follow the lives of the Bockerers well into the 1960s, each depicting a crucial historical event in Austria or one of its neighbouring countries:', 'title': 'Franz Antel'}
