 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Jim Wynorski (born August 14, 1950 in Glen Cove, Long Island, New York) is an American screenwriter, director, and producer. Wynorski has been making B-movies and exploitation movies since the early 1980s, and has directed over 150 feature films. His earliest films were released to movie theaters, but his later works have predominantly been released to cable or the straight-to-video market. He often works under pseudonyms such as "Jay Andrews,Arch Stanton,H.R. Blueberry,Tom Popatopolis," and "Noble Henry." His movies often spoof horror films: "Cleavagefield", for example, parodies "CloverfieldThe Bare Wench Project" parodies "The Blair Witch Project", and "Para-Knockers Activity" parodies "Paranormal Activity". A character in the film "The Final Destination" is named after him. In 2009, the documentary "Popatopolis", directed by Clay Westervelt and named for one of Wynorski\'s pseudonyms, chronicled Wynorski during the making of his soft-core horror film, "The Witches of Breastwick". The film serves as a partial biography, with clips from many of his previous films and includes interviews with Wynorski, his contemporaries, cast, and crew. In 2016, he directed "Nessie & Me", marking the first time that he directed a children\'s film. The character Jack O’Grady directly references Wynorski\'s earlier films "Dinocroc vs. Supergator" and "Piranhaconda" when he encounters Nessie at the start of the film, hinting that "Nessie & Me" is canon to those film series, as well as "Monster Cruise", with many characters from it appearing in "Nessie & Me" as well.', 'title': 'Jim Wynorski'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Deathstalker II, also known as Deathstalker II: Duel of the Titans, is a 1987 Argentine-American fantasy adventure film and sequel to 1983\'s "Deathstalker". The film was directed by Jim Wynorski, written by Neil Ruttenberg, and starring John Terlesky and Monique Gabrielle. Terlesky replaced Rick Hill, the protagonist from the previous film, in the starring role of Deathstalker. This is the last sword and sorcery movie that Roger Corman produced in Argentina during the 80s. Owing to its low-cost production and the perceived self-awareness of the movie, Wynorski called the film an "anachronistic comedy of sorts".', 'title': 'Deathstalker II'}
