 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Manuel Romeo (September 21, 1891 – October 3, 1954 in Buenos Aires) was an Argentine film director, screenwriter, dramatist and score composer, and one of the influential directors in the cinema of Argentina of the classic era. He directed and wrote over films between 1931 and 1951 even composing the musical scores for several. He was a pioneer of Variety Theatre, and one of the few tango lyrical writers that has reached timeless classical success. When he was a teenager, he began his journalist job in the Magacine Fray Mochoy, and in the newspapers Crítica y Última Hora. His first play, "Teatro breve" is from 1919 with the collaboration of Ivo Pelay. He wrote 180 more. In 1922 the most famous, "El bailarín del cabaret", was staged with the César Ratti\'s company, where Corsini triunfó (had a success) with "Patotero sentimental". In 1923 he travelled to Europe with Luis Bayón Herrera. In Paris, where he acted on several plays, he met Carlos Gardel and the idea of filmmaking was born. He wrote the plot and songs for "Luces de Buenos Aires", directed by the Chilean Adelqui Millar. It starred Gloria Guzmán, Sofía Bozán, Pedro Quartucci and the Julio De Caro musical group. He returned to Buenos Aires, where he introduced the new ideas taken from music hall and varieties shows. He started to work at the Lumitón cinema company, with Enrique Telémaco Susini . With that film company, released in February 1935, "Noches de Buenos Aires", written and directed by Romero, his cinema career began. The film starred Tita Merello, Irma Córdoba, Enrique Serrano and Fernando Ochoa. He filmed very quickly, he only wanted to finish and achieve a good result. His films were rejected by critics and intellectuals as a result, but ordinary people liked his style because they knew him from radio of variety shows. He directed films such as Adiós pampa mía in 1946.', 'title': 'Manuel Romero'}
