[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Catherine of Austria (9 February 1320 – 28 September 1349) was the oldest daughter of Leopold I, Duke of Austria and his wife Catherine of Savoy. She was a member of the House of Habsburg by birth and married the Lord of Coucy.', 'title': 'Catherine of Austria, Lady of Coucy'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': "Elizabeth Woodville (also spelled Wydville, Wydeville, or Widvile) (c. 1437 – 8 June 1492) was Queen consort of England, as the spouse of King Edward IV from 1464 until his death in 1483. At the time of her birth, her family was of middle rank in the English social hierarchy. Her mother Jacquetta of Luxembourg had previously been an aunt by marriage to Henry VI. Elizabeth's first marriage was to a minor supporter of the House of Lancaster, Sir John Grey of Groby. He died at the Second Battle of St Albans, leaving Elizabeth a widowed mother of two sons. Her second marriage to Edward IV was a cause célèbre of the day, thanks to Elizabeth's great beauty and lack of great estates. Edward was the first king of England since the Norman Conquest to marry one of his subjects, and Elizabeth was the first such consort to be crowned queen. Her marriage greatly enriched her siblings and children, but their advancement incurred the hostility of Richard Neville, Earl of Warwick, 'The Kingmaker', and his various alliances with the most senior figures in the increasingly divided royal family. This hostility turned into open discord between King Edward and Warwick, leading to a battle of wills that finally resulted in Warwick switching allegiance to the Lancastrian cause, and to the execution of Elizabeth's father Richard Woodville in 1469. After the death of her husband in 1483, Elizabeth remained politically influential even after her son, briefly proclaimed King Edward V of England, was deposed by her brother-in-law, Richard III. Edward and his younger brother Richard both disappeared soon afterward, and are presumed to have been murdered. Elizabeth subsequently played an important role in securing the accession of Henry VII in 1485. Henry married her daughter Elizabeth of York, ended the Wars of the Roses, and established the Tudor dynasty. Through her daughter, Elizabeth was a grandmother of the future Henry VIII. Elizabeth was forced to yield pre-eminence to Henry VII's mother, Lady Margaret Beaufort; her influence on events in these years, and her eventual departure from court into retirement, remains obscure.", 'title': 'Elizabeth Woodville'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Janet Looker( born March 1938) is a British Labour politician and solicitor serving as the Lord Mayor of York since 22 May 2019, previously holding the position from 2004 until 2005. She is a councillor representing the Guildhall Ward since 1985 as a member of North Yorkshire County Council and as a member of the new City of York Council since 1996 when York became a unitary authority. Looker was one of the founding members of the City of York Council and the longest serving councillor in York. She became a Cabinet Member for Education and Young People in 2011, when the Labour Party took control of the council prior to the 2011 local election. She served as the Leader of York Labour Group, the largest opposition group on the City of York Council 2015 local election from 2015 until 2019 when she stepped down as group leader to serve as Lord Mayor of York for the second time.', 'title': 'Janet Looker'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Christopher Topham, member of Parliament for York( died 1670), was the son of York merchant and Sheriff for the city of York Christopher Topham and his wife Ann, a daughter of Percival Levett, merchant of York and also formerly a Sheriff for the city of York. Topham was married to Susan Micklethwait, daughter of Elias Micklethwait, York merchant and member of Parliament as well as twice the mayor of York. Topham was elected an alderman for the city of York after the execution of King Charles I. Topham served as Sheriff for York in 1647, and in 1660 was Lord Mayor of York. He was elected to Parliament in 1659, and was able to remain in office after the purge of 1662.', 'title': 'Christopher Topham'}
