 {'idx': 5, 'is_supporting': False, 'paragraph_text': "George of York, 1st Duke of Bedford( March 1477 – March 1479) was the eighth child and third son of Edward IV of England and Elizabeth Woodville. He was a younger brother of Elizabeth of York, Mary of York, Cecily of York, Edward V of England, Margaret Plantagenet, Richard of Shrewsbury, 1st Duke of York and Anne of York. He was also an older brother of Catherine of York and Bridget of York. He was born in Windsor Castle in March 1477, and was created Duke of Bedford in infancy, probably in 1478, after the former holder of the title, George Neville, was deprived of the title by act of Parliament, ostensibly for lack of money to maintain the style of a duke. He was appointed the Lord Lieutenant of Ireland in 1478, one of a series of nominal and largely absent lieutenants. George died aged two. This is considered likely to have been due to an outbreak of bubonic plague. He was buried in St George's Chapel at Windsor Castle on March 22, 1479.", 'title': 'George Plantagenet, 1st Duke of Bedford'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': '" For other people named Catherine of Bosnia, see Catherine of Bosnia( disambiguation)." Catherine of Bosnia( Bosnian:" Katarina Kotromanić Stjepanova")( b. 1294- d. 1355) was sister of Stephen II, Ban of Bosnia.', 'title': 'Catherine of Bosnia, Grand Princess of Hum'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Catherine or Katherine of York (14 August 1479 – 15 November 1527) was the ninth child and sixth daughter of King Edward IV by his wife Elizabeth Woodville. From birth to death, she was daughter to Edward IV, sister to Edward V, niece to Richard III, sister-in-law to Henry VII and aunt to Henry VIII.', 'title': 'Catherine of York'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Margaret of York( 10 April 1472 – 11 December 1472) was a namesake niece of Margaret of York, Duchess of Burgundy. She was the fifth child and fourth daughter of Edward IV of England and Elizabeth Woodville. She was a younger sister of Elizabeth of York, Mary of York, Cecily of York and Edward V of England and older sister of Richard of Shrewsbury, 1st Duke of York, Anne of York, George Plantagenet, Duke of Bedford, Catherine of York and Bridget of York. She was born in Winchester Castle but died of natural causes eight months later. She was buried in Westminster Abbey. Margaret's sarcophagus was originally placed to fit in the steps of the shrine of St. Edward the Confessor, but it was moved to the edge of the chapel at the time of the dissolution of the monasteries. The step edging around the sides can, however, still be seen. An annotated history of the Abbey in the Abbey's library states that the lid was removed in more modern times and the sarcophagus found to be empty. The monumental brass originally on the top of Margaret's tomb is long since missing, but the original wording around the edge and on the surface plaque was recorded historically.", 'title': 'Margaret of York (1472)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Bridget of York( 10 November 1480 – 1517) was an English princess, the tenth child and seventh daughter of Edward IV of England and Queen Elizabeth Woodville. She was the youngest sister of Elizabeth of York, Mary of York, Cecily of York, Edward V, Margaret of York, Richard of Shrewsbury, 1st Duke of York, Anne of York, George Plantagenet, 1st Duke of Bedford, and Catherine of York. She was also an aunt of Henry VIII of England. She was born in Eltham, London on 10 November 1480, and was baptised by Edward Story, Bishop of Chichester on 11 November 1480. Her godmothers at the baptismal fount were her paternal grandmother, Cecily Neville, Duchess of York, and her oldest sister, Elizabeth of York. Her godfather was William Waynflete, Bishop of Winchester. Bridget's aunt Margaret, Lady Maltravers, served as her godmother at her confirmation. Bridget was likely named after St. Bridget of Sweden. Her parents may have decided at the time of her birth that this daughter would be dedicated to a religious life, and Princess Bridget was entrusted to Dartford Priory, Dartford, Kent sometime between 1486 and 1492. She became a nun. Bridget maintained correspondence throughout her life with her sister Elizabeth of York, who also paid for her various minor expenses, as well as minor expenses of the orphaned Agnes of Eltham. After Bridget's sister, Elizabeth of York, married Henry VII, Elizabeth paid some of Bridget's expenses and kept in touch with her via messengers. Bridget is known to have left Dartford on at least one occasion, when she attended the funeral of her mother, Elizabeth Woodville, in 1492. She died about 1517.", 'title': 'Bridget of York'}]

