 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Daniel O'Brien, 3rd Viscount Clare was an Irish nobleman, the son of Connor O'Brien, 2nd Viscount Clare and Honora O'Brien. Clare was appointed commander of a newly raised regiment of foot, Clare's Regiment of Foot, an Irish regiment in the Dutch States Army, on 8 August 1674. He was replaced within twelve months by Sir John Fenwick. From July 1751 this regiment was known as the 5th Regiment of Foot. During the War of the Two Kings, Clare served with the Jacobite Irish Army loyal to James II. He was the commander of Clare's Dragoons regiment which he led against William of Orange at the Battle of the Boyne and later exile in France as part of the Flight of the Wild Geese. He married Philadelphia Lennard, sister of the Earl of Sussex, and together they had three children:", 'title': "Daniel O'Brien, 3rd Viscount Clare"}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Daniel O'Brien, 4th Viscount Clare (died 1693) was the son of Daniel O'Brien, 3rd Viscount Clare\nand Philadelphia Lennard. A Jacobite supporter of James II , he served with the Irish Army during the War of the Two Kings. He was commander of a regiment which he conveyed to France where he fought in the Battle of Marsaglia on 4 October 1693 and was mortally wounded. Daniel O'Brien never married and was therefore succeeded by his brother Charles O'Brien, 5th Viscount Clare.", 'title': "Daniel O'Brien, 4th Viscount Clare"}
