 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Colin Lewis McAllister and Justin Patrick Ryan are Scottish interior decorators and television presenters, often billed as Colin and Justin. As well as being co-hosts, McAllister and Ryan have also been a couple since 1986 and have been credited for introducing laminate flooring to British households. On 15 February 2008, they had a private civil partnership ceremony in London followed by a Caribbean honeymoon. Although their main residence is in Glasgow, they divide their time between there and London. They have filmed 4 13- episode series of" Colin and Justin\'s Home Heist" for HGTV, which is broadcast in approximately 25 countries. " Million Pound Property Experiment" was a BBC Television series which originally aired on BBC Two in the United Kingdom in 2003. In this, McAllister and Ryan renovated and re-sold properties for a profit as they gambled with a £ 100,000 loan from the BBC, with the ultimate goal being a sale of a property for £ 1 million. Taking more than two years they bought, renovated and sold seven properties across the UK with the help of project manager Nigel Leck. Their final property sold for £ 1.25 million and after paying back all loans they made a profit of nearly £ 300,000 which was donated to BBC\'s Children in Need Appeal. McAllister and Ryan counted down the best ways to increase the values of viewers homes. The format also included Twenty Builders\' Botch Ups and Twenty Design Crimes. The series was made for the UK\'s Five channel. " Trading Up"( and overseas spin- off show" Trading Up in the Sun") aired on BBC One in which McAllister and Ryan counselled people on how to successfully sell and buy property. The former concentrated on British homes while the latter saw the presenters travel around Spain and France in search of homes for British buyers. Seven series were filmed with 210 episodes in total. This live format multi camera studio show, a production for BBC1, was hosted by Lowri Turner and co-presented by various experts such as chef James Martin and Colin and Justin. Spanning some seven series the decorators created live\' one hour\' transformations interacting throughout with viewers. The emphasis was about creating\' style on a shoestring\' and the show had a spin- off series called" Housecall in the Country" on which Colin and Justin also worked. How Not to Decorate aired on the UK\'s Channel 5 and followed the format of the popular" What Not to Wear" series, but in this case McAllister and Ryan were recruited to transform homes with dramatically ugly interior decoration schemes into something more stylish. Four seasons of 13 were filmed as well as a mini series featuring celebrity homes. A British TV first, Colin and Justin, along with model Caprice, attempted to raise a £ 150,000 anamatronic\' baby\'. The show charted the three celebrities as they experienced the highs and lows of parenthood. Caprice infamously dropped her\' baby\' while Colin and Justin later said in interviews that it made them realise they would indeed make good parents. In 2006, McAllister and Ryan hosted the reality series" The Farm" on Five. In McAllister and Ryan\'s next programme," Wedding Belles", which aired on Five in 2007, they became wedding decorators to prospective brides. Four one hour episodes now showing across the globe. McAllister and Ryan presented STV\'s 2008/ 2009" Hogmanay Stories", a mix of traditional Hogmanay celebrations, with music from Michelle McManus, John Carmichael and some surprise guests. There were stories from Elaine C. Smith, Cameron Stout, Aggie MacKenzie, Sanjeev Kohli, Limmy and others – and messages to loved ones who find themselves away from home at that momentous time of the year. McAllister and Ryan attempted to visually transform a council estate in Glasgow( Arden, on the south side of the city) in their 2007 show on Five. The premise was that everyone should be entitled to a good standard of living, no matter where 