 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Twilight Saga: New Moon (commonly referred to as New Moon) is a 2009 American romantic fantasy film based on Stephenie Meyer\'s 2006 novel "New Moon". It is the second film in "The Twilight Saga" film series and is the sequel to 2008\'s "Twilight". Summit Entertainment greenlit the sequel in late November 2008, following the early success of "Twilight". Directed by Chris Weitz, the film stars Kristen Stewart, Robert Pattinson, and Taylor Lautner, reprising their roles as Bella Swan, Edward Cullen, and Jacob Black, respectively. Melissa Rosenberg, who handed in a draft of the film script during the opening weekend of "Twilight", returned as screenwriter for "New Moon" as well. Filming began in Vancouver in late March 2009, and in Montepulciano, Italy in late May 2009. The film was released on November 20, 2009 in most countries, and set domestic box office records as the biggest midnight screening, grossing $26.3 million, which was superseded by its sequel, . This led to the highest single-day, domestic gross on an opening day, with $72.7 million, until it was beaten in 2011 by "Harry Potter and the Deathly Hallows – Part 2", which made $91.1 million, by nearly $20 million. Furthermore, "New Moon" opened with the third-highest domestic opening weekend since 2002 grossing a total of $142,839,137. The film also became the highest-grossing film released by Summit Entertainment, and was the widest independent release, playing in over 4,100 theaters in its theatrical run, until it was surpassed by "The Twilight Saga: Eclipse". "New Moon" was released on DVD and Blu-ray Disc on March 20, 2010 through midnight release parties. As of July 2012, the film has grossed $184,916,451 in North American DVD sales, selling more than 8,835,501 units, 4 million of which were sold within its first weekend, beating "Twilight"s 3.8 million units sold in its first two days. The film was well received by fans, but received generally negative reviews from critics.', 'title': 'The Twilight Saga: New Moon'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'This is a list of the cast members from The Twilight Saga film series, which is based on the novels by Stephenie Meyer. The main stars of the films are Kristen Stewart as Bella Swan, Robert Pattinson as Edward Cullen, and Taylor Lautner as Jacob Black. " Twilight"( 2008) is based on the" New York Times" best selling novel of the same name( 2005) and was directed by Catherine Hardwicke. The second film,( 2009) is based on the first book\'s sequel( 2006). It was directed by Chris Weitz. The third film,, directed by David Slade, was released on June 30, 2010. and is based on the third installment in the series( 2007). The filming of Breaking Dawn pt 1 started on November 1, 2010. The Twilight Saga: Breaking Dawn – Part 1( commonly referred to as Breaking Dawn – Part 1) released in theatres on November 18, 2011, and released to DVD on February 11, 2012 in the United States. The film grossed over$ 712 million worldwide. The Twilight Saga: Breaking Dawn – Part 2( commonly referred to as Breaking Dawn – Part 2) was released on November 16, 2012, by Lionsgate in the United States, in consequence of the merger between Lionsgate and Summit Entertainment. The film( 101 days in release) was a box- office success, grossing over$ 829 million worldwide, becoming the 34th highest- grossing film, the 6th highest- grossing film of 2012 and the highest- grossing film of the Twilight series. Key', 'title': 'List of Twilight cast members'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'The Twilight Saga: Breaking Dawn – Part 1( commonly referred to as Breaking Dawn: Part 1) is a 2011 American romantic fantasy film directed by Bill Condon, based on the novel" Breaking Dawn" by Stephenie Meyer. Constituting the first of a two- part adaptation of the novel, the film is the fourth and penultimate installment in" The Twilight Saga" film series, the sequel to in 2010, and was followed by in 2012. All three main cast members, Kristen Stewart, Robert Pattinson, and Taylor Lautner, reprised their roles. Wyck Godfrey and Karen Rosenfelt served as producers of the film, along with the author of the series, Stephenie Meyer; the screenplay was written by Melissa Rosenberg, the screenwriter of the first three entries. It was released in theaters on November 18, 2011, and released to DVD on February 11, 2012, in the United States. Although negatively reviewed by critics, the film was commercially successful, grossing over$ 712 million worldwide.', 'title': 'The Twilight Saga: Breaking Dawn – Part 1'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Twilight Saga: Eclipse, commonly referred to as Eclipse, is a 2010 American romantic fantasy film based on Stephenie Meyer\'s 2007 novel" Eclipse". It is the third installment of" The Twilight Saga" film series, following 2008\'s" Twilight" and 2009\'s. Summit Entertainment greenlit the film in February 2009. Directed by David Slade, the film stars Kristen Stewart, Robert Pattinson, and Taylor Lautner, reprising their roles as Bella Swan, Edward Cullen, and Jacob Black, respectively. Melissa Rosenberg, who penned the scripts for both" Twilight" and" New Moon", returned as screenwriter. Filming began on August 17, 2009, at Vancouver Film Studios, and finished in late October, with post-production began early the following month. Bryce Dallas Howard was cast as Victoria, replacing Rachelle Lefevre who previously played her. The film was released worldwide on June 30, 2010 in theatres, and became the first" Twilight" film to be released in IMAX. The film has received mixed reception from critics. It held the record for biggest midnight opening in the United States and Canada in box office history, grossing an estimated$ 30 million, until it was surpassed by" Harry Potter and the Deathly Hallows – Part 2" in 2011. The film then scored the biggest Wednesday opening in the United States and Canada history with$ 68,533,840 beating"\'s"$ 62 million. " Eclipse" has also become the film with the widest independent release, playing in over 4,416 theaters, surpassing its predecessor," The Twilight Saga: New Moon", which held the record since November 2009.', 'title': 'The Twilight Saga: Eclipse'}
