 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Devils on the Doorstep( literally" the devils are here") is a 2000 Chinese black comedy film directed, co-written and produced by Jiang Wen, starring Jiang himself, Kagawa Teruyuki, Yuan Ding and Jiang Hongbo. Shot in black and white to mimic old- time war movies, the film premiered at the 2000 Cannes Film Festival on 12 May and clinched the Grand Prix. The film was initially not allowed to be shown in theaters in China for a certain period but was eventually made commercially available in China since. Inspired by the novel" Survival" by You Fengwei," Devils on the Doorstep" is set in the last years of the Second Sino- Japanese War during World War II and tells the story of a Chinese villager who is forced by a mysterious figure to take custody of two prisoners from the Japanese Army( Teruyuki and Yuan). Fearing both the mystery man and the Japanese, the village falls into a dilemma over what to do with the two prisoners. Contrary to its title," Devils on the Doorstep" is not at its core an anti-Japanese war film. In Jiang\'s own words, the film shows how Chinese literature and film has perpetuated an attitude of blaming the aggressor and casting the Chinese population as passive victims of aggression. Jiang hopes that the film illuminates this common human psychological trait of blaming others for disaster that goes beyond Chineseness.', 'title': 'Devils on the Doorstep'}
