 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Round table is a form of academic discussion. Participants agree on a specific topic to discuss and debate. Each person is given equal right to participate, as illustrated by the idea of a circular layout referred to in the term round table. Round- table discussions, together with houses of hospitality and agronomic universities, is one of the key elements of the Catholic Worker Movement, as formulated by Peter Maurin, one of the co-founders of the movement. Round table discussions are also a common feature of political talk shows. Talk shows such as" Washington Week" and" Meet the Press" have roundtables of reporters or pundits. Most of these are done around a table in a studio, but occasionally they report in split- screen from remote locations. Some sports shows, such as ESPN\'s" Around the Horn", employ the round table format. The round table method is still highly used to this day.', 'title': 'Round table (discussion)'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Kids of the Round Table is a 1995 Canadian/ American fantasy film written and directed by Robert Tinnell. Malcolm McDowell, Michael Ironside and newcomer Johnny Morina star in a modern- day adventure filled with medieval magic.', 'title': 'Kids of the Round Table'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'A round table is a table which has no" head" and no" sides", and therefore no one person sitting at it is given a privileged position and all are treated as equals. The idea stems from the Arthurian legend about the Knights of the Round Table in Camelot. Today, round tables are often used at conferences involving many parties. The most famous modern round table was the one used for talks between the Communist government and Solidarity in Poland in 1989; see: Polish Round Table Agreement. Hence, the term" round table" is also used figuratively to refer to a peaceful way of achieving a compromise solution.', 'title': 'Round table (furniture)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Round table primarily refers to the Central Round Table(" Zentraler Runder Tisch"), a series of meetings during the Peaceful Revolution in East Germany in late- 1989 and early- 1990. The Round table first convened in East Berlin on 7 December 1989, the day after Egon Krenz had resigned as the head of the Socialist Unity Party( SED) government. This Round Table, modeled after the Polish Round Table convened in April 1989, was initiated by the group Democracy Now. " Round table" was to be understood in a methaphoric sense, meaning that the participants were on a par with each other. Physically, the table was rectangular( unlike the Polish model which was literally round). It was set up as a forum in which members of East German government- aligned organizations( such as the so- called bloc parties, trade unions, etc.) came together with representatives of the new citizens ’ movements( such as Democracy Now, Democratic Awakening, and New Forum) to discuss and advance reforms in the German Democratic Republic( East Germany), advising the executive until free elections could be held. There were 39 representatives at the Central Round Table, 33 of whom were entitled to vote. Seventeen of them represented new oppositional groups and political parties, and sixteen were from political parties and organizations that had been part of the communist- dominated East German government. Three, representing women, consumers and environmentalists, had observer status. The final three members were the moderators, all clergymen, from the Protestant, Catholic and Methodist churches, who did not have a vote. At first most participants hoped to reform the East German government and thus retain the country ’s independence, but as popular opinion moved towards rapid unification with West Germany, these hopes were dashed. The Round Table\'s first three meetings, held on 7, 18 and 22 December 1989, took place in the Protestant church\'s Bonhoeffer House near Friedrichstraße in Berlin- Mitte. Because popular interest created a need for more space, from the fourth meeting on 27 December to the sixteenth and final meeting on 12 March 1990, the Round Table met in the conference building of the SED- dominated Council of Ministers in Ossietzky St. near Schönhausen Palace in Berlin- Pankow. During the first meeting the Round Table decided to dissolve the" Office for National Security"( the organization that succeeded the Stasi), to hold free elections for the East German Parliament(" Volkskammer") on 6 May 1990( in January the election was preponed to 18 March 1990), and to draft a new constitution, a project that was completed by a subcommittee and presented on 4 April 1990, but never discussed by the newly elected" Volkskammer". Modeled after this Central Round Table, many local round tables were set up in cities and towns across East Germany. In general they continued to exist until the May 6, 1990 local elections constituted new local governments.', 'title': 'East German Round Table'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Sathyavan Savithri  is a 2007 Kannada comedy film directed by Ramesh Aravind and produced by Ajay Chandani for Ajay Films banner. The story written by Rajendra Karanth, is inspired by a famous French play "Fleur de cactus" by Pierre Barillet and Jean-Pierre Gredy which was also made in English as "Cactus Flower" (1969) and Hindi as "Maine Pyaar Kyun Kiya?" (2005). The film features Ramesh Aravind, Jennifer Kotwal and Daisy Bopanna in leading roles. It features soundtrack and score by Gurukiran.', 'title': 'Sathyavan Savithri'}]

