[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Anne Cecil, Countess of Salisbury( 9 August 1693 – 22 March 1757), formerly Lady Anne Tufton, was the wife of James Cecil, 5th Earl of Salisbury. She was the daughter of Thomas Tufton, 6th Earl of Thanet, and his wife, the former Lady Catharine Cavendish. She and her elder sister Catherine( later Viscountess Sondes) were friendly with Anne Finch, Countess of Winchilsea, whose poem" A Nocturnal Reverie" praises Anne. Anne was known to Anne Finch by the poetic pseudonym," Lamira". On 12 February 1709, Anne married the earl, who had succeeded his father in the earldom in 1694. They had four children: The earl died in October 1728, aged 37, and was succeeded by their only son, James. Anne\'s youngest daughter, Margaret, died in 1752 of smallpox, at the home of her eldest daughter, Catherine, Countess of Egmont, in Pall Mall, London. Another daughter, Anne, died later in the same year. The Countess Anne school in Hatfield, founded in 1735, was named after the countess, but the original charity school closed in 1912, to be replaced by the current Church of England school.', 'title': 'Anne Cecil, Countess of Salisbury'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'James Cecil, 5th Earl of Salisbury (8 June 1691 – 9 October 1728), known as Viscount Cranborne from 1691 to 1694, was a British nobleman, politician, and peer. Salisbury was the son of James Cecil, 4th Earl of Salisbury, and Frances Bennett, and succeeded his father in the earldom in 1694. From 1712 to 1714 he served as Lord Lieutenant of Hertfordshire. Lord Salisbury married Lady Anne Tufton, daughter of Thomas Tufton, 6th Earl of Thanet, on 12 February 1709. They had four children:\nLord Salisbury died in October 1728, aged 37, and was succeeded in his titles by his son James. Lady Salisbury died in 1756. The Countess Anne school in Hatfield, founded in 1735, is named after her.', 'title': 'James Cecil, 5th Earl of Salisbury'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Sackville Tufton, 7th Earl of Thanet( 11 May 1688 – 4 December 1753) of Newbottle, Northamptonshire, known as Sackville Tufton until 1729, was a British Tory politician who sat in the House of Commons from 1722 until 1729 when he succeeded to the peerage as Earl of Thanet. Tufton was the son of Colonel the Honourable Sackville Tufton, fifth son of John Tufton, 2nd Earl of Thanet. His mother was Elizabeth, daughter of Ralph Wilbraham of Newbottle. He succeeded his father in 1721 and married Lady Mary Saville, daughter of William Savile, 2nd Marquess of Halifax, on 11 June 1722. Tufton was returned unopposed as Tory Member of Parliament for Appleby at the 1722 British general election. In 1725 he made an agreement with the 3rd Viscount Lonsdale while they were both alive, that each would recommend one Member for Appleby and not attempt to change the balance of power in the borough. Accordingly, he was returned unopposed again at the 1727 British general election. His only recorded vote in the Commons was against the Government on the civil list arrears in 1729. He vacated his seat in the Commons when he succeeded his uncle Thomas Tufton, 6th Earl of Thanet in the earldom of Thanet and entered the House of Lords. He was hereditary High Sheriff of Westmorland from 1729 to 1753. Thanet's wife Mary died in July 1751. He survived her by two years and died in December 1753, aged 65. He was succeeded in his titles by his eldest surviving son, Sackville. His daughter Mary married Sir William Duncan, 1st Baronet, a royal physician, and his other daughter Charlotte died unmarried.", 'title': 'Sackville Tufton, 7th Earl of Thanet'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Thomas Tufton, 6th Earl of Thanet, 18th Baron de Clifford PC( 30 August 1644 – 30 July 1729) was an English nobleman and politician. He was the fourth son of John Tufton, 2nd Earl of Thanet and his wife Margaret Sackville, Baroness Clifford and inherited the title on the death in 1684 of his elder brother Richard Tufton, 5th Earl of Thanet. Through his maternal grandmother, he was heir to the Barony de Clifford and to vast estates in Cumberland and Westmorland. He served as hereditary High Sheriff of Westmorland from 1684 to 1729. He gained the rank of Captain in the service of the Troop of Horse. He held the office of Member of Parliament( M.P.) for Appleby between 1668 and 1679. He succeeded to the title of 6th Earl of the Isle of Thanet, co. Kent[ E., 1628] on 27 April 1680. He gained the rank of Colonel in 1685 in the service of the Regiment of Horse( 5th Horse). He held the office of Lord- Lieutenant of Westmorland between 1685 and 1687. He held the office of Lord- Lieutenant of Cumberland between 1685 and 1687. He succeeded to the title of 18th Lord Clifford[ E., 1299] on 12 December 1691, resolved by the House of Lords. He was invested as a Privy Counsellor( P.C.) from 1703 to 1707 and 1711 to 1714. He held the office of Lord- Lieutenant of Cumberland between 1712 and 1714. On 14 August 1684, he married Lady Catharine Cavendish( d. 1712), daughter of Henry Cavendish, 2nd Duke of Newcastle. They had eight children, five of whom reached adulthood: In 1703, he was sworn a Privy Counsellor. A country gentleman and a Tory, he was noted by Swift for his" piety and charity." On his death, his title passed to his nephew Sackville Tufton, 7th Earl of Thanet, son of his younger brother Sackville. The barony of Clifford again fell into abeyance until 1734.', 'title': 'Thomas Tufton, 6th Earl of Thanet'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Sackville Tufton, 9th Earl of Thanet (30 June 1769 – January 1825) succeeded to his title in April 1786, following the death of his father Sackville Tufton, 8th Earl of Thanet. Two of his younger brothers were John Tufton and Henry Tufton, 11th Earl of Thanet, both well-known amateur cricketers. Sackville Tufton was himself a keen cricketer who made five known appearances in first-class cricket matches between 1791 and 1794. He was an early member of Marylebone Cricket Club (MCC) and was associated with Kent cricket.', 'title': 'Sackville Tufton, 9th Earl of Thanet'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Anthony Grey, 3rd Baron Lucas, styled Earl of Harold( 21 February 1695 – 21 July 1723) was a British peer and courtier. Grey was the eldest son of Henry Grey, 1st Duke of Kent, and his wife, Jemima Crew. On 17 February 1718, Anthony married Lady Mary Tufton, a daughter and coheiress of Thomas Tufton, 6th Earl of Thanet, by his wife Lady Catharine Cavendish. He was called to the House of Lords, by writ of acceleration in his father's barony of Lucas, on 8 November 1718. Lord Harold was a Lord of the Bedchamber to George, Prince of Wales, later King George II, from 1720 until his death in 1723, aged 28, from choking on an ear of barley the beard of which stuck in his throat. He had no children, so his title reverted to his father and his wife later married John Leveson- Gower, 1st Earl Gower.", 'title': 'Anthony Grey, Earl of Harold'}
