 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Lewis Watson, 2nd Earl of Rockingham (c. 1714 – 4 November 1745) was a British peer, styled Viscount Sondes from 1722 to 1724. He was born the eldest son of Edward Watson, Viscount Sondes and Lady Catherine Tufton, the daughter of Thomas Tufton, 6th Earl of Thanet and Lady Catherine Cavendish. His father having predeceased his own father, Lewis inherited the earldom from his grandfather, Lewis Watson, 1st Earl of Rockingham, in 1724. He was Lord Lieutenant of Kent from 1737 to his death in 1745. He was married to his first cousin Catherine, daughter of Sir Robert Furnese. After he died in 1745, she remarried to Francis, Earl of Guildford. Lewis Watson died childless and was succeeded by his brother, Thomas.', 'title': 'Lewis Watson, 2nd Earl of Rockingham'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Lord Nassau Powlett( 23 June 1698 – 24 August 1741) was an English army officer and politician who sat in the House of Commons from 1720 to 1734 and in 1741. Powlett was the only son of Charles Powlett, 2nd Duke of Bolton by his third wife Henrietta Crofts. He joined the army and was a cornet in the 12th Dragoons in 1715, captain in the 6th Dragoon Guards in 1718 and in the Royal Horse Guards in 1721. He was returned as Member of Parliament for Hampshire in a by-election on 22 June 1720 and held the seat until the 1727 general election. In 1725, he became one of the founder knights of the Order of the Bath. He was returned as MP for Lymington in 1727 and held the seat until 1734 when he did not stand again. He regained his seat at Lymington in the 1741 general election but died soon after on 24 August. In 1731, he married Lady Isabella Tufton, daughter of Thomas Tufton, 6th Earl of Thanet Powlett's only child, a daughter Isabella Paulet( who died on 8 September 1821), married on 4 June 1765 John Perceval, 3rd Earl of Egmont.", 'title': 'Lord Nassau Powlett'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': "John Tufton, 2nd Earl of Thanet (15 December 1608 – 7 May 1664) was an English nobleman and supporter of Charles I of England. He was the eldest son of Nicholas Tufton, 1st Earl of Thanet and Lady Frances Cecil granddaughter of William Cecil, 1st Baron Burghley. On 21 April 1629, he married Lady Margaret Sackville (1614–1676), daughter of Richard Sackville, 3rd Earl of Dorset and Lady Anne Clifford. They had eleven children: Thanet was a staunch Cavalier, and in 1642 led a regiment to try to raise a rebellion in Sussex in support of Sir William Brockman in Kent. However, Brockman's revolt quickly collapsed and the Earl was forced to surrender. He suffered considerably from confiscations and sequestrations of his large estates during the English Civil War. Among his properties was Bodiam Castle, purchased from the Levett family in 1639, which Thanet sold for £6,000 in 1644. Curiously, he was succeeded as Earl of Thanet by four of his sons in succession, the first three having no issue.", 'title': 'John Tufton, 2nd Earl of Thanet'}]

