 {'idx': 4, 'is_supporting': True, 'paragraph_text': "Philip III (27 March 1306 – 16 September 1343), called the Noble or the Wise, was King of Navarre from 1328 until his death. He was born a minor member of the French royal family but gained prominence when the Capetian main line went extinct, as he and his wife and cousin, Joan II of Navarre, acquired the Iberian kingdom and a number of French fiefs. Philip and Joan's accession signified the end of the 44-year-long personal union between France and Navarre. Although neither succeeded in claiming the crown of France, Philip and Joan were powerful vassals of the Valois king Philip VI as well as successful co-monarchs in Navarre. Despite initial reluctance by the Navarrese to accept him as king alongside Joan, Philip in particular is credited with improving the kingdom's legislature. The couple resided chiefly in their French lands but spent enough time in Navarre to earn them substantial popularity in the country. Philip actively supported his Valois cousin with his troops and as army leader, especially during the onset of the Hundred Years' War. During his joint reign with his wife, however, the focus of Navarre again shifted to its Iberian neighbours. This may have influenced Philip to join the crusade against the Kingdom of Granada, during which he fell ill, possibly wounded, and died.", 'title': 'Philip III of Navarre'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': "Joan II (28 January 1312 – 6 October 1349) was Queen of Navarre from 1328 until her death. She was the only surviving child of Louis X of France, King of France and Navarre, and Margaret of Burgundy. Joan's paternity was dubious because her mother was involved in a scandal, but Louis X declared her his legitimate daughter before he died in 1316. However, the French lords were opposed to the idea of a female monarch and elected Louis X's brother, Philip V, king. The Navarrese noblemen also paid homage to Philip. Joan's maternal grandmother, Agnes of France, Duchess of Burgundy, and uncle, Odo IV of Burgundy, made attempts to secure the counties of Champagne and Brie (which had been the patrimony of Louis X's mother, Joan I of Navarre) to Joan, but the French royal troops defeated her supporters. After Philip V married his daughter to Odo and granted him two counties as her dowry, Odo renounced Joan's claim to Champagne and Brie in exchange for a compensation in March 1318. Joan married Philip of Évreux, who was also a member of the French royal family. Philip V was succeeded by his brother, Charles IV, in both France and Navarre in 1322, but most Navarrese lords refused to swear loyalty to him. After Charles IV died in 1328, the Navarrese expelled the French governor and declared Joan the rightful monarch of Navarre. In France, Philip of Valois was crowned king. He concluded an agreement with Joan and her husband, who renounced Joan's claims to Champagne and Brie in exchange for three counties, while Philip acknowledged their right to Navarre. Joan and her husband were together crowned in Pamplona Cathedral on 5 March 1329. The royal couple closely cooperated during their joint reign, but Philip of Évreux was more active. However, they mostly lived in their French domains. Navarre was then administered by governors during their absence.", 'title': 'Joan II of Navarre'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Agnès of Navarre( 1334 – 1396) was the daughter of Philip III of Navarre and Joan II of Navarre, and became Countess of Foix on marriage to Gaston III, Count of Foix. She was rumoured to have had an affair with poet Guillaume de Machaut and so inspired his poem" Le Voir Dit".', 'title': 'Agnès of Navarre'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Philip of Navarre, Count of Longueville( 1336 – 1363) was a younger brother and supporter of Charles II of Navarre, a claimant to the French throne. The son of Philip III of Navarre and Joan II of Navarre, he married Yolande of Flanders in 1353. She was the daughter of Robert of Flanders and Joan of Brittany( from the House of Capet) and the widow of Henry IV of Bar. The marriage was childless, though by his mistress Jeannette d' Aisy Philip had two illegitimate children- Lancelot( who was granted Longueville as a gift in 1371 by his uncle Charles II of Navarre so long as he served in the company of the Duke of Brittany) and Robine( granted Longueville by her uncle Louis of Navarre in 1367). Philip and his brother Charles fought against John II of France in 1353.", 'title': 'Philip, Count of Longueville'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Joan of Navarre( 1326 – 3 July 1387) was a princess from the French House of Évreux, the eldest child of King Philip III and Queen Joan II of Navarre.', 'title': 'Joan of Navarre (nun)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Isabel d' Albret of Navarre( 1512–1555) was the daughter of John III of Navarre( died 1516) and Catherine I of Navarre, sister and heiress of Francis Phoebus, King of Navarre. As heir apparent, her brother rose to the throne in 1517 as Henry II of Navarre, grandfather of King Henry III of Navarre( Henry IV of France).", 'title': 'Isabella of Navarre, Viscountess of Rohan'}]

