[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'William I of Berg( c. 1242 – 16 April 1308) was the son of Count Adolf VII of Berg and of Margaret of Hochstaden. Upon the death of his brother, Count Adolf VIII of Berg, William succeeded as Count of Berg. Formerly serving as a monk, he was absolved of his religious vows by the pope in order to take the position. His tenure was notable due to increased and constant conflict with the Archbishop of Cologne. In 1300 he supported King Albert I of Germany against the Rhenish electors which further strengthened his position against the archbishop. During his life he started foundations for monasteries and churches, including those in Beyenburg( now part of Wuppertal) and Gräfrath. He was also served as the benefactor of the citizens of Hückeswagen. William married Irmgard of Cleves(? –11 May 1319), widow of Conrad I of Saffenburg and daughter of Dietrich VI, Count of Cleves. William and Irmgard are buried in the Berg family vault of the Altenberg Cathedral. As William had no children, his nephew Adolf IX of Berg, son of his brother Henry of Berg, Lord of Windeck succeeded him as Count of Berg.', 'title': 'William I of Berg'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Adolf IX of Berg( also referred to as Adolf VI)( c. 1280 – 3 April 1348) was the eldest son of Henry of Berg, Lord of Windeck and Agnes of the Mark. In 1308, Adolf succeeded as Count of Berg upon the death of his uncle William I of Berg who had no children. Adolf was an important and loyal supporter of Ludwig IV of Bavaria, helping him since 1314 in the war of succession. As a result of Adolf's 1312 marriage to Agnes of Cleves, he received the Rhine customs of Duisberg as a dowry and these were confirmed as an imperial fief by Emperor Louis in 1314. He continued the constant feuds between the House of Berg and the Archbishops of Cologne. In 1327/ 28, he joined Louis on his trip to Rome where he was crowned as Emperor. Adolf received the privilege to mint silver which he did at Wipperfürth. In 1337 Adolf joined the English- German Alliance which caused the start of the Hundred Years' War. In 1312 Adolf was married to Agnes of Cleves( c. 1295 – aft. 1361), daughter of Dietrich VII, Count of Cleves and Margaret of Habsburg- Kiburg. He died on 3 April 1348 without children and was succeeded by his only surviving niece, Margaret of Ravensberg by right of her mother, and her husband Gerhard VI of Jülich as Count and Countess of Berg. Thus, the Counties of Berg and Ravensburg came in 1348 under the house of Jülich, and were in 1437 united with the County of Jülich. In 1511 all three passed into the house of Cleves.", 'title': 'Adolf IX of Berg'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Adolf IV of Berg count of Berg from 1132 until 1160 and of Altena( died after 1161), son of Adolf III of Berg count of Berg and Hövel. He married( 1st) Adelheid von Arnsberg, a daughter of Heinrich count von Rietberg; then( 2nd) Irmgard von Schwarzenberg, a daughter of Engelbert von Schwarzenberg. He built the Schloss Altena, and built Altenberg Abbey( 1133) where he enters in 1160. He has issue from his first marriage: and from his second marriage:', 'title': 'Adolf IV, Count of Berg'}
