 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Henry of Berg, Lord of Windeck( bef. 1247 – 8 March 1290/ 96) was the son of Adolf VII of Berg and Margaret of Hochstaden. He was the younger brother of Adolf VIII of Berg and William I of Berg. From 1271- 1281 Henry served as a governor for his brother Adolf who became Count of Berg in 1259. Henry and his brother Adolf supported John I, Duke of Brabant in his succession war for the Duchy of Limburg, which culminated in the Battle of Worringen in 1288. Henry resided at Windeck castle, probably as an official of his brother. Windeck was one of the four main Berg castles, which had come into the possession of Berg by 1247. Henry is buried with other members of the house of Berg at Altenberg Cathedral.', 'title': 'Henry of Berg, Lord of Windeck'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "William VII of Jülich, 1st Duke of Berg( – 25 June 1408) was born in Jülich, as the son of Gerhard VI of Jülich, Count of Berg and Ravensberg, and Margaret, daughter and heiress of Otto IV, Count of Ravensberg, and Margaret of Berg. Upon his father's death in 1360, William became Count of Berg and Ravensberg, a title that his father had gained by marrying the heiress of Berg and Ravensberg. In 1380, King Wenzel elevated him to the rank of Duke, thus becoming the first Duke of Berg. William fought the counties of Mark and Cleves to prevent them from combining but in 1397 he was taken prisoner in the battle of Kleverhamm. He lost Remagen, Kaiserwerth and Sinzig to his nephew Adolf IV, Count of Kleve- Mark and due to these losses, his sons turned against him and imprisoned him in 1403/ 04. He ultimately forced them to submit and later supported his brother- in- law Rupert, King of Germany against Guelders- Jülich and won the county of Blankenburg. William died on 25 June 1408 and is buried in the Abteikirche in Altenberg.", 'title': 'William VII of Jülich, 1st Duke of Berg'}
