[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Sir Owen Tudor (1400 – 2 February 1461) was a Welsh courtier and the second husband of Catherine of Valois (1401–1437), widow of King Henry V of England. He was the grandfather of Henry VII, founder of the Tudor dynasty. Owen was a descendant of a prominent family from Penmynydd on the Isle of Anglesey, which traces its lineage back to Ednyfed Fychan (d. 1246), a Welsh official and seneschal to the Kingdom of Gwynedd. Tudor's grandfather, Tudur ap Goronwy, married Margaret, daughter of Thomas ap Llywelyn ab Owain of Cardiganshire, the last male of the princely house of Deheubarth. Margaret's elder sister married Gruffudd Fychan of Glyndyfrdwy, whose son was Owain Glyndŵr. Owen's father, Maredudd ap Tudur, and his uncles were prominent in Owain Glyndŵr's revolt against English rule, the Glyndŵr Rising.", 'title': 'Owen Tudor'}
