 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Bianca of Burgundy( 1288 – July 1348), was a Countess consort of Savoy, daughter of Robert II, Duke of Burgundy, and Agnes of France. She married in 1307 Edward, Count of Savoy. She was mother of Joan of Savoy. In 1346 and 1347, she was an influence at the court of her nephew, Amadeus VI to pursue closer alliances with Burgundy to offset the pending sale of the Dauphiné to France. This led to his brief engagement with Joan of Burgundy, daughter of Philip of Burgundy and Joan I, Countess of Auvergne. She died July 1348, perhaps from the Black Death.', 'title': 'Blanche of Burgundy, Countess of Savoy'}
