 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Edward (1284–1329), surnamed the Liberal, was the Count of Savoy from 1323 to 1329. He was the son of Amadeus V, Count of Savoy, and his first wife Sybille of Bâgé. Edward was born at Baugé. He was married to Blanche (Bianca) of Burgundy, daughter of Robert II, Duke of Burgundy and Agnes of France, Duchess of Burgundy. They had a daughter, Joan, who married John III the Good, duke of Brittany. In 1325, Edward was attacked at Varey by Guigues VIII of Viennois and Amadeus III of Geneva as he was besieging Varey castle. Guigues won the battle and Edward barely escaped. In 1327, the residents of Maurienne revolted against their bishop-prince. The bishop asked Edward for help, and Edward agreed, provided that he gain the administrative control of the diocese. The bishop consented, and was restored. That same year, the bishop of Sion refused to pay him homage, which had been the custom since the time of Peter II, Count of Savoy. From then on, the bishop and the count paid each other homage on the bridge of Morge. In 1328, he had wooden aqueducts built to bring fresh water directly into the courtyard of the castle at Chambéry. His death in 1329 was unexpected, and left the county to his brother, Aymon.', 'title': 'Edward, Count of Savoy'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': "Joan of Savoy (1310 – 29 June 1344), was Duchess consort of Brittany, wife of John III, Duke of Brittany. Joan was also a claimant to the County of Savoy upon the death of her father. She was a member of the House of Savoy and married into the House of Dreux. Joan was born in 1310, she was the only child of Edward, Count of Savoy, and his wife, Blanche of Burgundy. Joan married in 1329 aged nineteen to the forty-three-year-old, childless John III, Duke of Brittany; she was his third wife, John's second wife Isabella had died the previous year. The same year as Joan's marriage, her father died. Being his only child she considered herself his successor. However, Savoy had never had a female ruler, leading to a dispute in the succession. Joan's uncle Aymon had the support of the nobles of Savoy for the Semi-Salic inheritance and succeeded as count. John supported Joan's rights on Savoy. After the marriage, Joan renewed her claim on Savoy and allied herself with the Dauphin de Viennois against her uncle. By agreement settled by the French King on 22 November 1339, she renounced her rights of succession in return for an annual income of 6000 livres. Joan and John were married for twelve years but produced no offspring, and John died on 30 April 1341, leaving Joan a childless widow. This led to a disputed succession in Brittany between John's half-brother of the same name and John's niece Joan. In 1343, when her uncle Aymon died, Joan renewed her claim on the county of Savoy against her nine-year-old cousin, Amadeus VI. In her will, she left the county to Philip, Duke of Orléans to spite her cousins. In the end, he negotiated a similar settlement to the one of Joan, yielding the claim in exchange for 5000 livres annually. Joan died on 29 June 1344.", 'title': 'Joan of Savoy'}
