 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Jean-Baptiste Colbert (29 August 1619 – 6 September 1683) was a French politician who served as the Minister of Finances of France from 1661 to 1683 under the rule of King Louis XIV. Colbert worked to develop the domestic economy by raising tariffs and by encouraging major public works projects, and to ensure that the French East India Company had access to foreign markets, so that they could always obtain coffee, cotton, dyewoods, fur, pepper and sugar. Colbert worked to create a favourable balance of trade and increase France\'s colonial holdings. As there was slavery in the colonies, Colbert also drafted the "Code Noir" which was to be promulgated two years after his death. In addition, Colbert founded the French merchant marine. Colbert\'s market reforms included the foundation of the "Manufacture royale de glaces de miroirs" in 1665 to supplant the importation of Venetian glass (forbidden in 1672, as soon as the French glass manufacturing industry was on sound footing) and to encourage the technical expertise of Flemish cloth manufacturing in France. He also founded royal tapestry works at Gobelins and supported those at Beauvais. Colbert issued more than 150 edicts to regulate the guilds. (One such law had the intention of improving the quality of cloth. The edict declared that if the authorities found a merchant\'s cloth unsatisfactory on three separate occasions, they were to tie him to a post with the cloth attached to him.)', 'title': 'Jean-Baptiste Colbert'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Jean- Louis Bergeret( 11 December 1641, Paris – 9 October 1694) was an early holder of the 8th seat of the Académie française. Bergeret was Advocate General to the Metz Parliament in 1672, and became the first deputy of Charles Colbert, marquis de Croissy, the Secretary of State and younger brother of Jean Baptiste Colbert, and then the King\'s Cabinet Secretary. When Bergeret was presented for election to the Academy, he had the support of all of the Colbert family, against Gilles Ménage, by then an octogenarian, who though much more senior had previously displeased the Academy with his(" Requirements for Dictionaries"). Bergeret was elected on 4 December 1684 to replace Géraud de Cordemoy, who had killed himself in October of that year, and was received on 2 January 1685 by Jean Racine, the same day as Thomas Corneille. Little is known of him beyond his election and acceptance speech, and that he received into the Academy François- Timoléon de Choisy and François Fénelon. The Abbé d\' Olivet remarked" Nobody knows how he got through the doors of the Academy". He left no writing nor, it seems, anything memorable to his contemporaries.', 'title': 'Jean-Louis Bergeret'}
