 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Mark of Zorro is a 1940 American black- and- white swashbuckling Spanish Western adventure film from 20th Century Fox, produced by Darryl F. Zanuck, directed by Rouben Mamoulian, that stars Tyrone Power, Linda Darnell, and Basil Rathbone. " The Mark of Zorro" was nominated for an Academy Award for Best Original Score. The film was named to the National Film Registry in 2009 by the Library of Congress for being" culturally, historically or aesthetically significant", and to be preserved for all time. The film is based on" The Curse of Capistrano" written by Johnston McCulley, originally published in 1919 in five serialized installments in" All- Story Weekly", which introduced the masked hero Zorro; the story is set in Southern California during the early 19th century. After the enormous success of the silent 1920 film adaptation," The Mark of Zorro", the story was republished under that name by Grosset& Dunlap.', 'title': 'The Mark of Zorro (1940 film)'}
