 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Sofía Bozán ( 5 November 1904 – 9 July 1958) was an Argentine film actress and tango performer of the 1930s and 1940s. She made almost 30 appearances in film between 1937 and 1959. She began her career in acting in 1931 and appeared in films such as" Puerto nuevo" in 1936 and" Loco lindo"( 1937) and" Muchachas que estudian" in 1939. She also appeared in the tango film" Arriba el telón o el patio de la morocha" in 1951 as herself. She was the sister of Elena Bozán. Sofia Bozán died of cancer only aged 53 in 1958.', 'title': 'Sofía Bozán'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Hugo Geronimo Fregonese (April 8, 1908 in Mendoza – January 11, 1987 in Tigre) was an Argentine film director and screenwriter who worked both in Hollywood and his home country. He made his directorial debut in 1943. In 1949, he directed "Apenas un delincuente". Most of Fregonese\'s American films were Westerns and crime melodramas, like "Man in the Attic" (1953)" and Black Tuesday" (1954). He worked with such Hollywood actors as Gary Cooper, Barbara Stanwyck, Anthony Quinn, Edward G. Robinson, Luisa Vehil, Víctor Laplace, Soledad Silveyra, Paul Naschy and Joel McCrea, among others. For directing the now-almost forgotten film "My Six Convicts" (1952), Fregonese was nominated for the Directors Guild of America Award for Outstanding Directing - Feature Film.', 'title': 'Hugo Fregonese'}]

