 {'idx': 3, 'is_supporting': False, 'paragraph_text': '"( What Is) Love?" is a song recorded by American entertainer Jennifer Lopez. Originally entitled" What Is Love?", the song appeared on the soundtrack to" The Back- up Plan"( 2010), a film in which Lopez stars, version presented in Italy at the Sanremo Music Festival 2010. The song was later included on Lopez\'s seventh studio album" Love?"( 2011), as the album\'s title track. "( What Is) Love?" is a midtempo electropop song written by Diana" Wynter" Gordon, with the song\'s producer Emile" D\' Mile" Dernst II. The song is about" not knowing what love is," according to Gordon. A remix of"( What Is) Love?", entitled" What Is Love? Part II", was produced by Jean- Baptiste. It was considered for inclusion on" Love?" and was leaked onto the internet in April 2013. The song was due to be released as a promotional single from" Love?" on April 26, 2011, but was" unlocked" and released on April 22, 2011 by Island Records through a campaign on Lopez\'s Facebook page. Upon its promotional release, the song debuted at number 97 on the South Korea Gaon International Chart and at 33 on the Productores de Música de España.', 'title': '(What Is) Love?'}
