 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Grudge 3 is a 2009 American supernatural horror film and the third installment in" The Grudge" film series. Toby Wilkins, who had previously directed the successful film" Splinter" and the short film series" Tales from the Grudge", took Takashi Shimizu\'s place as director who later served as executive producer, while Brad Keene replaced Stephen Susco as screenwriter. The film stars Johanna Braddy, Gil McKinney, Emi Ikehata, Jadie Rose Robson, Beau Mirchoff and Shawnee Smith, with a special appearance by Matthew Knight( from" The Grudge 2"). Aiko Horiuchi and Shimba Tsuchiya plays Kayako and Toshio in the film, with Takashi Matsuyama being the only actor reprising his role from the previous films. Unlike the previous American films that were both rated PG- 13," The Grudge 3" was given an R rating because of its graphic bloody violence, gore and language. The film features a linear plotline unlike all of its predecessors, which used nonlinear sequences of events for their respective plots and subplots. " The Grudge 3" was released on DVD on May 12, 2009, by Sony Pictures Home Entertainment. It received mixed to negative reviews from critics and grossed$ 38 million against a$ 5 million budget.', 'title': 'The Grudge 3'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Grudge is a 2004 supernatural horror film directed by Takashi Shimizu, written by Stephen Susco, and produced by Sam Raimi, Robert Tapert, and Takashige Ichise. A remake of Shimizu\'s 2002 Japanese horror film, it stars Sarah Michelle Gellar, Jason Behr, KaDee Strickland, Clea DuVall, and Bill Pullman, and is the first installment in" The Grudge" film series which is based on the Japanese" Ju- On" franchise. Takako Fuji, Yuya Ozeki, and Takashi Matsuyama portray the characters Kayako Saeki, Toshio Saeki, and Takeo Saeki from the original films. The plot is told through a nonlinear sequence of events, and includes several intersecting subplots. After the success of American remake of" The Ring", Sony Pictures had green- lit an American remake of" Ju- On: The Grudge". Shimizu, the writer and director of the original film, was hired to direct the film, from a screenplay written by Susco. Principal photography on ther film began on January 26, 2004 and wrapped in July 2004 in Tokyo, Japan. " The Grudge" was released in North America on October 22, 2004, by Columbia Pictures. The film received mixed reviews, though Gellar\'s performance as Karen Davis was praised by critics, and was a box- office success, making over$ 187 million against a$ 10 million budget. The film was followed by two sequels," The Grudge 2"( 2006) and" The Grudge 3"( 2009). A reimagining entitled" The Grudge", which takes place concurrently with the events of this film, is set to be released in 2020.', 'title': 'The Grudge'}
