[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Cecil Calvert, 2nd Baron Baltimore (8 August 1605 – 30 November 1675), was an English nobleman who was the first Proprietor of the Province of Maryland, ninth Proprietary Governor of the Colony of Newfoundland and second of the colony of Province of Avalon to its southeast. His title was "First Lord Proprietary, Earl Palatine of the Provinces of Maryland and Avalon in America". He received the proprietorship after the death of his father, George Calvert, 1st Baron Baltimore, (1579 – 15 April 1632), for whom it had been intended. Cecil Calvert established and managed the Province of Maryland from his home, Kiplin Hall, in North Yorkshire, England. As an English Roman Catholic, he continued the legacy of his father by promoting religious tolerance in the colony. Maryland became a haven for Catholics in the New World, particularly important at a time of religious persecution in England. Calvert governed Maryland for forty-two years. He also continued to be Lord Proprietor and Governor of Newfoundland for the Province of Avalon.', 'title': 'Cecil Calvert, 2nd Baron Baltimore'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Charles Calvert, 3rd Baron Baltimore (August 27, 1637 – February 21, 1715), inherited the colony of Maryland in 1675 upon the death of his father, Cecil Calvert, 2nd Baron Baltimore, (1605–1675). He had been his father's Deputy Governor since 1661 when he arrived in the colony at the age of 24. However, Charles left Maryland for England in 1684 and would never return. The events following the Glorious Revolution in England in 1688 would cost Calvert his title to Maryland; in 1689 the royal charter to the colony was withdrawn, leading to direct rule by the British Crown. Calvert's political problems were largely caused by his Roman Catholic faith which was at odds with the established Church of England. Calvert married four times, outliving three wives, and had at least two children. He died in England in 1715 at the age of 78, his family fortunes much diminished. With his death he passed his title, and his claim to Maryland, to his second son Benedict Leonard Calvert, 4th Baron Baltimore (1679–1715), his eldest son Cecil having died young. However, Benedict Calvert would outlive his father by just two months, and It would fall to Charles' grandson, Charles Calvert, 5th Baron Baltimore, (1699–1751), (who converted to the Anglican faith) to see the family proprietorship in Maryland restored by the king.", 'title': 'Charles Calvert, 3rd Baron Baltimore'}
