 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Henry J." Red" Krause, Jr.( August 28, 1913 – February 20, 1987) was an American football offensive lineman in the National Football League for the Brooklyn Dodgers and the Washington Redskins. He played college football at St. Louis University. He is the grandfather of Jennifer Krause He is the great grandfather of Payton Hoeing', 'title': 'Henry Krause'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'John Altham( 1589 – November 5, 1640), also known as John Gravenor, was a British Jesuit missionary who came to North America to preach to the Native Americans. He was born in Warwickshire, England, in 1589. He was one of the two Jesuits who accompanied Cecil Calvert, 2nd Baron Baltimore in 1633 and arrived in the Chesapeake Bay in 1634. Upon landing, he obtained a hut from its Indian owner, which he fitted up for religious service, and it was afterward known as" the first chapel in Maryland." He performed his missionary work among the Indians around Kent Island from 1634 till his death from yellow fever, in nearby St. Mary\'s, Maryland, in 1640.', 'title': 'John Altham'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Anna Farquhar Bergengren( pen name, Margaret Allston; December 23, 1865 –?) was an American author and editor. Of Scotch- English ancestry, Bergengren\'s ancestors came to the United States in the time of Cecil Calvert, 2nd Baron Baltimore\' ssettling in Maryland, near Baltimore. She was born in 1865, near Brookville, Indiana, her father being a lawyer and a member of Congress from that state. Her father\'s death made her determine upon a career for herself and she chose a musical education, but her health failed while studying in Boston, and she was ultimately obliged to give up singing, in which she had already attained fair success. She wrote for the" Boston TranscriptDetroit Free Press", and" Springfield Republican" during her musical career. While studying vocal music in London and Paris, she was employed as a foreign correspondent to the" Boston Transcript". Her story" The Singer\'s Heart" expressed her professional ambitions. " The Professor\'s Daughter" was published in the" Saturday Evening Post" and was very popular. " Her Boston Experiences" appeared in a magazine and ultimately in book form. Her book," The Devil\'s Plough", was a story of the early French missionaries of North America. During her life in Washington, D.C., she obtained the material for her book" Her Washington Experiences", her first real success as a writer. She was also the author of," A Singer\'s Heart The Professor\'s Daughter", 1899;" Letters of a Cabinet Member\'s Wife", 1897. Bergengren published" Her Boston Experiences" under pen name of" Margaret Allston", which sold in book form in 1899. Bergengren also did much other magazine work. In 1900, she married Ralph Wilhelm Bergengren, a Boston journalist, and continued her literary career.', 'title': 'Anna Farquhar Bergengren'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "William Hill( fl. 1630s) was the Proprietary Governor of the Province of Avalon in Newfoundland from 1634 to 1638. He was appointed to the position by Cecil Calvert, 2nd Baron Baltimore. George Calvert, 1st Baron Baltimore had founded the colony and acted as its governor and Cecil Calvert had managed the colony after his father's death but since he was occupied with the Province of Maryland appointed Hill as governor in his stead. Hill remained in the colony, living in Lord Baltimore's house, until the arrival of Sir David Kirke in 1638. Kirke had been granted a Royal Charter over all of Newfoundland and forced Hill to vacate the house and move across the harbour where he stayed until his death.", 'title': 'William Hill (governor)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Augustine Herman, First Lord of Bohemia Manor( Czech: Augustin Heřman, c. 1621 – September 1686) was a Bohemian explorer, merchant and cartographer who lived in New Amsterdam and Cecil County, Maryland. In the employment of Cecil Calvert, 2nd Baron Baltimore, he produced a remarkably accurate map of the Chesapeake Bay and Delaware Bay regions of North America, in exchange for which he was permitted to establish an enormous plantation that he named Bohemia Manor in what is now southeastern Cecil County, Maryland. Land rights to the area now known as St. Augustine, Maryland were granted to Herman by Lord Baltimore prior to 1686 but the Herman family was never able to lay proper claim to the title. Chroniclers have spelled the surname variously: Herman, Herrman, Harman, Harmans, Heerman, Hermans, Heermans, etc. Augustine Herman himself usually wrote" Herman," which is now the accepted style. He frequently added" Bohemiensisthe Bohemianthe Czech"), as a suffix.', 'title': 'Augustine Herman'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'George Calvert, 1st Baron Baltimore (1580 – 15 April 1632), was an English politician and coloniser. He achieved domestic political success as a member of parliament and later Secretary of State under King James I. He lost much of his political power after his support for a failed marriage alliance between Prince Charles and the Spanish House of Habsburg royal family. Rather than continue in politics, he resigned all of his political offices in 1625 except for his position on the Privy Council and declared his Catholicism publicly. He was created Baron Baltimore in the Peerage of Ireland upon his resignation. Baltimore Manor was located in County Longford, Ireland. Calvert took an interest in the British colonisation of the Americas, at first for commercial reasons and later to create a refuge for persecuted English Catholics. He became the proprietor of Avalon, the first sustained English settlement on the southeastern peninsula on the island of Newfoundland (off the eastern coast of modern Canada). Discouraged by its cold and sometimes inhospitable climate and the sufferings of the settlers, he looked for a more suitable spot further south and sought a new royal charter to settle the region, which would become the state of Maryland. Calvert died five weeks before the new Charter was sealed, leaving the settlement of the Maryland colony to his son Cecil (1605–1675). His second son Leonard Calvert (1606–1647) was the first colonial governor of the Province of Maryland.', 'title': 'George Calvert, 1st Baron Baltimore'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Benedict Leonard Calvert, 4th Baron Baltimore( 21 March 1679 – 16 April 1715) was an English nobleman and politician. He was the second son of Charles Calvert, 3rd Baron Baltimore( 1637 – 1715) by Jane Lowe, and became his father's heir upon the death of his elder brother Cecil in 1681. The 3rd Lord Baltimore was a devout Roman Catholic, and had lost his title to the Province of Maryland shortly after the events of the Glorious Revolution in 1688, which saw the Protestant monarchs William III and Mary II accede to the British throne. Benedict Calvert would make strenuous attempts to have his family's title to Maryland restored by renouncing Roman Catholicism and joining the Church of England. In February 1715 Benedict became the 4th Baron Baltimore upon the death of his father, and he immediately petitioned King George I for the restoration of Maryland to his control. However, before the King could rule on the petition, Baltimore died aged 36, outliving his father by just two months. Shortly afterwards the King restored the title to Maryland to Calvert's young son Charles Calvert, 5th Baron Baltimore.", 'title': 'Benedict Calvert, 4th Baron Baltimore'}]

