 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Broadcast is an Americana/ Soul band from Asheville, NC composed of Caitlin Krisko( vocals), Aaron Austin( guitar), Mike Runyon( keys), William Seymour( bass), Tyler Housholder( percussion), and Michael W. Davis( drums). Their independently released debut," Dodge The Arrow," was recorded in 2013 at Asheville ’s famed Echo Mountain Studio with LA producer, Eric “ Mixerman ” Sarafin. It went on to sell over 15,000 copies, ranked as high as# 4 on the college radio charts, and earned them “ Best New Artist ” and runner up for “ Album of the Year ” from" Homegrown Music Network". Their sophomore full- length album," From The Horizon," is due out June 17, 2016. David Dye and Joe Kendrick premiered" On The Edge", the first single from the new album on World Cafe\'s Sense of Place on March 31, 2016. The band\'s music eventually caught the ear of revered producer Jim Scott( Tedeschi Trucks Band, Wilco, Grace Potter, Tom Petty, Rolling Stones, Red Hot Chili Peppers). The seven- time Grammy- winner invited the band to travel to Los Angeles after hearing the demos the band had been work- shopping. There, The Broadcast recorded their sophomore album" From the Horizon" in the desert of California. Scott ’s enthusiasm about the band and genuine excitement about this collection of songs shines brightly in the finished recording. When asked about" From the Horizon," Scott says, “ I think this record is very brave in the fact that it does n’t follow a pattern or trend. It\'s classically good music based on the music that we ’ve all listened to since the ‘ 50s till today. It ’s got soul, and vibrancy, and life. ” " From the Horizon" is an apt title, expressing a sense of change and lightning- in- a- bottle potential that The Broadcast taps into on this latest offering. A slight departure from their debut album," Dodge The Arrow", the 11- song record finds the band delving deeper into the realms of Americana. In 2018, The Broadcast recorded their 3rd studio album produced by Tim Lefebvre( David Bowie, Tedeschi Trucks Band) and Tyler" Falcon" Greenwell( Tedeschi Trucks Band, Col. Bruce Hampton) with a release date of Spring 2020. The Broadcast has built a strong and loyal fan base through years of non-stop touring. They ’ve shared stages with Mavis Staples, John Prine, St. Paul& The Broken Bones, The Wood Brothers, Brandi Carlisle, Keller Williams, Nicki Bluhm and The Gramblers, George Porter Jr.( Funky Meters), Bettye LaVette, Charles Bradley and Holly Williams, among others.', 'title': 'The Broadcast (band)'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Cardiacs are an English rock band formed in 1977, originally as Cardiac Arrest, led by Tim Smith. Noted for their complex, varied and intense compositional style and for their eccentric, theatrical stage shows, they have been hailed as an influence by bands as diverse as Blur, Faith No More and Radiohead. Cardiacs have released eight studio albums plus a number of live albums, compilation albums and singles between 1980 and 2007, and are best known for the 1988 minor hit single" Is This the Life?" They are also noted for attracting strongly diverse responses: they have remained one of Britain\'s leading cult rock bands during their four- decade- spanning career, but have also attracted virulent critical attack( including a lengthy editorial ban from the British music magazine" New Musical Express"). The band has been on indefinite( and possibly permanent) hiatus following the 2008 hospitalisation of Tim Smith, after a heart attack which subsequently led him to develop the rare neurological disorder dystonia. As of 2018, Smith is still receiving medical treatment and rehabilitation.', 'title': 'Cardiacs'}
