 {'idx': 5, 'is_supporting': False, 'paragraph_text': "The annual PGA Tour Qualifying Tournament, also known as Qualifying School or Q-School, was historically the main method by which golfers earned PGA Tour playing privileges, commonly known as a Tour card. Beginning in 2013, Q-School grants privileges only for the Korn Ferry Tour, the PGA Tour's official developmental circuit. The first tournament was played in 1965. In several early years (1968–69, 1975–81), two separate tournaments were played, one in the spring and one in the fall. The format of the tournament has changed several times, ranging from a 72-hole tournament to a 144-hole tournament. The current format (in place since 1982) is 108 holes over six days in late November and early December. Before 2013, the top 25 players and ties earned their tour cards. The next set of fifty finishers earned full Korn Ferry Tour cards. The remaining participants received conditional Korn Ferry Tour status. The 2012 Qualifying Tournament was the last to grant playing privileges for the PGA Tour. On March 20, 2012, the tour announced radical changes to its season structure and qualifying process, and announced further details on July 10 of that year. The 2013 season ended with The Tour Championship in September, and the 2014 season began the following month. Since then, the Qualifying Tournament only grants playing privileges for the Korn Ferry Tour (known as the Nationwide Tour at the time of the March 2012 announcement). A new series of three tournaments known as the Korn Ferry Tour Finals, held in September, grants 50 PGA Tour cards to a field consisting of the top 75 on the Korn Ferry Tour money list and the golfers placed 126 to 200 on the PGA Tour's FedEx Cup points list. The top 25 on the Korn Ferry Tour money list before the Finals receive PGA Tour cards, with total money earned in the Finals determining the remaining 25 card earners.", 'title': 'PGA Tour Qualifying Tournament'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The WinCo Foods Portland Open is a golf tournament on the Korn Ferry Tour. It was first played in August 2014 at Witch Hollow at Pumpkin Ridge in North Plains, Oregon, a suburb of Portland. Northwest-based supermarket chain WinCo Foods was named as the title sponsor in June 2013. Since its inception, the Portland Open has become the last regular season event on the Korn Ferry Tour. The event gives players one last chance to place in the Top 25 on the money list to earn a PGA Tour card or play their way into the top 75 to retain full Korn Ferry Tour privileges and earn a chance at a PGA Tour card via the Korn Ferry Tour Finals.', 'title': 'WinCo Foods Portland Open'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The Korn Ferry Tour Championship presented by United Leasing & Finance is the year-end golf tournament of the Korn Ferry Tour. It has been played at a variety of courses; starting in 2019 it will be played at Victoria National Golf Club in Newburgh, Indiana as part of a 10 year deal. Since the 2008 edition, the purse has been $1,000,000, with the winner receiving $180,000. The format of the tournament is stroke play at 18 holes for four days, a total of 72 holes. Originally, the field consisted of the top 60 players on the money list, all attempting to be among the 25 to earn PGA Tour cards. Since 2013, it has been part of the Korn Ferry Tour Finals and the field consists of the top 75 players from the Korn Ferry Tour money list and the non-exempt players ranked 126 to 200 on the PGA Tour's money list at the start of the Finals. Beginning in 2013, 50 PGA Tour cards will be awarded after the event. It is considered the flagship event of the Korn Ferry Tour, with twenty OWGR points to the winner, compared to sixteen for other Finals events and fourteen for regular season tournaments.", 'title': 'Korn Ferry Tour Championship'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Noerr( named" Nörr Stiefenhofer Lutz" before 2010) is a pan- European full- service law firm headquartered in Munich, Germany. Founded in 1950, the firm today operates 15 offices in Germany, Central and Eastern Europe, Spain, the United Kingdom and the United States. Noerr currently employs over 500+ lawyers, tax consultants, chartered accountants and business consultants. Noerr is ranked as the second largest independent German law firm by revenue, behind Hengeler Mueller.', 'title': 'Noerr'}
