[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'John Poulett, 5th Earl Poulett( 5 July 1783 – 1864), styled Viscount Hinton from 1788 to 1819, was an English peer and militia officer. Educated at Harrow and Brasenose College, Oxford, Hinton was commissioned a captain in the 1st( East) Somersetshire Militia in 1801. His father was made colonel of that regiment in 1803, and on 20 September 1804, Hinton himself became colonel of the 2nd( West) Somersetshire Militia, and was appointed a deputy lieutenant of Somerset on 10 January 1805. Upon the death of his father in January 1819, he succeeded to the title of Earl Poulett, and also succeeded his father as colonel of the 1st( East) Somersetshire Militia. He commanded the regiment until 1852, when he was succeeded by his son Vere Poulett, Viscount Hinton. Poulett married Frances Charlotte, daughter of Henry Berkeley Portman, on 21 August 1820, by whom he had three sons, all of whom predeceased him: He was succeeded in the peerage by his nephew, William Henry Poulett( 1827 – 1899), who was the third son of his younger brother, Admiral the Hon. George Poulett.', 'title': 'John Poulett, 5th Earl Poulett'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'John de Moravia (also known as John Sutherland) (d. 1508) was the 8th Earl of Sutherland and chief of Clan Sutherland. During his chieftaincy his clan fought against the Clan Donald at the Battle of Skibo and Strathfleet. John de Moravia, 8th Earl of Sutherland married firstly a daughter of John of Islay, Earl of Ross and Lord of the Isles and had the following children:\nJohn de Moravia, 8th Earl of Sutherland married secondly a daughter of the chief of the Clan Ross of Balnagown Castle and had the following two sons:', 'title': 'John de Moravia, 8th Earl of Sutherland'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "John Poulett, 4th Earl Poulett KT (3 April 1756 – 14 January 1819), styled Viscount Hinton between 1764 and 1788, was a British peer and militia officer. Poulett was the son of Vere Poulett, 3rd Earl Poulett, by Mary Butt, daughter of Richard Butt, of Arlington, Gloucestershire. From 4 August 1778 until April 1803, he was colonel of the East Devon Militia, which was in active service in the Army in 1779. He succeeded his father in the earldom in 1788. In 1792 he was appointed Lord Lieutenant of Somerset, a post he held until his death. He was also a Recorder of Bridgwater. The East Devon Militia was again embodied, under his colonelcy, for active service in March 1794, and he was also commissioned colonel of the Somersetshire Fencible Cavalry. On 30 May, he was invested a Knight of the Thistle. He was appointed a Lord of the Bedchamber to George III on 19 November 1795, an office he held until his death. Poulett was commissioned colonel of the 1st (East) Somersetshire Militia and the East Somerset Regiment of Yeomanry Cavalry on 17 September 1803. Lord Poulett married firstly Sophia Pocock, daughter of Admiral Sir George Pocock, in 1782. They had ten children, including Vice-Admiral the Honourable George Poulett, father of William Poulett, 6th Earl Poulett. One daughter, Lady Sophia Poulett was the wife of Henry Vane, 2nd Duke of Cleveland, while another daughter, Lady Mary Poulett, was the second wife of Lord Charles Somerset. After Sophia's death in January 1811 Poulett married secondly Margaret Burges, daughter of Ynyr Burges and widow of Sir John Smith-Burges, 1st Baronet, in 1816. He died in January 1819, aged 62, and was succeeded in the earldom by his eldest son, John. The Countess Poulett died at Brighton in May 1838.", 'title': 'John Poulett, 4th Earl Poulett'}
