 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'William Henry Poulett, 6th Earl Poulett( 22 September 1827 – 22 January 1899) was an English peer, landowner, army officer, and racehorse owner. In the House of Lords he was a Conservative.', 'title': 'William Poulett, 6th Earl Poulett'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Vere Poulett, 3rd Earl Poulett (18 May 1710 – 14 April 1788), styled The Honourable Vere Poulett until 1764, was an English peer. Poulett was the son of John Poulett, 1st Earl Poulett, and Bridget Bertie, daughter of Peregrine Bertie. He was the brother of John Poulett, 2nd Earl Poulett, Peregrine Poulett and Anne Poulett, and was educated at Taunton Grammar School. He was returned to parliament for Bridgwater in 1741, a seat he held until 1747. He succeeded his elder brother in the earldom in 1764. In 1771 he was appointed Lord Lieutenant of Devon, which he remained until his death. Lord Poulett married Mary Butt, daughter of Richard Butt, of Arlington, Gloucestershire. Their younger son the Honourable Vere Poulett was a soldier and politician. Lord Poulett died in April 1788, aged 77, and was succeeded in the earldom by his elder son, John. The Countess Poulett died in April 1819.', 'title': 'Vere Poulett, 3rd Earl Poulett'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'George Amias FitzWarrine Poulett, 8th Earl Poulett (23 June 1909 – 1 March 1973) was an English peer and landowner, a member of the House of Lords for more than forty years, and the last Earl Poulett. Educated at Eton, he lived at Hinton House, Hinton St George, Somerset, the centre of a large estate inherited from his father, William Poulett, 7th Earl Poulett, in 1918. His mother was the former Sylvia Storey, a Gaiety girl. He was a pupil apprentice as a mechanical engineer at the GWR Locomotive Works, Swindon, and at the Signal Factory, Reading. In 1940–41 he was technical assistant to the chief mechanical engineer at Woolwich Arsenal, then from 1941 to 1943 an assistant to the Director of Ordnance Factories (Small Arms). He became an Associate of the Institute of Railway Signal Engineers and of the Institute of British Engineers. In 1935, he married Oriel Ross, and they were divorced in 1941; in 1941, he married secondly Lorraine Lawrence, of Svendborg, Denmark, but she died in 1961; in 1968, he married thirdly Margaret Christine Ball. He had no children. In 1968 he sold the Hinton estate and settled with his last wife in Jersey, Channel Islands. On his death in 1973, all his titles became extinct.', 'title': 'George Poulett, 8th Earl Poulett'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': "William John Lydston Poulett, 7th Earl Poulett (11 September 1883 – 11 July 1918) was an English peer and British Army officer. Educated at Cheltenham College and Trinity Hall, Cambridge, he was the son of William Poulett, 6th Earl Poulett, by his third wife, Rosa, a daughter of Alfred Hugh de Melville. He was known by the courtesy title of Viscount Hinton until on the death of his father in 1899 he inherited the Earldom of Poulett and an estate at Hinton St George, Somerset, centering on Hinton House. However, the inheritance of the Earldom was disputed by William Turnour Thomas Poulett, a son of his father's first wife, whom the 6th Earl believed had been fathered by another man. On 27 July 1903, on a report from the Committee of Privileges, the House of Lords determined the dispute in favour of Poulett, as the undisputed son of the 6th Earl. In 1908, Poulett married Sylvia Lilian Storey, the daughter of Fred Storey, an actor, dancer, and scene-painter. The bride was herself an actress and Gaiety girl. They had one son George Amias FitzWarrine Poullet, Viscount Hinton (1909–1973), and one daughter, Lady Bridget Elizabeth Felicia Henrietta Augusta Poulett (1912–1975). Poulett was commissioned as a Second Lieutenant into the Royal Welch Fusiliers and transferred to the Royal Horse Artillery. He died on 11 July 1918 of Spanish influenza and was succeeded by his eight-year-old son and heir, George Poulett, Viscount Hinton. After his death, his widow became engaged to Major Percy Howard Hansen, but the marriage never took place, which was thought to be because of the financial consequences for the Countess. However, she had a daughter with Hansen, Phoebe Amie Sybil Poulett (born 1922), who died unmarried in 1948.", 'title': 'William Poulett, 7th Earl Poulett'}
