 {'idx': 9, 'is_supporting': False, 'paragraph_text': "John Poulett, 2nd Earl Poulett (10 December 1708 – 5 November 1764), styled Viscount Hinton until 1743 was an English peer. Poulett was the son of John Poulett, 1st Earl Poulett and his wife, Bridget Bertie, daughter of the Honourable Peregrine Bertie, and was educated at Taunton Grammar School. In 1734, he was summoned to Parliament in his father's barony of Poulett by writ of acceleration and was a Lord of the Bedchamber until 1755. He inherited his father's earldom in 1743, was appointed Lord Lieutenant of Somerset in 1744, colonel of the 1st Somerset Regiment of Militia from 1759 and was sometime Recorder of Bridgwater.\nPoulett died unmarried and childless in 1764 and his titles passed to his brother, Vere.", 'title': 'John Poulett, 2nd Earl Poulett'}]

