[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Julian Charles Becket Amyes( 9 August 1917 – 26 April 1992), known as Julian Amyes, was a British film and television director and producer. Although primarily director and producer, Amyes also had acting roles in" High Treason"( 1951) and" Mandy"( 1952). Amyes made his directorial début with a BBC" Sunday Night Theatre" version of Shakespeare\'s" The Merry Wives of Windsor" in 1952 and also directed a number of other productions for BBC before joining Granada Television in the early 1960s, where he was head of drama from 1963 until 1977. Film credits( as director) include" A Hill in Korea"( 1956), and the Emeric Pressburger- written" Miracle in Soho"( 1957). After 1977, he returned to directing predominantly in television directing( amongst other works) adaptations of" The Old Curiosity Shop"( 1979)," Great Expectations"( 1981) and" Jane Eyre"( 1983) for the BBC. Amyes also worked on a number of independent productions, before acting as director on episodes of" The Bill"( 1990) and" Rumpole of the Bailey"( 1989–91) for Thames Television. He was married to the actress/ writer Anne Allan. They had two children; Sebastian a Professor at the University of Edinburgh and Isabelle, an Actress. Julian Amyes died of a stroke in 1992.', 'title': 'Julian Amyes'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'George E. Marshall (December 29, 1891 – February 17, 1975) was an American actor, screenwriter, producer, film and television director, active through the first six decades of film history. Relatively few of Marshall\'s films are well-known today, with "Destry Rides AgainThe Blue DahliaThe Sheepman", and "How the West Was Won" being the biggest exceptions. Marshall co-directed " How the West Was Won" with John Ford and Henry Hathaway, handling the railroad segment, which featured a celebrated buffalo stampede sequence. While Marshall worked on almost all kinds of films imaginable, he started his career in the early silent period doing mostly Westerns, a genre he never completely abandoned. In the 1930s, he established a reputation for comedy, directing Laurel and Hardy in three classic films, and also working on a variety of comedies for Fox (Many of his films at Fox were destroyed in a vault fire in 1937). Later in his career, he was particularly sought after for comedies. He did around half a dozen films each with Bob Hope and Jerry Lewis, and also worked with W. C. Fields, Jackie Gleason, and Will Rogers.', 'title': 'George Marshall (director)'}
