 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Ghost Breaker was a 1914 American silent drama film directed by Cecil B. DeMille and Oscar C. Apfel and based on the Broadway play of the same name by Paul Dickey and Charles W. Goddard. The film was distributed by Paramount Pictures under the Famous Players- Lasky banner. " The Ghost Breaker" was possibly the first film in a long line of haunted- house horror films with the same story. A 1922 remake of the same name starred Wallace Reid and Lila Lee. The original film was also remade as" The Ghost Breakers"( 1940) with Bob Hope and Paulette Goddard, and as" Scared Stiff"( 1953) with Martin and Lewis. The film is now considered lost.', 'title': 'The Ghost Breaker (1914 film)'}]

