[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Sierra de Vicort, also known as Sierra de Vicor, is a long mountain range in the Comunidad de Calatayud and Campo de Daroca comarcas of Aragon, Spain. The ridge is aligned in a NW- SE direction. It stretches southeast of the Sierra de la Virgen in the same direction roughly between Paracuellos de la Ribera and Codos. It is separated from Sierra de la Virgen by the Jalón River valley. Sierra de Algairén runs north of Sierra de Vicort with a long tectonic basin between them, the Grio River Valley, a tributary of the Jalón having its source in Sierra de Vicort. Sierra de Vicort\'s highest point is Pico del Rayo( 1,420 m). The range forks into two subranges towards its southeastern end, Sierra del Espigar, highest point 1,277 m and Sierra de la Modorra, highest point 1,279 m. The northeastern side of the range is abrupt, while its southwestern flanks, descending towards the Sediles and Mara plateaux are much smoother. Highway Carretera Nacional N- II crosses the northern end of the range, near El Frasno. There are ancient Celtiberian archaeological remains in and around the range. Some authors claim that the name" Vicort" itself is of Celtiberian origin.', 'title': 'Sierra de Vicort'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Sierra de Guara is a mountain massif in the province of Huesca, the most northerly province in the autonomous community of Aragon, Spain. It s highest point is Tozal de Guara( 2,077 m). It lies around 25 km northeast of the city of Huesca itself. Much of the massif is now included within the Sierra y Cañones de Guara Natural Park which extends 43 km from west to east and 25 km north to south. The Park includes, in addition to the Sierra de Guara itself, much of the Sierra de Gabardiella in the west and the Sierra de Arangol, Sierra de Balced, Sierra de Sebil and Sierra de Rufás in the east.', 'title': 'Sierra de Guara'}
