[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Rotrou III( bef. 1080 – 8 May 1144), called the Great(" le Grand"), was the Count of Perche and Mortagne from 1099. He was the son of Geoffrey II, Count of Perche, and Beatrix de Ramerupt, daughter of Hilduin IV, Count of Montdidier. He was a notable Crusader and a participant in the" Reconquista" in eastern Spain, even ruling the city of Tudela in Navarre from 1123 to 1131. He is commonly credited with introducing Arabian horses to the Perche, giving rise to the Percheron breed. By his creation of a monastery at La Trappe in memory of his wife, Matilda, daughter of Henry I of England, in 1122 he also laid the foundations of the later Trappists.', 'title': 'Rotrou III, Count of Perche'}
