 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Thomas (1195-20 May 1217), Count of Perche, son of Geoffrey III, Count of Perche, and Richenza-Matilda of Saxony, daughter of Henry the Lion, Duke of Saxony and Bavaria, and Matilda. Only seven when his father died, Thomas became Count of Perche under the regency of his mother and her new husband Enguerrand III, Lord of Coucy. In 1216, the English barons rebelled in the First Barons' War against John Lackland, and offered the English crown to Louis VIII the Lion, King of France. The death of King John ended this arrangement and the crown went to Henry III, John's son. In the end, Louis VIII renounced the English crown, but in the interim fought the forces of William Marshal, 1st Earl of Pembroke. In the decisive Battle of Lincoln (1217), Thomas, the commander of the French forces, was killed. Thomas married Hélisende Rethel, daughter of Hugh II, Count of Rethel, and Felicitas, daughter of Simon of Broyes. This union produced no children. His widow remarried Garnier de Traînel, Seigneur de Marigny. Following Thomas' death in 1217, King Philip II of France would gain control of the castles of Moulins-la-Marche, Bonsmoulin, and Belleme, which had been contested since 1182. Thomas’ uncle William, who was also Bishop of Chalons, succeeded him as the Count of Perche.", 'title': 'Thomas, Count of Perche'}
