 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'William II( died 1226), Count of Perche and Bishop of Châlons, son of Rotrou IV, Count of Perche, and Matilda of Blois- Champagne, daughter of Theobald II, Count of Champagne, and Matilda of Carinthia, daughter of Engelbert, Duke of Carinthia. William began his career as treasurer and provost of the Church of St. Martin of Tours, and was elected Bishop of Chalons in 1215, consecrated in 1216. The following year he succeeded his nephew Thomas, as Count of Perche, who was killed in the Battle of Lincoln. As count- bishop, William was a valuable advisor to the Kings of France and was listed among those by Pope Honorious III to participate in the Albigensian Crusade. His death in February 1226 would leave the question of the succession to the County of Perche unresolved for years.', 'title': 'William II, Count of Perche'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Geoffrey II( died October 1100), Count of Mortagne and Count of Perche, son of Rotrou I, Viscount of Châteaudun, and Adelise de Bellême, daughter of Guérin de Domfront. Geoffrey was Count of Mortagne and Seigneur of Nogent from 1060 to 1090, and Count of Perche from 1090 until his death. Godffrey succeeded his father in 1080, receiving the Percheron fields of his father( Mortagne- au- Perche and Nogent- le- Rotrou), while his younger brother Hugues received Châteaudun. A third brother, Rotrou, acquired by marriage the lordship of Montfort- le- Rotrou. He participated in the conquest of England and fought at the Battle of Hastings. For his service, William the Conqueror gave him a reward of significant property in England. Geoffrey and his two brothers attacked Robert of Bellême, involving a land dispute. Later he tried to attack Belleme again, with the help of Elias I, Count of Maine, but failed. He devoted the rest of his life to religious pursuits, and founded the first leper colony in Perche. Geoffrey married Beatrix de Ramerupt, daughter of Hilduin IV, Count of Montdidier, and Alice de Roucy. Geoffrey and Beatrix had: Geoffrey was succeeded by his son Rotrou as Count of Perche upon his death.', 'title': 'Geoffrey II, Count of Perche'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': "Rotrou IV( 1135- 1191), Count of Perche, son of Rotrou III, Count of Perche, and Hawise, daughter of Walter of Salisbury, and Sibilla de Chaworth. Rotrou was from the House of Châteaudun and descended from the Viscounts of Châteaudun. His mother was Hawise of Salisbury, a sister of Patrick of Salisbury, 1st Earl of Salisbury. Patrick ’s sister Sibyll married John FitzGilbert, the Marshal of the Horses, whose son Henry was Bishop of Exeter and a knight in the service of Rotrou. Upon the death of his father in 1144, Rotrou continued the fight against his archenemy, William III Talvas, Count of Ponthieu and Lord of Alençon. Not withstanding a long- running blood feud, his uncle Patrick had married William Talvas' daughter Adela as her second husband. His mother Hawise and her second husband, Robert I of Dreux, served as regents at Perche until he reached the age of maturity. From 1152, he fought with Louis VII the Younger against Henry II of England in an ineffective war that saw their troops routed, lands ravaged and property stolen. He was forced to yield the communes of Moulins and Bonsmoulins to the crown England. Nevertheless, a matrimonial alliance with the House of Blois consolidated the declining power of the Counts of Perche. In 1189, Rotrou joined Philip II of France and Richard I the Lionheart in the Third Crusade. He died sometime after the Siege of Acre in 1191. In 1160, Rotrou married Matilda of Blois- Champagne, daughter of Theobald II, Count of Champagne, and Matilda of Carinthia. Rotrou and Matilda had: Rotrou was succeeded as Count of Perche by his son Geoffrey upon his death.", 'title': 'Rotrou IV, Count of Perche'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': "Geoffrey III (died 1202), Count of Perche (1191-1202), son of Rotrou IV, Count of Perche, and Matilda of Blois-Champagne, daughter of Theobald II, Count of Champagne, and Matilda of Carinthia. He accompanied his father to the Third Crusade and participated in the Siege of Acre, where his father was killed. Back from the Holy Land, he sold more land to the abbeys in order to replenish his finances depleted by his participation in the crusade. He then fought Richard the Lionheart under the banner of the Philip II of France and in 1194, he managed to recover the commune of Bonsmoulins that his father had yielded to Henry II. When Richard sent an army to regain control of Normandy, Geoffroy, as a French army commander, helped defeat him. John Lackland, the brother and successor of Richard, was forced to renounce England's claim to Normandy in 1204. In 1202, Geoffrey and his brother Stephen decided to take part in the Fourth Crusade, but he died at Soissons before he could deploy. Geoffrey's first wife was named Matilda of which nothing is known. His second wife was Matilda of Saxony, daughter of Henry the Lion, Duke of Saxony and Bavaria, and Matilda, eldest daughter of Henry II, King of England, and Eleanor of Aquitaine. They married in 1189 in Rouen, and King Richard the Lionheart, uncle of the bride, granted them land in the counties of Suffolk, Essex and Kent previously owned by Henry of Essex. Geoffrey and his second wife Matilda had two children:\nGeoffrey was succeeded as Count of Perche by his son Thomas upon his death.", 'title': 'Geoffrey III, Count of Perche'}]

