 {'idx': 7, 'is_supporting': True, 'paragraph_text': "Joan II (28 January 1312 – 6 October 1349) was Queen of Navarre from 1328 until her death. She was the only surviving child of Louis X of France, King of France and Navarre, and Margaret of Burgundy. Joan's paternity was dubious because her mother was involved in a scandal, but Louis X declared her his legitimate daughter before he died in 1316. However, the French lords were opposed to the idea of a female monarch and elected Louis X's brother, Philip V, king. The Navarrese noblemen also paid homage to Philip. Joan's maternal grandmother, Agnes of France, Duchess of Burgundy, and uncle, Odo IV of Burgundy, made attempts to secure the counties of Champagne and Brie (which had been the patrimony of Louis X's mother, Joan I of Navarre) to Joan, but the French royal troops defeated her supporters. After Philip V married his daughter to Odo and granted him two counties as her dowry, Odo renounced Joan's claim to Champagne and Brie in exchange for a compensation in March 1318. Joan married Philip of Évreux, who was also a member of the French royal family. Philip V was succeeded by his brother, Charles IV, in both France and Navarre in 1322, but most Navarrese lords refused to swear loyalty to him. After Charles IV died in 1328, the Navarrese expelled the French governor and declared Joan the rightful monarch of Navarre. In France, Philip of Valois was crowned king. He concluded an agreement with Joan and her husband, who renounced Joan's claims to Champagne and Brie in exchange for three counties, while Philip acknowledged their right to Navarre. Joan and her husband were together crowned in Pamplona Cathedral on 5 March 1329. The royal couple closely cooperated during their joint reign, but Philip of Évreux was more active. However, they mostly lived in their French domains. Navarre was then administered by governors during their absence.", 'title': 'Joan II of Navarre'}
