 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Etan Boritzer( born 1950) is an American writer of children ’s literature who is best known for his book" What is God?" first published in 1989. His best selling" What is?" illustrated children\'s book series on character education and difficult subjects for children is a popular teaching guide for parents, teachers and child- life professionals. Boritzer gained national critical acclaim after" What is God?" was published in 1989 although the book has caused controversy from religious fundamentalists for its universalist views. The other current books in the" What is?" series include What is Love?, What is Death?, What is Beautiful?, What is Funny?, What is Right?, What is Peace?, What is Money?, What is Dreaming?, What is a Friend?, What is True?, What is a Family?, What is a Feeling?" The series is now also translated into 15 languages. Boritzer was first published in 1963 at the age of 13 when he wrote an essay in his English class at Wade Junior High School in the Bronx, New York on the assassination of John F. Kennedy. His essay was included in a special anthology by New York City public school children compiled and published by the New York City Department of Education. Boritzer now lives in Venice, California and maintains his publishing office there also. He has helped numerous other authors to get published through" How to Get Your Book Published!" programs. Boritzer is also a yoga teacher who teaches regular classes locally and guest- teaches nationally. He is also recognized nationally as an erudite speaker on" The Teachings of the Buddha."', 'title': 'Etan Boritzer'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Liu Xiang( died 179 BC), formally King Ai of Qi was a key player during the Lü Clan Disturbance( 180 BC). He was the grandson of Emperor Gaozu of Han and the eldest son of Liu Fei, Prince of Qi by Consort Si. With Liu Fei\'s death in 189 BC, Emperor Hui allowed Liu Xiang to inherit the title of" Prince of Qi". During the Lü Clan Disturbance, Liu Xiang led the Qi forces and also seized the forces of the nearby Principality of Langye, and was ready to march to the capital Chang\'an to claim the imperial throne for himself, assisted by his brothers Liu Zhang and Liu Xingju. After the officials in the capital overthrew the Lü clan and deposed Emperor Houshao of Han, however, they instead invited his uncle Prince Liu Heng of Dai( later Emperor Wen) to be emperor. Liu Xiang acquiesced and did not fight Emperor Wen for the throne, and he withdrew his forces back to his territory, though in fact he should be the heir presumptive after the extinction of the male line of Emperor Hui of Han. Before he had died, Liu Xiang had hundreds of Tiny Terracotta Warriors made to protect him in the afterlife just like Qin Shi Huangdi.', 'title': 'Liu Xiang, Prince of Qi'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Ziyu( Chinese: 子舆; pinyin: Hán Zǐyú), ancestral name Jì( 姬), clan name Hán( 韩), personal name Yú( 舆), and posthumously known as Ziyu of Han, was the fourth head of the House of Han. He was the son of Dingbo of Han. Ziyu was succeeded by his son Xianzi of Han.', 'title': 'Ziyu (Han Clan)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Lady Chen( 2nd century) was the wife of Eastern Han Xiao of Bohai( The grandson of Emperor Zhang of Han), and the biological mother of Liu Zuan who became Emperor Zhi of Han. She entered into the royal harem by her talent as an entertainer. In the year 145 Emperor Chong of Han died, and as there was no heir to emperors An and Shun of Han, the eight years old Liu Zuan ascended to the crown. The following year, Liu Zuan was poisoned by the general Liang Ji. General Liang was also the reason why Lady Chen was not given the status of either an empress, a royal wife or an empress Dowager. However, in the year 175 Emperor Ling of Han honoured the mother of Emperor Chong by bestowing on her the title" noble lady of Xian hill", while Lady Chen was entitled" concubine of king Wang of Bohai"( 勃海孝王妃).', 'title': 'Lady Chen'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Qiubo of Han( Chinese: 韩赇伯; pinyin: Hán Qiú Bó), ancestral name Jī( 姬), clan name Hán( 韩), personal name unknown, and posthumously known as Qiubo of Han, was the second head of the House of Han. He was the son of Wuzi of Han. Qiubo was succeeded by his son Dingbo of Han.', 'title': 'Qiubo of Han'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': "Emperor Houshao of Han (? – 14 November 180 BC), personal name Liu Hong, was the fourth emperor of the Han dynasty in China. He was a son of Emperor Hui, likely by a concubine—although there is some controversy on the subject—and adopted by Emperor Hui's wife, Empress Zhang Yan. At the instigation of his grandmother, Empress Dowager Lü, Empress Zhang had Emperor Houshao's mother put to death. Very little about Emperor Houshao's life and personality is known. There are only a few major important events in his life that are documented (which does not even include the year of his birth). In 188 BC, his father Emperor Hui died, and his brother Liu Gong succeeded to the throne as Emperor Qianshao. In 187 BC, he was made the Marquess of Xiangcheng. In 186 BC, after his brother Liu Buyi (劉不疑), the Prince of Hengshan, died, he was made the Prince of Hengshan, and his name was changed to Liu Yi, likely because it was considered inappropriate to have one's name (or one's male ancestors' names) share characters with one's titles. Some time during or before 184 BC, Emperor Qianshao discovered that he was not, in fact, now-Empress Dowager Zhang's son and that his mother, like Prince Hong's mother, had been put to death. Emperor Qianshao made the mistake of publicly making the remark that when he grew up, Empress Dowager Zhang would pay for this. Grand Empress Dowager Lü, once she heard of this, had Emperor Qianshao secretly imprisoned within the palace and publicly announced that he was severely ill and unable to receive anyone. After some time, Grand Empress Dowager Lü told the officials that he continued to be ill and incapable of governing, and that he had also suffered a psychosis. She proposed that he be deposed and replaced. The officials complied with her wishes, and he was deposed and put to death. Prince Hong then succeeded his brother to the throne as Emperor Houshao and in effect as Grand Empress Dowager Lü's puppet. Because Grand Empress Dowager Lü was actually the ruling figure, one thing that is normally done when a new emperor succeeds to the throne—the resetting of the calendar year to one—was not done; rather, the calendar continued from the start of Emperor Qianshao's reign. In the autumn of 180 BC, Grand Empress Dowager Lü died of an illness. Emperor Houshao, however, still had few actual powers, because power was still largely controlled by the Lü clan. Indeed, the grand empress dowager's will required him to marry the daughter of her nephew Lü Lu (呂禄) and make her empress. The officials of the imperial government, led by Chen Ping and Zhou Bo, however, formed a conspiracy against the Lü clan, and they were successful in surprising the Lü clan and slaughtering them. Afterwards, the conspirators met and made the assertion that none of the sons of Emperor Hui was actually his. Admitting that they were concerned that these imperial children, when they grew up, would take vengeance on the officials, the conspirators resolved to find a replacement emperor. After a period of disagreement, they settled on Emperor Houshao's uncle, Prince Liu Heng of Dai. Prince Heng soon arrived in the capital Xi'an and was declared emperor, and Emperor Houshao was deposed. Initially, one of the officials involved in the conspiracy, Emperor Houshao's cousin, Liu Xingju, the Marquess of Dongmou, merely expelled Emperor Houshao from the palace and had him stay at the Ministry of Palace Supplies. Some of the imperial guard still wished to resist the coup d'etat but were eventually persuaded by the officials to desist. Some time later that year, Emperor Houshao was executed. Historians are of the view that his wife, Empress Lü, was also executed, but there is no explicit evidence to support this view. Emperor Houshao, considered to be a mere puppet of Grand Empress Dowager Lü, is often omitted from the official list of emperors of the Han Dynasty.", 'title': 'Emperor Houshao of Han'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': "Emperor Hui of Han (210 BC – 26 September 188 BC) was the second emperor of the Han Dynasty in China. He was the second son of the first Han emperor, Han Gaozu and Empress Dowager Lü. He is generally remembered as a weak character dominated by his mother, Empress Dowager Lü, personally kind and generous, but unable to escape the impact of her viciousness. He tried to protect Ruyi, Prince Yin of Zhao, his younger half-brother, from being murdered by Empress Dowager Lü, but failed. After that, he indulged himself in drinking and sex, and died at a relatively young age. Empress Dowager Lü installed two of his sons, Liu Gong and Liu Hong (known collectively as Emperors Shao of Han), the sons of the Emperor's concubine(s) after he died without a designated heir. Emperor Hui's wife was Empress Zhang Yan, a niece of his by his sister Princess Yuan of Lu; their marriage was the result of insistence by Empress Dowager Lü and was a childless one.", 'title': 'Emperor Hui of Han'}
