 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Sophie of Württemberg (20 November 1563 - 21 July 1590), was a German noblewoman member of the House of Württemberg and by marriage Duchess of Saxe-Weimar. Born in Stuttgart, she was the youngest of twelve children born from the marriage of Christoph, Duke of Württemberg and Anna Maria of Brandenburg-Ansbach. From her eleven older siblings, nine survive adulthood: Eberhard, Hereditary Prince of Württemberg, Hedwig (by marriage Landgravine of Hesse-Marburg), Elisabeth (by her two marriages Countess of Henneberg-Schleusingen and Countess Palatine of Veldenz-Lauterecken), Sabine (by marriage Landgravine of Hesse-Kassel), Emilie (by marriage Countess Palatine of Simmern-Sponheim), Eleonore (by her two marriages Princess of Anhalt and Landgravine of Hesse-Darmstadt), Louis III, Duke of Württemberg, Dorothea Maria (by marriage Countess Palatine of Sulzbach) and Anna (by her two marriages Duchess of Oława and Legnica).', 'title': 'Sophie of Württemberg, Duchess of Saxe-Weimar'}
