 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Philip le Despenser, 1st Baron le Despenser( 18 October 1342 in Gedney, Lincolnshire, England – 4 August 1401) was the son and heir of Sir Philip le Despenser of Goxhill, grandson of Philip Despenser, the elder, and great- grandson of Hugh le Despenser, 1st Earl of Winchester. His mother was Joan Cobham, daughter of John Cobham, 2nd Baron Cobham of Kent. He was created Baron le Despenser by writ of summons on 17 December 1387. He married a woman named Elizabeth. He was summoned to Parliament in 1400, and died on 4 August 1401. Any hereditary title later held to have been created by summons to Parliament would have passed to his son, Philip le Despenser, though none of his descendants were summoned as Barons le Despencer.', 'title': 'Philip le Despencer, 1st Baron le Despencer'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Hugh le Despenser, 1st Lord Despenser (c. 1286 – 24 November 1326), also referred to as "the younger Despenser", was the son and heir of Hugh le Despenser, Earl of Winchester (the elder Despenser) by his wife Isabella de Beauchamp, daughter of William de Beauchamp, 9th Earl of Warwick. He rose to national prominence as royal chamberlain and a favourite of Edward II of England. Despenser made many enemies across the nobility of England which, after the overthrow of Edward, eventually led to him being charged with high treason and ultimately hanged, drawn and quartered.', 'title': 'Hugh Despenser the younger'}
