 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Philip le Despenser, 2nd Baron le Despenser( c.1365 in Nettlestead, Suffolk, England – 20 June 1424) was the son and heir of Philip le Despenser, 1st Baron le Despenser. Philip was aged 36 and more at the death of his father Philip Despencer in 1401, having been knighted in 1385. He married Elizabeth de Tibetot, co-heiress and daughter of Robert Tiptoft, 3rd Baron Tibetot and his wife Margaret Deincourt. By this marriage he inherited the manors of Nettlestead and Barrow among others. He was never summoned to Parliament, and died on 20 June 1424 without male heir. Any hereditary right created when his father was summoned passed with his property to his only daughter, Margery le Despencer, wife of John de Ros, 7th Baron de Ros and secondly Roger Wentworth of Nettlestead, Esq. Margery and Roger Wentworth of the later Lords Wentworth and of Jane Seymour, third queen consort of King Henry VIII.', 'title': 'Philip le Despencer, 2nd Baron le Despencer'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Edward le Despenser (died 1342) was a son of Hugh le Despenser the Younger by his wife Eleanor de Clare. His father, a favourite of Edward II of England, was executed in 1326. Through his mother, he was a great-grandson of Edward I of England.', 'title': 'Edward Despenser (died 1342)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Thomas le Despenser, 2nd Baron Despenser, 1st Earl of Gloucester KG( 22 September 1373 – 13 January 1400) was the son of Edward le Despenser, 1st Baron le Despencer, whom he succeeded in 1375.', 'title': 'Thomas Despenser, 1st Earl of Gloucester'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Edward le Despenser, 1st Baron Despenser( 24 March 1336, Essendine – 11 November 1375) was the son of another Edward le Despenser and Anne Ferrers, sister of Henry, Lord Ferrers of Groby. He succeeded as Lord of Glamorgan in 1349. Le Despencer went with Edward the Black Prince to France, and was present at the Battle of Poitiers. In recognition of his conduct in the French wars, he was summoned to Parliament as a baron in 1357. At the same time, he also became a Knight of the Garter. He was a friend and patron of Jean Froissart and the eldest brother of Henry le Despenser, Bishop of Norwich. There is a statue of him on the top of the Holy Trinity Chantry Chapel in Tewkesbury Abbey, renowned as the" KNEELING KNIGHT".', 'title': 'Edward Despenser, 1st Baron Despenser'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Hugh le Despenser, 2nd Baron le Despenser( 1308 – 1349), Lord of Glamorgan, was the eldest son and heir of Hugh Despenser the Younger and grandson of Hugh le Despenser, 1st Earl of Winchester. His father and grandfather were both executed in 1326. His mother was Eleanor de Clare," suo jure" Lord of Glamorgan, daughter of Gilbert de Clare, 6th Earl of Hertford and Joan of Acre. Through his mother, Hugh was a great grandson of King Edward I. He married Elizabeth Montague( d.1359), and both are buried in Tewkesbury Abbey, Gloucestershire, which abbey was founded by Robert Fitzhamon( d.1107), the first Norman feudal baron of Gloucester and Lord of Glamorgan.', 'title': 'Hugh le Despenser, Baron le Despenser (1338)'}
