[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Bariqa( also spelled Buraykah or Breikeh) is a village in southwestern Syria, administratively part of the Quneitra Governorate, south of Quneitra, in the Syrian- controlled portion of the Golan Heights. Nearby localities include Beer Ajam to the north, Naba al- Sakhr to the northeast, al- Harra and Namer to the east, al- Suwaysah and Jasim to the southeast and al- Rafid to the south. According to the Syria Central Bureau of Statistics( CBS), Bariqa had a population of 371 in the 2004 census. Its inhabitants are predominantly Circassians from the Abadzekh tribe, who profess Sunni Islam. In the late 19th- century Bariqa was described as" one of the largest and best of the Circassian villages." It consisted of about 100 houses with 85 families, translating into an approximate population of 425, including 68 adult male fighters. Its streets were wide and clean, it abounded in heaps of hay and contained a well- built mosque. To the north of Bariqa was an icy- water spring and to the east was a pool which irrigated the village\'s crops. Bariqa served as the residence of the" sheikhchief") of all the Circassian villages in the Golan Heights region. Opposition rebels and Syrian Army soldiers clashed in Bariqa and nearby Beer Ajam in November 2012, during the ongoing Syrian civil war, which began in 2011. Fatalities on both sides totaled about 30, according to a monitoring group. The village was reported to be under rebel control by 13 November. On 26 July 2018, the Syrian army took back the town after the rebels surrendered and handed over their heavy and medium weapons to army.', 'title': 'Bariqa'}
