 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Karim al-Husayn Shāh, also known as "the Prince Shah Karim Al Hussaini" outside Ismaili Muslim communities, and by the religious-political title Aga Khan IV to Ismaili communities, ("Aga Khan" is also transliterated as "Aqa Khan" and "Agha Khan"; born 13 December 1936) is the 49th and current Imam of Nizari Ismailism, a denomination of Isma\'ilism within Shia Islam with an estimated 10–15 million adherents (10–12% of the world\'s Shia Muslim population). The Aga Khan is a business magnate with British and Portuguese citizenship, as well as a racehorse owner and breeder. He has held this position of Imam, under the title of Aga Khan IV, since 11 July 1957, when, at the age of 20, he succeeded his grandfather, Sir Sultan Muhammad Shah Aga Khan III. It is believed that the Aga Khan is a direct lineal descendant of the Islamic prophet Muhammad through Muhammad\'s cousin and son-in-law, Ali, considered the first Imam in Shia Islam, and Ali\'s wife Fatima az-Zahra, Muhammad\'s daughter from his first marriage. "Forbes" describes the Aga Khan as one of the world\'s ten richest royals with an estimated net worth of US$3 billion. Additionally he is unique among the richest royals as he does not rule over a geographic territory. Among the goals the Aga Khan has said he works toward are the elimination of global poverty; the promotion and implementation of religious pluralism; the advancement of the status of women; and the honoring of Islamic art and architecture. He is the founder and chairman of the Aga Khan Development Network, one of the largest private development networks in the world. The organisation works toward improvement of the environment, health, education, architecture, culture, microfinance, rural development, disaster reduction, the promotion of private-sector enterprise and the revitalisation of historic cities. Since his ascension to the Imamate of Nizari Ismailis in 1957, the Aga Khan has been involved