 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Zoë Porphyrogenita ("life" ; 978 – 11 June 1050) reigned as Byzantine Empress from 11 November 1028 until her death in 1050. She ruled alongside her three husbands, her adopted son Michael V, and her sister Theodora. Zoë held actual power with Theodora for only two months between April and June 1042. Zoë was born to Constantine VIII, who was nominal co-emperor to his brother Basil II. Basil died when Zoë was 47, leaving the Byzantine throne entirely to her father. As he had no sons, Constantine hoped to continue the dynasty by marrying off one of his daughters. Zoë, aged 50, was married to Romanos Argyros. Zoë and her husband took the throne three days later on her father\'s death. The marriage was troubled and after five years Romanos III was found dead in his bath. His death has been variously attributed to Zoë, her young lover Michael, or both. They were married on the same day as the murder, and he was crowned emperor on the following day. Seven years later, Zoë was persuaded to adopt her dying husband\'s nephew, also named Michael. Once Michael V became emperor, he promptly exiled Zoë. This action sparked a popular revolt which dethroned him and installed Zoë and Theodora as joint empresses. After a two-month joint reign Zoë married a former lover who was installed as Constantine IX Monomachos, transferring power to him. Eight years later, Zoë died aged 72.', 'title': 'Zoë Porphyrogenita'}
