 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Constantine VIII ("Kōnstantinos VIII") (960 – 11 November 1028) was the Byzantine Emperor from 15 December 1025 until his death in 1028. He was the younger son of Emperor Romanos II and Empress Theophano. He was nominal co-emperor for 63 years from 962, successively with his father; stepfather, Nikephoros II; uncle (by marriage), John I; and brother, Basil II. Basil II died childless in 1025 and thus left the rule of the Byzantine Empire in Constantine\'s hands. Constantine had no interest in politics, statecraft or the military. His brief reign is said to have been "an unmitigated disaster", sparking "a collapse of the military power of the Empire". Constantine had no sons, so shortly before his death he married his daughter Zoë to his chosen successor Romanos Argyros.', 'title': 'Constantine VIII'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Anne of Green Gables: The Sequel is a 1987 Canadian television miniseries film. It is a sequel to" Anne of Green Gables", and the second of a tetralogy of films. The miniseries dramatizes material from Lucy Maud Montgomery\'s" Anne of AvonleaAnne of the Island" and" Anne of Windy Poplars", and also introduces several original characters and scenarios. The miniseries aired in four hour- long installments, in May and June 1987, on the Disney Channel as" Anne of Avonlea: The Continuing Story of Anne of Green Gables", and in two 150- minute installments, in December 1987 on the Canadian Broadcasting Corporation, and in March 1988 on PBS, as" Anne of Green Gables: The Sequel". The film was also shown theatrically in Israel, Japan, and Europe as" Anne of Green Gables: The Sequel" and has been released on DVD under that title. Finally, in 2017, the miniseries was officially retitled" Anne of Avonlea" for its North American Blu-ray Disc release by Sullivan Films, as part of the" Anne of Green Gables" Collector\'s Set.', 'title': 'Anne of Green Gables: The Sequel'}
