 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Jacques Tourneur( November 12, 1904 – December 19, 1977) was a French film director known for the classic film noir" Out of the Past" and a series of low- budget horror films he made for RKO Studios, including" Cat PeopleI Walked with a Zombie", and" The Leopard Man". He is also known for directing" Night of the Demon", which was released by Columbia Pictures. While in Hollywood, he was usually addressed by his anglicized name" Jack Turner", a literal and phonetic translation of his name in English.', 'title': 'Jacques Tourneur'}
