 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Council of the Indies; officially, the Royal and Supreme Council of the Indies, was the most important administrative organ of the Spanish Empire for the Americas and the Philippines. The crown held absolute power over the Indies and the Council of the Indies was the administrative and advisory body for those overseas realms. It was established in 1524 by Charles V to administer" the Indies," Spain\'s name for its territories. Such an administrative entity, on the conciliar model of the Council of Castile, was created following the Spanish conquest of the Aztec empire in 1521, which demonstrated the importance of the Americas. Originally an itinerary council that followed Charles V, it was subsequently established as an autonomous body with legislative, executive and judicial functions by Philip II of Spain and placed in Madrid in 1561. The Council of the Indies was abolished in 1812 by the Cádiz Cortes, briefly restored in 1814 by Ferdinand VII of Spain, and definitively abolished in 1834 by the regency, acting on behalf of the four- year- old Isabella II of Spain.', 'title': 'Council of the Indies'}
