[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Some Like It Hot, reissued for television as Rhythm Romance, is a 1939 comedy film starring Bob Hope, Shirley Ross, and Gene Krupa. Directed by George Archainbaud, its screenplay was written by Wilkie C. Mahoney and Lewis R. Foster, based on the play" The Great Magoo" by Ben Hecht and Gene Fowler, which performed briefly on Broadway in 1932. The film was released the year before" Road to Singapore" converted theatre and radio star Hope into a huge movie box office draw. Legendary cinematographer Karl Struss filmed the movie. The title of the film is taken from a nursery rhyme, and bears no relation to Billy Wilder\'s acclaimed 1959 comedy film" Some Like It Hot" starring Marilyn Monroe, Jack Lemmon, and Tony Curtis.', 'title': 'Some Like It Hot (1939 film)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Some Like It Cold( also known as" We Like It Cold") is a 1960 Italian war- comedy film directed by Steno.', 'title': 'Some Like It Cold'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Some Like It Hot is a 1959 American black and white romantic comedy film set in 1929, directed and produced by Billy Wilder, starring Marilyn Monroe, Tony Curtis, and Jack Lemmon. The supporting cast includes George Raft, Pat O\'Brien, Joe E. Brown, Joan Shawlee, and Nehemiah Persoff. The screenplay by Billy Wilder and I. A. L. Diamond is based on a screenplay by Robert Thoeren and Michael Logan from the French film "Fanfare of Love". The film is about two musicians who dress in drag in order to escape from mafia gangsters whom they witnessed commit a crime inspired by the Saint Valentine\'s Day Massacre. "Some Like It Hot" opened to critical and commercial success and is today considered to be one of the greatest films of all time. The film received six Academy Award nominations, including Best Actor, Best Director and Best Adapted Screenplay. It was voted as the top comedy film by the American Film Institute on their list on AFI\'s 100 Years... 100 Laughs poll in 2000, and was selected as the best comedy of all time in a poll of 253 film critics from 52 countries conducted by the BBC in 2017. In 2005, the British Film Institute included this film on its list of the 50 films you should see by the age of 14. The film was produced without approval from the Motion Picture Production Code because it plays with the idea of homosexuality and features cross dressing. The code had been gradually weakening in its scope during the early 1950s, due to greater social tolerance for previously taboo topics in film, but it was still officially enforced until the mid-1960s. The overwhelming success of "Some Like It Hot" is considered one of the final nails in the coffin for the Hays Code.', 'title': 'Some Like It Hot'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Come Back Peter is a 1969 British sex comedy film. It was released in the UK under the title Some Like It Sexy.', 'title': 'Come Back Peter'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Under the Dome is a 2015 self- financed, Chinese documentary film by Chai Jing, a former China Central Television journalist, concerning air pollution in China. It was viewed over 150 million times on Tencent within three days of its release, and had been viewed a further 150 million times( total 300 million views) by the time it was taken offline four days later. Chai Jing started making the documentary when her as yet unborn daughter developed a tumour in the womb, which had to be removed very soon after her birth. Chai blames air pollution for the tumour. The film, which combines footage of a lecture with interviews and factory visits, has been compared with Al Gore\'s" An Inconvenient Truth" in both its style and likely impact. The film openly criticises state- owned energy companies, steel producers and coal factories, as well as showing the inability of the Ministry of Environmental Protection to act against the big polluters. Despite demonstrating the failure of China\'s regulations on pollution, the Chinese government at first did not censor the film. Instead, the" People\'s Daily" reposted the film alongside an interview with Chai, while Chen Jining, the recently appointed minister for environmental protection, praised the film. However, within a week, the Communist Party ’s publicity department confidentially ordered the film to be removed. An employee of China Business News was suspended for leaking the order.', 'title': 'Under the Dome (film)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Hellcats( lit." I Like It Hot" or" Some Like It Hot") is a 2008 South Korean romantic comedy film about an extended family of three women from different generations — the fortysomething interior designer Young -mi( Lee Mi-sook), the 27- year old screenwriter Ah-mi( Kim Min-hee), and the high school student Kang -ae( Ahn So-hee) -- who are all engaged in dilemmas regarding love and sex.', 'title': 'Hellcats (film)'}
