 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Rafoo Chakkar is a 1975 Indian Hindi movie produced by Nadiadwala and directed by Narender Bedi. The movie was inspired by the American film" Some Like It Hot". The plot follows the general outline of" Some Like it Hot". Two out- of- work musicians( Rishi Kapoor and Paintal) witness a murder and are spotted by the villains. In order to save themselves, they decide to disguise themselves as girls and hop on to a train to Kashmir with other girls in a singing band, where they met Neetu Singh, Bindoo and Asrani. The plot twists when a man falls in love with Paintal, and Rishi Kapoor tries to impress Neetu Singh by pretending to be an oil tycoon. At the end of the movie, the musicians\' identities are revealed. However, the romantic pairs remain intact by the end credits, including the man and Paintal. The movie ends with the same line as" Some Like it HotNobody\'s perfect!" The film was among the first to play with ideas of same- sex love in Hindi films, and is considered important for its light- hearted treatment of themes such as sex and gender. The movie stars Rishi Kapoor and Neetu Singh, who were at the height of their popularity as an on- screen couple at the time of this movie\'s release. Other actors include Paintal, Bindu and Madan Puri, along with Rajindernath, Asrani and Bhagwan. The music was composed by Kalyanji Anandji.', 'title': 'Rafoo Chakkar'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Adrian Brunel ( 4 September 1892 – 18 February 1958) was an English film director and screenwriter. Brunel\'s directorial career started in the silent era, and reached its peak in the latter half of the 1920s. His surviving work from the 1920s, both full- length feature films and shorts, is highly regarded by silent film historians for its distinctive innovation, sophistication and wit. With the arrival of talkies, Brunel\'s career ground to a halt and he was absent from the screen for several years before returning in the mid-1930s with a flurry of quota quickie productions, a majority of which are now classed as lost. Brunel\'s last credit as director was in a 1940 wartime propaganda short film, although he worked for a few years more as a" fixer- up" for films directed or produced by friends in the industry. After decades of neglect, Brunel\'s work has latterly been rediscovered and has undergone a critical re-evaluation. His" lost" films are eagerly sought, and the British Film Institute includes two(" The Crooked Billet"( 1929) and" Badger\'s Green"( 1934)) on its" 75 Most Wanted" list of missing British feature films.', 'title': 'Adrian Brunel'}
