[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Anne Neville (11 June 1456 – 16 March 1485) was an English queen, the younger of the two daughters and co-heiresses of Richard Neville, 16th Earl of Warwick (the "Kingmaker"). She became Princess of Wales as the wife of Edward of Westminster (only son and heir apparent of King Henry VI) and then Queen of England as the wife of King Richard III. As a member of the powerful House of Neville, she played a critical part in the Wars of the Roses fought between the House of York and House of Lancaster for the English crown. Her father Warwick betrothed her as a girl to Edward, Prince of Wales, the son of Henry VI. The marriage was to seal an alliance to the House of Lancaster and halt the civil war between the two houses of Lancaster and York. After the death of Prince Edward, she married Richard, Duke of Gloucester, younger brother of King Edward IV and of George, Duke of Clarence, the husband of Anne\'s elder sister Isabel Neville. Anne became queen when Richard III ascended the throne in June 1483, following the declaration that Edward IV\'s children by Elizabeth Woodville were illegitimate. Anne Neville predeceased her husband by five months, dying in March 1485. Her only child was Edward of Middleham, who predeceased her.', 'title': 'Anne Neville'}
