 {'idx': 5, 'is_supporting': True, 'paragraph_text': "Jacques d'Armagnac (4 August 1477), duke of Nemours, was the son of Bernard d'Armagnac, count of Pardiac, and Eleanor of Bourbon-La Marche. While styled Count of Castres, he served under Charles VII of France in Normandy in 1449 and 1450, and afterwards in Guienne. Louis XI awarded him with honours. In 1462, Jacques succeeded his father, and Louis XI married him to his god-daughter, Louise of Anjou, daughter of Charles of Le Maine. Louis XI also recognized his title to the duchy of Nemours, which he had disputed with the King of Navarre. Sent by Louis to pacify Roussillon, Nemours felt that he had been insufficiently rewarded for the rapid success of this expedition, and joined the League of the Public Weal in 1465. Subsequently, he reconciled with Louis, but soon resumed his intrigues. After twice pardoning him, the king's patience became exhausted, and he besieged the duke's chateau at Carlat and imprisoned him. Nemours was treated with the utmost rigour, being shut up in a cage. He was finally condemned to death and beheaded, 4 Aug 1477. He and Louise had six children:", 'title': "Jacques d'Armagnac"}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Jacques of Savoy, 2nd duke of Nemours( 12 October 153115 June 1585) was the son of Philippe, Duke of Nemours, and became Duke of Nemours on his father\'s death in 1533. He distinguished himself at the sieges of Lens and Metz( 1552 – 1553), at the Battle of Renty( 1554) and in the campaign of Piedmont( 1555). He was a supporter of the house of Guise, and had to retire for some time into Savoy in consequence of a plot. On his return to France he fought the Huguenots, and signalized himself by his successes in Dauphiné and Lyonnais. In 1567 he induced the court to return from Meaux to Paris, took part in the battle of Saint Denis, protested against the peace of Longjumeau, and repulsed the invasion of Wolfgang, Count Palatine of Zweibrücken. He devoted his last years to letters and art, and died at Annecy. He married, on 29 April 1566, Anna d\' Este, daughter of Duke Ercole II of Ferrara and Renée of France, and widow of Francis, Duke of Guise. He was succeeded as Duke of Nemours by his sons, Charles Emmanuel de Savoie, 3rd Duc de Nemours and Henri I, Duke of Nemour. Descendencia: i. Charles Enmanuel, 1567- 1595 ii. Marguerite, 1569- 1572 iii. Enrique I, 1572- 1632, en inglés( Henry I de Savoy) Con descendencia iv. Robert, 1577- 1660 que caso con Marie Caillaux( 1580- 1670) con descendencia: Rene( 1601- 1696) Con Descendencia Robart( 1606 -??) A fictionalized version of the second Duke of Nemours serves as the love interest in the early novel" La Princesse de Clèves", which takes place at the court of Henry II of France.', 'title': 'Jacques, Duke of Nemours'}
