 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Old School – New School Controversy was a schism of the Presbyterian Church in the United States of America which took place in 1837 and lasted for over 20 years. The Old School, led by Charles Hodge of Princeton Theological Seminary, was much more conservative theologically and was not supportive of revivalism. It called for traditional Calvinist orthodoxy as outlined in the Westminster standards. The New School derived from the reconstructions of Calvinism by New England Congregationalist theologians Jonathan Edwards, Samuel Hopkins and Joseph Bellamy and wholly embraced revivalism. Though there was much diversity among them, the Edwardsian Calvinists commonly rejected what they called" Old Calvinism" in light of their understandings of God, the human person and the Bible. Later, both the Old School and New School branches" further split" over the issue of slavery, into Southern and Northern churches. After three decades of separate operation, the two sides of the controversy merged, in 1865 in the South and in 1870 in the North, to form two Presbyterian denominations( PCUS and PC- USA, in the South and North respectively).', 'title': 'Old School–New School Controversy'}
