 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'John Michael Frankenheimer (February 19, 1930 – July 6, 2002) was an American film and television director known for social dramas and action/suspense films. Among his credits were "Birdman of Alcatraz" (1962), "The Manchurian Candidate" (1962), "Seven Days in May" (1964), "The Train" (1965), "Seconds" (1966), "Grand Prix" (1966), "French Connection II" (1975), "Black Sunday" (1977), and "Ronin" (1998). He won four Emmy Awards—three consecutive—in the 1990s for directing the television movies "Against the WallThe Burning SeasonAndersonville", and "George Wallace", the last of which also received a Golden Globe Award for Best Miniseries or Television Film. Frankenheimer\'s 30 feature films and over 50 plays for television were notable for their influence on contemporary thought. He became a pioneer of the "modern-day political thriller", having begun his career at the peak of the Cold War. He was technically highly accomplished from his days in live television; many of his films were noted for creating "psychological dilemmas" for his male protagonists along with having a strong "sense of environment," similar in style to films by director Sidney Lumet, for whom he had earlier worked as assistant director. He developed a "tremendous propensity for exploring political situations" which would ensnare his characters. Movie critic Leonard Maltin writes that "in his time [1960s]... Frankenheimer worked with the top writers, producers and actors in a series of films that dealt with issues that were just on top of the moment—things that were facing us all."', 'title': 'John Frankenheimer'}
