[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Bakaffa (Ge\'ez በካፋ) (throne name Aṣma Giyorgis , later Masih Sagad Ge\'ez መሲህ ሰገድ, "to whom the anointed bows") was "nəgusä nägäst" (May 18, 1721 – September 19, 1730) of Ethiopia, and a member of the Solomonic dynasty. He was a son of Emperor Iyasu I and brother to Emperors Tekle Haymanot I and Dawit III. James Bruce describes Bakaffa as faced with the increasing enfeeblement of the Ethiopian Empire as well as growing intrigue and conspiracies. To respond to these challenges, writes Bruce, Bakaffa was "silent, secret, and unfathomable in his designs, surrounded by soldiers who were his own slaves, and by new men of his own creation. " In writing his account of this Emperor\'s reign, Bruce claims that at the time of his writing no "Royal Chronicle" of his reign existed, because it "would have been a very dangerous book to have been kept in Bacuffa\'s time; and, accordingly, no person chose ever to run that risk; and the king\'s particular behaviour afterwards had still the further effect, that nobody would supply this deficiency after his death, a general belief prevailing in Abyssinia that he is alive to this day, and will appear again in all his terrors. " As a result, Bruce\'s account of Bakaffa\'s reign consists of a collection of impressionistic vignettes of selected events—his travels through Ethiopia in disguise, his feigned death, his first meetings with people who were to play an important role during his rule—which support this portrait. In contrast, the editor of the 1805 edition of Bruce\'s work, Alexander Murray, excised all but the first two paragraphs of his chapter on this ruler, replacing Bruce\'s material with a summary of a chronicle of the reign, stating that "the annals of this period are very complete, the public transactions of Bacuffa are well known, though his motives seldom escaped from his own impenetrable breast."', 'title': 'Bakaffa'}
