 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Ayat- Ayat Cinta is an Indonesian drama film from MD Pictures, Producer Manoj Punjabi and Dhamoo Punjabi. Starring as main casts are, Rianti Cartwright, Carissa Putri, Melanie Putria, and Zaskia Adya Mecca. It is a romantic religious drama based on the bestselling novel with the same title by Habiburrahman El Shirazy. While the story is set in Cairo, Egypt, the film was shot in India and Semarang, Indonesia. " Ayat- Ayat Cinta" was released on February 28, 2008 in Indonesia, May 8, 2008 in Singapore, and June 19, 2008 in Malaysia. Upon release, it was one of the most successful Indonesian film, and was the first Indonesian film to reach 3.5 million tickets sold, only to be surpassed by Laskar Pelangi a few months later. Both films are the only film to surpass more than 3 million audiences before 2010s. In 2016 during the screening of Rudy Habibie, a sequel was confirmed to be in development; to be released in December 2017.', 'title': 'Ayat-Ayat Cinta'}
