[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Fannā( Panāh) Khusraw, better known by his laqab of ʿ Aḍud al- Dawla(" Pillar of the[ Abbasid] Dynasty") ( September 24, 936 – March 26, 983) was an emir of the Buyid dynasty, ruling from 949 to 983, and at his height of power ruling an empire stretching from Makran as far to Yemen and the shores of the Mediterranean Sea. He is widely regarded as the greatest monarch of the dynasty, and by the end of his reign was the most powerful ruler in the Middle East. The son of Rukn al- Dawla, Fanna Khusraw was given the title of Adud al- Dawla by the Abbasid caliph in 948 when he was made emir of Fars after the death of his childless uncle Imad al- Dawla, after which Rukn al- Dawla became the senior emir of the Buyids. In 974 Adud al- Dawla was sent by his father to save his cousin Izz al- Dawla from a rebellion. After defeating the rebel forces, he claimed the emirate of Iraq for himself, and forced his cousin to abdicate. His father, however, became angered by this decision and restored Izz al- Dawla. After the death of Adud al- Dawla\'s father, his cousin rebelled against him, but was defeated. Adud al- Dawla became afterwards the sole ruler of the Buyid dynasty and assumed the ancient Iranian title of Shahanshah(" King of Kings"). When Adud al- Dawla became emir of Iraq, the capital city, Baghdad, was suffering from violence and instability owing to sectarian conflict. In order to bring peace and stability to the city, he ordered the banning of public demonstrations and polemics. At the same time, he patronized a number of Shia scholars such as al- Mufid, and sponsored the renovation of a number of important Shia shrines. In addition,\' Adud al- Dawla is credited with sponsoring and patronizing other scientific projects during his time. An observatory was built by his orders in Isfahan where Azophi worked. Al- Muqaddasi also reports that he ordered the construction of a great dam between Shiraz and Estakhr in 960. The dam irrigated some 300 villages in Fars province and became known as" Band -e Amir"( Dam of the emir). Among his other major constructions was the digging of the Haffar channel, that joined the Karun river to the Shatt al- Arab river( the confluence of the Tigris and the Euphrates). The port of Khorramshahr was built on the Haffar, at its joining point with the Shatt al- Arab.', 'title': "'Adud al-Dawla"}
