 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Abu Kalijar Marzuban( died October 1048) was the Buyid amir of Fars( 1024 – 1048), Kerman( 1028–1048) and Iraq( 1044 – 1048). He was the eldest son of Sultan al- Dawla.', 'title': 'Abu Kalijar'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Ali ibn Kama, the uncle of the Buyid ruler Rukn al- Dawla and the latter\'s other brothers Mu\'izz al- Dawla and Imad al- Dawla, was a Buyid military officer who became prominent among the Buyids of Jibal, and was greatly honored among his Daylamite kinsmen. At the death of Imad al- Dawla in 949, Ali was appointed as the viceroy of Ray by Rukn al- Dawla, who went to Shiraz to secure the succession of his son there, Adud al- Dawla. Meanwhile, the Samanids used this opportunity to invade the territories of Rukn al- Dawla, forcing Ali to flee from Jibal. In ca. 959, a battle ensured between Ali and the Ziyarid prince Bisutun, which resulted in a Buyid victory. In 966, Ali and Rukn al- Dawla defeated a large force of" ghazis" who had arrived from Khorasan. Rukn al- Dawla later died in 976 and was succeeded by his son Fakhr al- Dawla, who had Ali executed.', 'title': 'Ali ibn Kama'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Ziyar ibn Shahrakuya( also spelled Shahrakawayh), was a high- ranking Gilaki military officer who served the Buyids. Ziyar was the son of Shahrakawayh, the son of Harusindan, the maternal uncle of the Ziyarid ruler Mardavij. Ziyar had a cousin, who married the Buyid ruler Adud al- Dawla, and bore him one son named Abu Kalijar Marzuban. During that period, Ziyar, along with a Daylamite officer named Fuladh ibn Manadhar, dominated the Buyid court of Baghdad. After the death of Adud al- Dawla in 983, the Buyid Empire was thrown into civil war; the Empire was disputed between his two sons Abu Kalijar Marzuban( who took the name Samsam al- Dawla) and Sharaf al- Dawla. The Turkic soldiers of Iraq shortly betrayed Samsam al- Dawla, and went towards to the court of Sharaf al- Dawla. However, Ziyar managed to make most of them change their mind and stay loyal to Samsam al- Dawla. In 987, Sharaf al- Dawla marched towards Baghdad and deposed Samsam al- Dawla. He then imprisoned Fuladh and had Ziyar executed.', 'title': 'Ziyar ibn Shahrakuya'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Asfar ibn Kurduya( also spelled Kurdawayh, Kardawayh and Kurdawaih), was a Daylamite officer who served the Buyid dynasty. Asfar is first mentioned during the reign of the Buyid ruler Adud al- Dawla, as one of the most prominent officers of the Empire. After the death of Adud al- Dawla in 983, the Buyid Empire was thrown into civil war; the Empire was disputed between his two sons Samsam al- Dawla and Sharaf al- Dawla. Samsam al- Dawla ruled Iraq, while Sharaf al- Dawla ruled Fars and Kerman. In 986, Asfar rebelled against Samsam al- Dawla, and changed his allegiance to Sharaf al- Dawla. However, Asfar quickly changed his mind, and declared allegiance to the latter\'s other brother Abu Nasr Firuz Kharshadh, who was shortly given the" laqab" of" Baha\' al- Dawla." However, Samsam al- Dawla, with the aid of Fuladh ibn Manadhar, suppressed the rebellion, and imprisoned Baha al- Dawla. After this event, Asfar is no longer mentioned.', 'title': 'Asfar ibn Kurduya'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Sama' al- Dawla was the Buyid ruler of Hamadan( 1021- 1023 or 1024). He was the son of Shams al- Dawla. Upon his father's death, Sama' al- Dawla succeeded him to the governorship of that province. Only after a short reign, however, the Kakuyid ruler Muhammad ibn Rustam Dushmanziyar overran Hamadan and ended Sama' al- Dawla's rule.", 'title': "Sama' al-Dawla"}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Ṣafiyy al- Dawla Muḥammad ibn ʿ Ali ibn Jaʾfar ibn Falāh was the Fatimid governor of Aleppo between October 1022 and April 1023. He was specifically assigned to govern the city, while the citadel of Aleppo was assigned to a separate governor, the eunuch Yumn al- Dawla Sa\'adat. This marked the first time the Fatimids appointed separate rulers for the city and citadel of Aleppo since they gained direct control over the city in October 1016. Safiyy al- Dawla belonged to the Kutama, a militant Berber group that played a major role in the Fatimid military, and he was the grandson of the Fatimid general Ja\'far ibn Fallah. He was bestowed with the title" ṣafiyy al- dawla"( chosen of the State). Safiyy al- Dawla and Yumn al- Dawla were appointed to Aleppo to replace Abu\'l- Najm Badr. Nothing is known about their reign and Safiyy al- Dawla was dismissed in April 1023, and succeeded by Sanad al- Dawla Hasan.', 'title': 'Safiyy al-Dawla'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Abu Nasr Firuz Kharshadh (died December 22, 1012), better known by his "laqab" of Baha al-Dawla  was the Buyid amir of Iraq (988–1012), along with Fars and Kerman (998–1012). His early reign was dominated by struggles with his rival relatives over control of the western Persian provinces, but by 998 he managed to establish his supremacy over the Buyid confederation. His reign nevertheless saw the increasing encroachment of neighbouring powers on Buyid territory, and marks the beginning of the decline of the Buyids\' power. He was the third son of \'Adud al-Dawla.', 'title': 'Baha al-Dawla'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Abu Shuja( 993 – December 1024), better known by his" laqab" of Sultan al- Dawla( Persian: سلطان الدوله," Power of the Dynasty"), was the Buyid amir of Fars( 1012–1024) and Iraq( 1012 – 1021). He was the son of Baha\' al- Dawla.', 'title': 'Sultan al-Dawla'}]

