 {'idx': 3, 'is_supporting': True, 'paragraph_text': "Maria Theresa Walburga Amalia Christina (13 May 1717 – 29 November 1780) was the only female ruler of the Habsburg dominions and the last of the House of Habsburg. She was the sovereign of Austria, Hungary, Croatia, Bohemia, Transylvania, Mantua, Milan, Lodomeria and Galicia, the Austrian Netherlands, and Parma. By marriage, she was Duchess of Lorraine, Grand Duchess of Tuscany and Holy Roman Empress. She started her 40-year reign when her father, Emperor Charles VI, died in October 1740. Charles VI paved the way for her accession with the Pragmatic Sanction of 1713 and spent his entire reign securing it. He neglected the advice of Prince Eugene of Savoy, who averred that a strong military and a rich treasury were more important than mere signatures. Eventually, he left behind a weakened and impoverished state, particularly due to the War of the Polish Succession and the Russo-Turkish War (1735–1739). Moreover, upon his death, Saxony, Prussia, Bavaria, and France all repudiated the sanction they had recognised during his lifetime. Frederick II of Prussia (who became Maria Theresa's greatest rival for most of her reign) promptly invaded and took the affluent Habsburg province of Silesia in the seven-year conflict known as the War of the Austrian Succession. In defiance of the grave situation, she managed to secure the vital support of the Hungarians for the war effort. Over the course of the war, despite the loss of Silesia and a few minor territories in Italy, Maria Theresa successfully defended her rule over most of the Habsburg empire. Maria Theresa later unsuccessfully tried to reconquer Silesia during the Seven Years' War.\nMaria Theresa and her husband, Francis I, Holy Roman Emperor, had eleven daughters, including the Queen of France, the Queen of Naples and Sicily, the Duchess of Parma, and five sons, including two Holy Roman Emperors, Joseph II and Leopold II. Of the sixteen children, ten survived to adulthood. Though she was expected to cede power to Francis and Joseph, both of whom were officially her co-rulers in Austria and Bohemia, Maria Theresa was the absolute sovereign who ruled with the counsel of her advisers. Maria Theresa promulgated institutional, financial and educational reforms, with the assistance of Wenzel Anton of Kaunitz-Rietberg, Friedrich Wilhelm von Haugwitz and Gerard van Swieten. She also promoted commerce and the development of agriculture, and reorganised Austria's ramshackle military, all of which strengthened Austria's international standing. However, she despised the Jews and the Protestants, and on certain occasions she ordered their expulsion to remote parts of the realm. She also advocated for the state church and refused to allow religious pluralism. Consequently, her regime was criticized as intolerant by some contemporaries.", 'title': 'Maria Theresa'}
