 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Abdülaziz (Ottoman Turkish: عبد العزيز / "ʻAbdü\'l-ʻAzīz", ; 8 February 18304 June 1876) was the 32nd Sultan of the Ottoman Empire and reigned between 25 June 1861 and 30 May 1876. He was the son of Sultan Mahmud II and succeeded his brother Abdulmejid I in 1861. Born at Eyüp Palace, Constantinople (present-day Istanbul), on 8 February 1830, Abdülaziz received an Ottoman education but was nevertheless an ardent admirer of the material progress that was made in the West. He was the first Ottoman Sultan who travelled to Western Europe, visiting a number of important European capitals including Paris, London and Vienna in the summer of 1867. Apart from his passion for the Ottoman Navy, which had the world\'s third largest fleet in 1875 (after the British and French navies), the Sultan took an interest in documenting the Ottoman Empire. He was also interested in literature and was a talented classical music composer. Some of his compositions, together with those of the other members of the Ottoman dynasty, have been collected in the album "European Music at the Ottoman Court" by the London Academy of Ottoman Court Music. He was deposed on grounds of mismanaging the Ottoman economy on 30 May 1876, and was found dead six days later under unnatural and mysterious circumstances.', 'title': 'Abdülaziz'}]

