 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Matthew Aaron Good is an American musician, singer and record producer. He is best known for being the lead guitarist, lead vocalist and the only constant member of the post -hardcore band From First To Last from its conception in 1999 until now. He was formerly the guitarist of grindcore band The Color of Violence, which featured future From First to Last members Travis Richter, Derek Bloom, and Joey Antillon. He joined Chiodos vocalist Craig Owens' band, D.R.U.G.S., eventually moving on to produce music under the name Kit Fysto with friend AJ Calderon. He currently owns and operates a music recording studio in Tempe, Arizona called Good Sounds and plays guitar in From First To Last. He also produced Asking Alexandria's self titled album, which was released on 15 December 2017.", 'title': 'Matt Good'}
