 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Ocean of Wisdom, born March 8, 1997, is a retired Thoroughbred racehorse, bred by the Niarchos family, who are also responsible for champion race horses such as Bago, Dream Well, Miesque, Six Perfections and Divine Proportions. His sire is top stallion Mr. Prospector. Ocean of Wisdom ’s dam is Coup de Folie, herself a group one winner and dam of three G1 winners in Machiavellian, Exit to Nowhere and Coup de Genie. During his short racing career, Ocean of Wisdom was trained by Pascal Bary and ridden by Cash Asmussen. Ocean of Wisdom was a Group 3 winner as a two- year- old, winning the Prix La Rochette. His racing career was ended after 5 races due to injury during training, and he was retired to stud at Niarchos family's Haras de Fresnay- le- Buffard where he continues to stand. Along with Dream Well, Ocean of Wisdom is one of the few horses to have his own Blog.", 'title': 'Ocean of Wisdom'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Sweeney Todd is a 1928 British silent crime film directed by Walter West and starring Moore Marriott, Judd Green and Iris Darbyshire. It was adapted from a popular 1847 stage play by George Dibdin- Pitt called" The String of Pearls, or The Fiend of Fleet Street", which in turn was based on an anonymous story called" The String of Pearls: A Romance" that was serialized in magazine format in 1846. This was the first time the story was adapted into a play, and it featured a surprise twist ending that does n\'t appear in later stage versions of the Sweeney Todd legend. It was filmed entirely on set at Islington Studios.', 'title': 'Sweeney Todd (1928 film)'}]

