 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Konrad III the Red (pl: " Konrad III Rudy"; 1447/48 – 28 October 1503), was a Polish prince member of the House of Piast in the Masovian branch. He was a duke of Czersk, Liw, Warsaw, Nur, Łomża, Ciechanów, Różan, Zakroczym and Wyszogród during 1454-1471 jointly with his brothers (under regency until 1462), Duke of Płock, Wizna, Płońsk and Zawkrze during 1462-1471, and after the division of the paternal domains in 1471, sole ruler over Czersk and Liw, over Wyszogród during 1474-1489 and again in 1495, over Zakroczym since 1484, over Nur since 1488 and over Warsaw since 1489. He was the third son of Bolesław IV of Warsaw and Barbara Olelkovna of Slutsk-Kapy, a Lithuanian princess, (granddaughter of Vladimir Olgerdovich). The premature death of his two older brothers during 1453-1454 left him as the eldest surviving son of his family.', 'title': 'Konrad III Rudy'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Zbigniew Oleśnicki( 1430 – 1493), nephew of Cardinal Zbigniew Oleśnicki, was a Roman Catholic clergyman and Polish politician. He served as crown deputy chancellor from 1472, bishop of Kuyavia from 1472, and bishop of Gniezno and primate of Poland from 12 October 1481. He was born, about 1430, into the influential Debno noble family; he was the son of Marshal of the Kingdom of Poland Jan Oleśnicki, and the nephew of Zbigniew Cardinal Oleśnicki of Kraków During the absence of King Casimir IV Jagiellon he was deputized in several state matters including dealing with the Prussians; however, by the end of Casimirs reign their relationship had soured, probably due to a rivalry with Fryderyk Jagiellończyk, the Bishop of Kraków and Casimir's relative. After the death of Casimir, he was a strong supporter for the election of Janusz III of Masovia to be the new king. He died on 2 February 1493 in Łowicz and was buried in the Cathedral of Gniezno, where his tomb was built with red marble by Veit Stoss.", 'title': 'Zbigniew Oleśnicki (primate of Poland)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Sophia of Masovia( 1497/1498- before 11 March 1543) was a Princess of Masovia, daughter of Konrad III Rudy, Duke of Masovia and his wife Anna Radziwiłł. She was a member of the House of Piast. On 17 September 1520 in Warsaw, Sophia was married by proxy to Stephen VII Báthory. On 17 January 1521, Sophia and her entourage went to Hungary, where in February there was a formal marriage. The couple had three children: Anna, Stephen and Klara; however, other sources claim that Klara was the couple's only child. Klara was engaged to Carl, Duke of Münsterberg, but died in 1535, before the marriage took place. After the death of Stephen in 1530, Sophia was married to Croatian magnate Louis Pekry. Sophia's second marriage was childless. She then died sometime before 11 March 1543. Sophia had three siblings: Stanislaus I of Masovia, Janusz III of Masovia and Anna of Masovia, both her brothers died childless and so Anna and Sophia were the last Masovian Piasts. Soon after Janusz's death, the Duchy of Masovia was annexed into the kingdom of Poland, despite resistance from some of the Masovian nobility. They tried to retain their independence and argued that the Duchy should be inherited by the female relatives( such as Anna or Sophia). The Polish king refused to recognize their demands. Anna was made titular Duchess of Masovia.", 'title': 'Sophia of Masovia'}
