 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Monte Carlo or Bust! is a 1969 British/ French/ Italian co-production comedy film, also known by its American title, Those Daring Young Men in Their Jaunty Jalopies. The story is based on the Monte Carlo Rally – first raced in 1911 – and the film recalls this general era, set in the 1920s. A lavish all- star film( Paramount put$ 10 million behind it), it is the story of an epic car rally across Europe that involves a lot of eccentric characters from all over the world who will stop at nothing to win. The film is a sequel to the 1965 hit" Those Magnificent Men in their Flying Machines". Terry- Thomas appeared as Sir Cuthbert Ware- Armitage, the equally dastardly son of the Sir Percy Ware- Armitage, which Thomas had played in the earlier film. Some others of the cast from the first film returned, including Gert Fröbe and Eric Sykes. Like the earlier film, it was written by Ken Annakin and Jack Davies and directed by Annakin, with music by Ron Goodwin. The title tune is performed by Jimmy Durante. The credits sequence animation was the work of Ronald Searle, who was also featured in Annakin\'s earlier" Those Magnificent Men in their Flying Machines". Tony Curtis and Susan Hampshire played other contestants in the race; Curtis also starred in the similar period- piece comedy" The Great Race"( 1965) from Warner Bros. The film was originally intended to be called" Rome or Bust". The American distributors Paramount Pictures re-titled it" Those Daring Young Men in Their Jaunty Jalopies" to tie it to Annakin\'s 1965 film; re-editing also meant cuts, up to a half- hour, from the original UK release.', 'title': 'Monte Carlo or Bust!'}
