 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Nightwatching is a 2007 film about the artist Rembrandt and the creation of his painting" The Night Watch". The film is directed by Peter Greenaway and stars Martin Freeman as Rembrandt, with Eva Birthistle as his wife Saskia van Uylenburg, Jodhi May as his lover Geertje Dircx, and Emily Holmes as his other lover Hendrickje Stoffels. Reinier van Brummelen is the director of photography. James Willcock, known for his esoteric sets, is the art director. The film is described by co-producer Jean Labadie as" a return to the Greenaway of" The Draughtsman\'s Contract It features Greenaway\'s trademark neoclassical compositions and graphic sexuality. The music is by Włodek Pawlik. The film premiered in competition, at the Venice Film Festival. " Nightwatching" is the first feature in Greenaway\'s film series" Dutch Masters". The following film in the series is" Goltzius and the Pelican Company". An associated work by the same director is the documentary film" Rembrandt\'s J\'Accuse"( 2008), in which Greenaway addresses 34" mysteries" associated with the painting, illustrated by scenes from the drama.', 'title': 'Nightwatching'}
