[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Kemal Atatürk (until 1934: Mustafa Kemal Pasha; after 1935: Kamâl Atatürk; 1881 – 10 November 1938), commonly referred to as Mustafa Kemal Atatürk, was a Turkish field marshal, revolutionary statesman, author, and founder of the Republic of Turkey, serving as its first President from 1923 until his death in 1938. His leadership undertook sweeping progressive reforms, which modernized Turkey into a secular, industrial nation. Ideologically a secularist and nationalist, his policies and theories became known as Kemalism. Atatürk came to prominence for his role in securing the Ottoman Turkish victory at the Battle of Gallipoli (1915) during World War I. Following the defeat and dissolution of the Ottoman Empire, he led the Turkish National Movement, which resisted the mainland Turkey\'s partition among the victorious Allied powers. Establishing a provisional government in the present-day Turkish capital Ankara, he defeated the forces sent by the Allies, thus emerging victorious from what was later referred to as the Turkish War of Independence. He subsequently proceeded to abolish the decrepit Ottoman Empire and proclaimed the foundation of the Turkish Republic in its place. As the president of the newly formed Turkish Republic, Atatürk initiated a rigorous program of political, economic, and cultural reforms with the ultimate aim of building a modern, progressive, and secular nation-state. He made primary education free and compulsory, opening thousands of new schools all over the country. He also introduced the Latin-based Turkish alphabet, replacing the old Ottoman Turkish alphabet. Turkish women received equal civil and political rights during Atatürk\'s presidency ahead of many Western countries. In particular, women were given voting rights in local elections by Act no. 1580 on 3 April 1930 and a few years later, in 1934, full universal suffrage, earlier than most other countries in the world. His government carried out a policy of Turkicisation trying to create a homogeneous and unified nation. Under Atatürk, non-Turkish minorities were pressured to speak Turkish in public, non-Turkish toponyms and last names of minorities had to be changed to Turkish renditions. The Turkish Parliament granted him the surname Atatürk in 1934, which means "Father of the Turks", in recognition of the role he played in building the modern Turkish Republic. He died on 10 November 1938 at the age of 57 in Dolmabahçe Palace; he was succeeded as President by his long-time Prime Minister İsmet İnönü and was honored with a state funeral. His iconic mausoleum, built and opened in 1953, is surrounded by a park called the Peace Park in honor of his famous expression "Peace at Home, Peace in the World". In 1981, the centennial of Atatürk\'s birth, his memory was honoured by the UN and UNESCO, which declared it "The Atatürk Year in the World" and adopted the Resolution on the Atatürk Centennial, describing him as "the leader of the first struggle given against colonialism and imperialism" and a "remarkable promoter of the sense of understanding between peoples and durable peace between the nations of the world and that he worked all his life for the development of harmony and cooperation between peoples without distinction". Atatürk is commemorated by many memorials throughout Turkey and numerous countries all over the world, where place names are named in honor of him. Eleftherios Venizelos, former Prime Minister of Greece, forwarded Atatürk\'s name for the 1934 Nobel Peace Prize.', 'title': 'Mustafa Kemal Atatürk'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': "Sabiha Gökçen (22 March 1913 – 22 March 2001) was a Turkish aviator. She was the world's first female fighter pilot, aged 23. Others such as Marie Marvingt and Evgeniya Shakhovskaya preceded her as military pilots in other roles, but not as fighter pilots and without military academy enrollment. She was an orphan, and one of the thirteen adopted children of Mustafa Kemal Atatürk. She is recognized as the first female combat pilot by The Guinness Book of World Records and was selected as the only female pilot for the poster of The 20 Greatest Aviators in History published by the United States Air Force in 1996.", 'title': 'Sabiha Gökçen'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Ancient Egyptian artisan Sennedjem lived in Set Maat( translated as" The Place of Truth"), contemporary Deir el- Medina, on the west bank of the Nile, opposite Thebes, during the reigns of Seti I and Ramesses II. Sennedjem had the title" Servant in the Place of Truth". He was buried along with his wife, Iyneferti, and family in a tomb in the village necropolis. His tomb was discovered January 31, 1886. When Sennedjem\'s tomb was found, in it there was regular furniture from his home, including a stool and a bed, which he actually used when he was alive. His titles included Servant in the Place of Truth, meaning that he worked on the excavation and decoration of the nearby royal tombs.', 'title': 'Sennedjem'}
