 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Istanbul Sabiha Gökçen International Airport is one of two international airports serving Istanbul, the largest city in Turkey. Located southeast of the city center, Sabiha Gökçen Airport is in the Asian part of the bi-continental Istanbul and serves as the hub for some airlines, including Pegasus Airlines as well as a secondary base for Turkish Airlines and Borajet( currently suspended). The facility is named after Sabiha Gökçen, adoptive daughter of Mustafa Kemal Atatürk and the first female fighter pilot in the world. Although Istanbul Airport, located away on the European side of Istanbul, is larger, Sabiha Gökçen is still one of the largest airports in the country.', 'title': 'Istanbul Sabiha Gökçen International Airport'}
