 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'The Heart of the World is a short film written and directed by Guy Maddin, produced for the 2000 Toronto International Film Festival. Maddin was one of a number of directors( including Atom Egoyan and David Cronenberg) commissioned to make four- minute short films that would screen prior to the various feature films at the 2000 festival. After hearing rumours that other directors were planning films with a small number of shots, Maddin decided that his film would instead contain over 100 shots per minute, and enough plot for a feature- length film. Maddin then wrote and shot" The Heart of the World" in the style of Russian constructivism, taking the commission at its literal face value, as a call to produce a propaganda film. Even in its expanded, 6- minute version," The Heart of the World" runs at a breakneck speed, averaging roughly two shots per second, a pace intensified by the background music," Time, Forward!" by Georgy Sviridov.', 'title': 'The Heart of the World'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': "Guy Maddin,( born February 28, 1956) is a Canadian screenwriter, director, author, cinematographer, and film editor of both features and short films, as well as an installation artist, from Winnipeg, Manitoba. His most distinctive quality is his penchant for recreating the look and style of silent or early- sound- era films. Since completing his first film in 1985, Maddin has become one of Canada's most well- known and celebrated filmmakers. Maddin has directed twelve feature films and numerous short films, in addition to publishing three books and creating a host of installation art projects. A number of Maddin's recent films began as or developed from installation art projects, and his books also relate to his film work. Maddin has been the subject of much critical praise and academic attention, including two books of interviews with Maddin and two book- length academic studies of his work. Maddin was appointed to the Order of Canada, the country's highest civilian honour, in 2012. Maddin was Visiting Lecturer on Visual and Environmental Studies, 2015 – 16, at Harvard University.", 'title': 'Guy Maddin'}
