 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'A Touch of Class is a 1973 British romantic comedy film directed by Melvin Frank which tells the story of a couple having an affair, who find themselves falling in love. It stars George Segal, Glenda Jackson, Hildegarde Neil, Paul Sorvino and K Callan. It was adapted by Melvin Frank and Jack Rose from Frank\'s story" She Loves Me, She Told Me So Last Night". However, it bears more than a passing resemblance to an earlier Frank film," The Facts of Life"( 1960), which likewise dealt with a middle- aged couple trying to have an affair, centering on a disaster- laden trip to a place where they would not be recognized. The lead role of Steve was originally offered to Cary Grant, with a promise by Frank to rewrite the script to play up the age difference between Steve and Vickie. However, Grant opted to remain in retirement from filmmaking, and he turned the role down. He did remain connected to the film, however, as it was produced by Fabergé\'s Brut Productions, and Grant was on the board of directors for Fabergé. Roger Moore was also offered the lead role before dropping out to star in" Live and Let Die", his first appearance as James Bond. Moore did, however, have a hand in the production of this film. Glenda Jackson revealed that she was approached by the director Melvin Frank after appearing on the comedy sketch and variety program" The Morecambe& Wise Show" on the BBC in the United Kingdom in 1971, in the" Antony and Cleopatra" sketch. After her role in this film won her an Oscar, Eric Morecambe sent her a telegram reading," Stick with us and we will get you another one".', 'title': 'A Touch of Class (film)'}
