 {'idx': 1, 'is_supporting': True, 'paragraph_text': "Attack of Life: The Bang Tango Movie is a 2015 documentary film about American hard rock band Bang Tango. The film is directed and edited by Drew Fortier, and features interviews with band members, fans, producers, and musical contemporaries such as Howard Benson, Riki Rachtman, Andrew Wilkow, Mandy Lion, Chip Z'nuff, as well as an opening narration by Twisted Sister frontman Dee Snider. The film received positive reviews.", 'title': 'Attack of Life: The Bang Tango Movie'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'King Kong is a 2005 epic monster adventure film co-written, produced, and directed by Peter Jackson. A second remake of the 1933 film of the same title, the film stars Naomi Watts, Jack Black, Adrien Brody, and, through motion capture, Andy Serkis as the title character. Set in 1933, it follows the story of an ambitious filmmaker who coerces his cast and hired ship crew to travel to the mysterious Skull Island. There, they encounter bizarre creatures living on the island as well as a legendary giant gorilla known as Kong, whom they capture and take to New York City. Filming for" King Kong" took place in New Zealand from September 2004 to March 2005. The project\'s budget climbed from an initial$ 150 million to a then- record- breaking$ 207 million. It was released on December 14, 2005 in Germany and the United States, and made an opening of$ 50.1 million. While it performed lower than expected," King Kong" made domestic and worldwide grosses that eventually added up to$ 550 million, becoming the fourth- highest- grossing film in Universal Pictures history at the time and the fifth- highest- grossing film of 2005. It also generated$ 100 million in DVD sales upon its home video release. The film garnered positive reviews from critics and appeared on several top ten lists for 2005. It was praised for its special effects, performances, sense of spectacle and comparison to the 1933 original while some criticised its 3- hour run time. It won three Academy Awards: Best Sound Editing, Best Sound Mixing and Best Visual Effects. A tie- in video game was released alongside the film, which also became a commercial success.', 'title': 'King Kong (2005 film)'}
