 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Sir Peter Robert Jackson (born 31 October 1961) is a New Zealand film director, screenwriter, and film producer. He is best known as the director, writer, and producer of the "Lord of the Rings" trilogy (2001–03) and the "Hobbit" trilogy (2012–14), both of which are adapted from the novels of the same name by J. R. R. Tolkien. Other films include the critically lauded drama "Heavenly Creatures" (1994), the mockumentary film "Forgotten Silver" (1995), the horror comedy "The Frighteners" (1996), the epic monster remake film "King Kong" (2005), the supernatural drama film "The Lovely Bones" (2009), and the World War I documentary film "They Shall Not Grow Old" (2018). He produced "District 9" (2009), "The Adventures of Tintin" (2011), "West of Memphis" (2012), and "Mortal Engines" (2018). He is the third-highest grossing film director, his films having made over $6.5 billion worldwide. Jackson began his career with the "splatstick" horror comedy "Bad Taste" (1987) and the black comedy "Meet the Feebles" (1989) before filming the zombie comedy "Braindead" (1992). He shared a nomination for Academy Award for Best Original Screenplay with his partner Fran Walsh for "Heavenly Creatures", which brought him to mainstream prominence in the film industry. Jackson has been awarded three Academy Awards for  (2003), including the award for Best Director. His other awards include a Golden Globe, four Saturn Awards and three BAFTAs among others. His production company is WingNut Films, and his most regular collaborators are co-writers and producers Walsh and Philippa Boyens. Jackson was made a Companion of the New Zealand Order of Merit in 2002. He was later knighted (as a Knight Companion of the New Zealand Order of Merit) by Anand Satyanand, the Governor-General of New Zealand, at a ceremony in Wellington in April 2010. In December 2014, Jackson was awarded a star on the Hollywood Walk of Fame.', 'title': 'Peter Jackson'}
