 {'idx': 5, 'is_supporting': False, 'paragraph_text': "The Kansas City Spurs were an American professional soccer team who played in the North American Soccer League, based in Kansas City, Missouri. They played their home games at Kansas City Municipal Stadium, former home of the Kansas City Chiefs, Kansas City Athletics, and Kansas City Royals. The club was previously known as the Chicago Spurs of the National Professional Soccer League but were relocated to Kansas City following the merger of the NPSL and the United Soccer Association to form the NASL in 1967. The Spurs won the NASL Championship in 1969 but were dissolved shortly after the 1970 NASL season. The club's colors were red and white.", 'title': 'Kansas City Spurs'}
